INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1,'3/4 sit-up','The 3/4 sit-up is an abdominal exercise performed with body weight. It involves curling the torso up to a 45-degree angle, engaging the abs, hip flexors, and lower back. This movement is commonly used to build core strength and stability.','waist','hip flexors, lower back','https://v2.exercisedb.io/image/MhbTtq9EF0ftcl');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (2,'45° side bend','The 45° side bend is a bodyweight exercise targeting the abdominal muscles, particularly the obliques. It involves bending the torso to the side while standing, engaging the core for stability and control.','waist','obliques','https://v2.exercisedb.io/image/RvH0g8JinUFj83');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (3,'air bike','The air bike is a bodyweight exercise targeting the abdominal muscles and hip flexors. It involves a pedaling motion while lying on your back, alternating elbow-to-knee contact to engage the core.','waist','hip flexors','https://v2.exercisedb.io/image/Biz8FZvAF8ykJK');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (4,'alternate heel touchers','Alternate heel touchers is a bodyweight exercise targeting the abdominal muscles, particularly the obliques. It involves lying on your back, lifting your shoulders, and reaching side to side to touch your heels, engaging your core throughout.','waist','obliques','https://v2.exercisedb.io/image/YbziE1eAyU5fXG');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (5,'alternate lateral pulldown','The alternate lateral pulldown is a cable machine exercise targeting the latissimus dorsi, with secondary emphasis on the biceps and rhomboids. It involves pulling handles towards the chest in an alternating fashion, focusing on back strength and muscle engagement.','back','biceps, rhomboids','https://v2.exercisedb.io/image/sOfV4CTS5qQZjz');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (6,'assisted chest dip (kneeling)','The assisted chest dip (kneeling) is a chest-focused exercise performed on a leverage machine, where the user kneels on a pad for support. This machine-assisted variation helps reduce the load, making it accessible for those building strength or learning proper dip technique.','chest','triceps, shoulders','https://v2.exercisedb.io/image/FmKnPck2BBOYRZ');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (7,'assisted hanging knee raise with throw down','The assisted hanging knee raise with throw down is an advanced core exercise that targets the abdominal muscles, with additional engagement of the hip flexors and lower back. The movement involves hanging from a pull-up bar, raising the knees to the chest, and then explosively throwing the legs downward, requiring significant core strength, coordination, and control.','waist','hip flexors, lower back','https://v2.exercisedb.io/image/YxP9d5AWuPSo92');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (8,'assisted hanging knee raise','The assisted hanging knee raise is an abdominal exercise performed while hanging from a pull-up bar, using assistance to help lift the knees toward the chest. It primarily targets the abs and also works the hip flexors.','waist','hip flexors','https://v2.exercisedb.io/image/t0GjNO52Rl532f');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (9,'assisted lying leg raise with lateral throw down','The assisted lying leg raise with lateral throw down is an abdominal exercise that targets the abs while also engaging the hip flexors and obliques. The movement involves lifting the legs while lying on your back, then lowering them to each side in a controlled manner, which challenges core stability and strength.','waist','hip flexors, obliques','https://v2.exercisedb.io/image/aLFJXx7-QJGDlE');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (10,'assisted lying leg raise with throw down','The assisted lying leg raise with throw down is an abdominal exercise that targets the abs while also engaging the hip flexors and quadriceps. The movement involves raising the legs while lying on your back, then forcefully lowering them (throwing them down) and raising them again, often with a partner providing resistance or assistance.','waist','hip flexors, quadriceps','https://v2.exercisedb.io/image/27De4dyJV37fvM');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (11,'assisted motion russian twist','The assisted motion Russian twist is a core exercise performed with a medicine ball. It targets the abdominal muscles and also engages the obliques and lower back. The movement involves twisting the torso from side to side while holding a medicine ball, which adds resistance and helps build core strength and stability.','waist','obliques, lower back','https://v2.exercisedb.io/image/dN4jdibpWXckr1');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (12,'assisted parallel close grip pull-up','The assisted parallel close grip pull-up is a back exercise performed on a leverage machine that helps users perform pull-ups with added support, making it easier to complete the movement and focus on form.','back','biceps, forearms','https://v2.exercisedb.io/image/AAWNoSFvi3HxZs');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (13,'assisted prone hamstring','The assisted prone hamstring exercise targets the hamstrings with assistance from a partner or resistance band, making it accessible for those developing strength or needing support. It involves lying face down and curling the legs towards the glutes, focusing on hamstring engagement.','upper legs','glutes, lower back','https://v2.exercisedb.io/image/Nz3sZ92VHXEPtF');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (14,'assisted pull-up','The assisted pull-up is a machine-based exercise that helps users perform pull-ups with added support, making it easier to lift their body weight. It primarily targets the latissimus dorsi (lats) and also engages the biceps and forearms.','back','biceps, forearms','https://v2.exercisedb.io/image/pa1777eIMRc6j6');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (15,'assisted standing triceps extension (with towel)','The assisted standing triceps extension (with towel) is an exercise targeting the triceps using a towel for assistance. It is performed standing, with the towel held behind the head, extending the arms upward to work the triceps.','upper arms','shoulders','https://v2.exercisedb.io/image/7nG6JgrKygrfSN');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (16,'assisted triceps dip (kneeling)','The assisted triceps dip (kneeling) is performed on a leverage machine, allowing users to target the triceps with support, making the exercise accessible for those who may not yet have the strength for unassisted dips. It also engages the chest and shoulders as secondary muscles.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/YiK9kQ0tFytkJj');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (17,'balance board','The balance board exercise involves standing on a balance board with one foot, engaging the core and lower body muscles to maintain stability and balance. This exercise primarily targets the quads, while also engaging the calves, hamstrings, and glutes as secondary muscles.','upper legs','calves, hamstrings, glutes','https://v2.exercisedb.io/image/SzxiTqgNntXPSC');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (18,'barbell pullover to press','The barbell pullover to press is a compound exercise that targets the lats and also works the triceps, chest, and shoulders. It involves lowering a barbell behind your head while lying on a bench, then pressing it back up over your chest.','back','triceps, chest, shoulders','https://v2.exercisedb.io/image/U7BucMj5U82lwQ');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (19,'barbell alternate biceps curl','The barbell alternate biceps curl is a strength exercise targeting the biceps, performed by alternately curling a barbell with each arm while standing. It also engages the forearms as secondary muscles.','upper arms','forearms','https://v2.exercisedb.io/image/WEUnlsifxe9LB0');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (20,'barbell bench front squat','The barbell bench front squat is a compound lower body exercise that targets the quadriceps, with secondary emphasis on the hamstrings, glutes, and calves. It requires holding a barbell in the front rack position and performing a squat, demanding good core stability, balance, and mobility.','upper legs','hamstrings, glutes, calves','https://v2.exercisedb.io/image/yqyw-j4Ew9Pivd');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (21,'barbell bench press','The barbell bench press is a classic compound exercise that primarily targets the pectoral muscles, while also engaging the triceps and shoulders. It is performed by lying on a bench and pressing a barbell up and down in a controlled manner.','chest','triceps, shoulders','https://v2.exercisedb.io/image/xOvWqGYRkXbLVO');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (22,'barbell bench squat','The barbell bench squat is a compound lower body exercise that primarily targets the quadriceps, while also engaging the glutes, hamstrings, and calves. It involves squatting with a barbell, requiring good technique and strength.','upper legs','glutes, hamstrings, calves','https://v2.exercisedb.io/image/Osm4mfo4yQ0mRp');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (23,'barbell bent over row','The barbell bent over row is a compound exercise targeting the upper back, requiring the lifter to hinge at the hips and pull a barbell towards the torso. It develops strength and muscle mass in the upper back, biceps, and forearms, and demands good posture and core stability.','back','biceps, forearms','https://v2.exercisedb.io/image/8R45ZNp6ZleQjB');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (24,'barbell clean and press','The barbell clean and press is a compound exercise that targets the quads and involves lifting a barbell from the floor to the shoulders (clean) and then pressing it overhead (press). It requires strength, coordination, and explosive power.','upper legs','hamstrings, glutes, shoulders, triceps','https://v2.exercisedb.io/image/cMnRfoUkDLsG2A');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (25,'barbell clean-grip front squat','The barbell clean-grip front squat is a compound lower body exercise that targets the glutes, quadriceps, and hamstrings, while also engaging the core for stability. It requires holding a barbell in the clean grip position on the front of the shoulders, demanding good mobility and strength.','upper legs','quadriceps, hamstrings, calves, core','https://v2.exercisedb.io/image/es-pr2BD2GK4lW');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (26,'barbell close-grip bench press','The barbell close-grip bench press is a compound exercise primarily targeting the triceps, with secondary emphasis on the chest and shoulders. It is performed by lying on a bench, gripping the barbell with a close grip, and pressing the weight up and down while keeping the elbows close to the body.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/5EDMQgtRmBaaYZ');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (27,'barbell curl','The barbell curl is a classic strength exercise targeting the biceps, performed by curling a barbell from the thighs to the shoulders while keeping the elbows close to the torso.','upper arms','forearms','https://v2.exercisedb.io/image/c7AlgDQ-7S2igU');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (28,'barbell deadlift','The barbell deadlift is a compound strength exercise that targets the glutes, hamstrings, and lower back. It involves lifting a loaded barbell from the ground to a standing position, emphasizing proper form and core engagement.','upper legs','hamstrings, lower back','https://v2.exercisedb.io/image/YLtC3LrgXpG-zU');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (29,'barbell decline bench press','The barbell decline bench press is a compound exercise targeting the lower portion of the pectoral muscles. It is performed on a decline bench, requiring the lifter to press a barbell upward from a declined position, engaging the chest, triceps, and shoulders.','chest','triceps, shoulders','https://v2.exercisedb.io/image/OW5h3URsJ1X1Xe');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (30,'barbell decline bent arm pullover','The barbell decline bent arm pullover is a compound exercise primarily targeting the lats, performed on a decline bench with a barbell. It also engages the triceps and chest as secondary muscles. The movement requires good control and strength to safely lower and lift the barbell over the head while maintaining proper form.','back','triceps, chest','https://v2.exercisedb.io/image/GDUI06s5pY21kz');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (31,'barbell decline close grip to skull press','The barbell decline close grip to skull press is a compound exercise targeting the triceps, performed on a decline bench with a close grip on the barbell. It combines elements of a close grip press and a skull crusher, challenging both triceps strength and stability.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/eoGEcOWb2MUpuQ');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (32,'barbell decline wide-grip press','The barbell decline wide-grip press is a compound chest exercise performed on a decline bench using a barbell with a wide grip. It targets the lower portion of the pectoral muscles and also engages the triceps and shoulders.','chest','triceps, shoulders','https://v2.exercisedb.io/image/kqyieohLvd51cT');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (33,'barbell decline wide-grip pullover','The barbell decline wide-grip pullover is a compound exercise performed on a decline bench, targeting the lats while also engaging the triceps and chest. It requires a barbell and involves lowering the weight behind the head with straight arms, then returning to the starting position.','back','triceps, chest','https://v2.exercisedb.io/image/jIz8WtM1j5TvHJ');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (34,'barbell drag curl','The barbell drag curl is a biceps-focused exercise that involves curling a barbell while keeping the elbows pulled back, emphasizing the contraction of the biceps and minimizing shoulder involvement. It also engages the forearms as secondary muscles.','upper arms','forearms','https://v2.exercisedb.io/image/FhOGfvefm8PtWF');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (35,'barbell front chest squat','The barbell front chest squat is a compound lower body exercise that targets the glutes and also works the quadriceps, hamstrings, calves, and core. It involves holding a barbell at the front of the chest and performing a squat, which requires strength, balance, and proper technique.','upper legs','quadriceps, hamstrings, calves, core','https://v2.exercisedb.io/image/sZDHrn8KCUpIdo');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (36,'barbell front raise and pullover','The barbell front raise and pullover is a compound exercise targeting the pectorals, with secondary emphasis on the deltoids and triceps. It involves raising a barbell in front of the body and then performing a pullover motion behind the head, requiring strength, coordination, and shoulder mobility.','chest','deltoids, triceps','https://v2.exercisedb.io/image/rsWbDCDDIMwGY0');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (37,'barbell front raise','The barbell front raise is a shoulder exercise that targets the deltoids by lifting a barbell from the thighs to shoulder height with straight arms.','shoulders','biceps, triceps','https://v2.exercisedb.io/image/li4Gdho7Xzrxgv');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (38,'barbell front squat','The barbell front squat is a compound lower body exercise that targets the glutes, quadriceps, and hamstrings, while also engaging the core for stability. The barbell is held in front of the shoulders, requiring good mobility and core strength to maintain proper posture throughout the movement.','upper legs','quadriceps, hamstrings, calves, core','https://v2.exercisedb.io/image/-f6HZdAUzyRdDN');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (39,'barbell full squat','The barbell full squat is a compound lower body exercise that targets the glutes and also works the quadriceps, hamstrings, calves, and core. It involves squatting down with a barbell placed across the upper back, requiring strength, balance, and proper technique.','upper legs','quadriceps, hamstrings, calves, core','https://v2.exercisedb.io/image/2ayMUUbzVGUbHe');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (40,'barbell good morning','The barbell good morning is a compound exercise that targets the hamstrings and lower back. It involves hinging at the hips with a barbell on your upper back, requiring good form and core stability to perform safely.','upper legs','lower back','https://v2.exercisedb.io/image/PU06HHRKmmHfu7');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (41,'barbell guillotine bench press','The barbell guillotine bench press is a variation of the bench press where the bar is lowered to the neck instead of the chest, placing greater emphasis on the upper pectorals. This exercise requires careful control and proper technique to avoid injury.','chest','shoulders, triceps','https://v2.exercisedb.io/image/QZh7bgdo-dK2WX');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (42,'barbell hack squat','The barbell hack squat is a lower body strength exercise that targets the glutes, quadriceps, hamstrings, and calves. It involves holding a barbell behind the legs and performing a squat motion, emphasizing the posterior chain and quadriceps.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/xwMwQvDKtUKPfT');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (43,'barbell incline bench press','The barbell incline bench press is a compound upper-body exercise that targets the upper portion of the pectoral muscles, with secondary emphasis on the shoulders and triceps. It is performed on an incline bench using a barbell, making it a staple in strength training routines for developing chest size and strength.','chest','shoulders, triceps','https://v2.exercisedb.io/image/1m-rnsMVJxmKVu');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (44,'barbell incline reverse-grip press','The barbell incline reverse-grip press is a compound upper body exercise that targets the triceps while also engaging the chest and shoulders. It is performed on an incline bench using a reverse (underhand) grip on the barbell.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/yhJoVNooa6Da4b');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (45,'barbell incline row','The barbell incline row is a compound exercise targeting the upper back, performed while lying face down on an incline bench and pulling a barbell towards the chest.','back','biceps, forearms','https://v2.exercisedb.io/image/4c7a9uNIYNF3SZ');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (46,'barbell incline shoulder raise','The barbell incline shoulder raise is performed on an incline bench and targets the serratus anterior, with secondary emphasis on the deltoids and trapezius. The movement involves raising a barbell overhead from shoulder height while seated on an incline bench.','chest','deltoids, trapezius','https://v2.exercisedb.io/image/FpnsxUnVpK4V7R');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (47,'barbell jefferson squat','The barbell Jefferson squat is a compound lower body exercise that targets the glutes, quadriceps, hamstrings, and calves. It involves holding a barbell between the legs and performing a squat with a staggered stance, alternating foot positions with each repetition.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/bMN-nO5okNHZAy');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (48,'barbell jm bench press','The barbell JM bench press is a triceps-focused pressing movement that combines elements of a close-grip bench press and a triceps extension. It is performed lying on a bench, lowering the barbell to the chest with elbows tucked, and pressing back up.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/4bv0IG87Auj5u8');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (49,'barbell jump squat','The barbell jump squat is a dynamic lower body exercise that combines the traditional squat with an explosive jump, performed while holding a barbell across the upper back. This exercise targets the glutes and also works the quadriceps, hamstrings, and calves. It is a plyometric movement that develops power, strength, and explosiveness in the legs.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/RJAZ6AmWLRSWER');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (50,'barbell lunge','The barbell lunge is a compound lower body exercise that targets the glutes, quadriceps, hamstrings, and calves. It involves stepping forward with a barbell on your upper back and lowering your body into a lunge position before returning to standing.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/91NgDRt-k-lGxX');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (51,'barbell lying close-grip press','The barbell lying close-grip press is a compound upper body exercise that primarily targets the triceps, with secondary emphasis on the chest and shoulders. It is performed lying on a bench, using a close grip on the barbell to increase triceps activation.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/HQi-yl7Eu3GcIZ');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (52,'barbell lying close-grip triceps extension','The barbell lying close-grip triceps extension is a strength exercise targeting the triceps, performed lying on a bench with a barbell using a close grip. It emphasizes triceps development and also engages the shoulders as secondary muscles.','upper arms','shoulders','https://v2.exercisedb.io/image/DChYoGXhs5Q9ES');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (53,'barbell lying extension','The barbell lying extension, also known as a skullcrusher, is a strength exercise targeting the triceps. It involves lying on a bench and lowering a barbell towards the forehead by bending the elbows, then extending the arms back up.','upper arms','shoulders','https://v2.exercisedb.io/image/J7Ke9l7JUD8OKP');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (54,'barbell lying lifting (on hip)','The barbell lying lifting (on hip) exercise primarily targets the glutes and also works the hamstrings and quadriceps. It involves lying on your back on a bench, placing a barbell across your hips, and lifting your hips upward by engaging your glutes.','upper legs','hamstrings, quadriceps','https://v2.exercisedb.io/image/t-Fl4pav7EhKfs');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (55,'barbell lying preacher curl','The barbell lying preacher curl is an isolation exercise targeting the biceps, performed on a preacher bench to minimize shoulder involvement and maximize biceps engagement.','upper arms','forearms','https://v2.exercisedb.io/image/UtMXXEkZ7K8pLz');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (56,'barbell lying triceps extension skull crusher','The barbell lying triceps extension, also known as the skull crusher, is a strength exercise that targets the triceps. Performed lying on a bench, it involves lowering a barbell to the forehead and extending the arms back up, requiring control and proper form to avoid injury.','upper arms','shoulders','https://v2.exercisedb.io/image/4UxgJykc8KPNQu');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (57,'barbell lying triceps extension','The barbell lying triceps extension is a strength exercise targeting the triceps, performed by lying on a bench and lowering a barbell towards the forehead before extending the arms back up.','upper arms','shoulders','https://v2.exercisedb.io/image/BLodKpvjGC-e6e');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (58,'barbell narrow stance squat','The barbell narrow stance squat is a lower body strength exercise that targets the glutes, with significant involvement of the quadriceps, hamstrings, and calves. It is performed by holding a barbell across the upper back and squatting with a narrow stance, emphasizing the inner thighs and glutes.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/kol7YYprikuhXP');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (59,'barbell one arm bent over row','The barbell one arm bent over row is a unilateral strength exercise targeting the upper back, requiring balance, coordination, and core stability. It is performed by bending at the hips, keeping the back straight, and rowing a barbell with one arm while maintaining a stable position.','back','biceps, forearms','https://v2.exercisedb.io/image/J0eV47LlZ0cSVD');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (60,'barbell one arm floor press','The barbell one arm floor press is a unilateral pressing exercise that targets the triceps while also engaging the chest and shoulders. It requires the lifter to stabilize the barbell with one arm while lying on the floor, which increases the demand on core stability and coordination.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/plV0aJwMkd9lDB');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (61,'barbell one arm side deadlift','The barbell one arm side deadlift is a unilateral deadlift variation that targets the glutes, hamstrings, quadriceps, and lower back. It requires holding a barbell in one hand and performing a deadlift motion to the side of the body, challenging balance, grip strength, and core stability.','upper legs','hamstrings, quadriceps, lower back','https://v2.exercisedb.io/image/liYWWDlghdtaFT');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (62,'barbell one arm snatch','The barbell one arm snatch is an explosive, full-body movement that targets the shoulders (delts) and also engages the traps, forearms, and core. It requires coordination, balance, and strength to perform safely and effectively.','shoulders','traps, forearms, core','https://v2.exercisedb.io/image/cijiKH1yor-dBK');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (63,'barbell one leg squat','The barbell one leg squat is a challenging lower body exercise that targets the quadriceps while also engaging the glutes, hamstrings, and calves. It requires significant balance, strength, and coordination, as you perform a squat on one leg while holding a barbell across your upper back.','upper legs','glutes, hamstrings, calves','https://v2.exercisedb.io/image/O4TKLjpkX2OYLw');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (64,'barbell overhead squat','The barbell overhead squat is a compound exercise that targets the quads and requires holding a barbell overhead while performing a squat. It demands significant strength, balance, mobility, and coordination.','upper legs','glutes, hamstrings, calves, core','https://v2.exercisedb.io/image/5WMPwRD3Qlafgh');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (65,'barbell preacher curl','The barbell preacher curl is an isolation exercise that targets the biceps by using a preacher bench to stabilize the upper arms, minimizing shoulder movement and maximizing biceps engagement. It is performed with a barbell and is effective for building biceps strength and size.','upper arms','forearms','https://v2.exercisedb.io/image/PzNDRPtWAyu5ne');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (66,'barbell press sit-up','The barbell press sit-up is an advanced abdominal exercise that combines a traditional sit-up with a barbell press, engaging the abs, shoulders, and chest. It requires significant core strength, coordination, and balance to safely press the barbell while performing the sit-up motion.','waist','shoulders, chest','https://v2.exercisedb.io/image/WAkiuYmfb2aOBH');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (67,'barbell prone incline curl','The barbell prone incline curl is a biceps-focused exercise performed lying face down on an incline bench. This position isolates the biceps and minimizes cheating by preventing the use of momentum or swinging. It primarily targets the biceps, with secondary engagement of the forearms.','upper arms','forearms','https://v2.exercisedb.io/image/-kAJlV5hfMPW6B');
