INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (268,'dumbbell hammer curl','The dumbbell hammer curl is a strength exercise targeting the biceps and forearms. It is performed by curling dumbbells with a neutral grip (palms facing each other), which emphasizes the brachialis and brachioradialis muscles.','upper arms','forearms','https://v2.exercisedb.io/image/W1-CMJykyOhlVi');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (269,'dumbbell incline bench press','The dumbbell incline bench press is a compound upper body exercise that targets the upper portion of the pectoral muscles, with additional emphasis on the shoulders and triceps. It is performed on an incline bench using dumbbells, requiring stability and control throughout the movement.','chest','shoulders, triceps','https://v2.exercisedb.io/image/zBPRoRzofbqYjB');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (270,'dumbbell incline biceps curl','The dumbbell incline biceps curl is a strength exercise targeting the biceps, performed on an incline bench to increase the stretch and activation of the biceps muscle. It also engages the forearms as secondary muscles.','upper arms','forearms','https://v2.exercisedb.io/image/DEMUrT5qejPVsp');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (271,'dumbbell incline breeding','The dumbbell incline breeding (likely a typo for \'dumbbell incline bench press\' or \'dumbbell incline fly\') is a chest exercise performed on an incline bench using dumbbells. It targets the upper chest (pectorals) and also works the shoulders and triceps.','chest','shoulders, triceps','https://v2.exercisedb.io/image/i1ORztTSPrJinx');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (272,'dumbbell incline curl v. 2','The dumbbell incline curl v. 2 is a biceps-focused exercise performed on an incline bench. It isolates the biceps and forearms, requiring controlled movement to maximize muscle engagement.','upper arms','forearms','https://v2.exercisedb.io/image/d7NqyUUZfvApNY');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (273,'dumbbell incline curl','The dumbbell incline curl is an isolation exercise targeting the biceps. Performed on an incline bench, it emphasizes the stretch and contraction of the biceps by reducing the involvement of the shoulders. This exercise is effective for building biceps strength and size.','upper arms','forearms','https://v2.exercisedb.io/image/ci28ZZT68r-5YP');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (274,'dumbbell incline fly','The dumbbell incline fly is a chest exercise performed on an incline bench, targeting the upper pectoral muscles. It involves lowering dumbbells out to the sides in a wide arc and then bringing them back together, emphasizing a stretch and contraction of the chest.','chest','shoulders','https://v2.exercisedb.io/image/3ssGRf-Cd-Dw9W');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (275,'dumbbell incline hammer curl','The dumbbell incline hammer curl is an upper arm exercise that targets the biceps and also works the forearms. It is performed while sitting on an incline bench, which increases the stretch on the biceps and challenges the muscles through a greater range of motion.','upper arms','forearms','https://v2.exercisedb.io/image/YyxiltESlQVW8o');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (276,'dumbbell incline hammer press','The dumbbell incline hammer press is a chest exercise performed on an incline bench using dumbbells, with a neutral grip (palms facing each other). It targets the upper chest (pectorals) and also works the shoulders and triceps.','chest','shoulders, triceps','https://v2.exercisedb.io/image/z6ueqwis0vRRCn');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (277,'dumbbell incline inner biceps curl','The dumbbell incline inner biceps curl is an isolation exercise targeting the biceps, performed on an incline bench to increase the stretch and activation of the muscle. It also engages the forearms as secondary muscles.','upper arms','forearms','https://v2.exercisedb.io/image/YBR08k6cdAozqI');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (278,'dumbbell incline one arm lateral raise','The dumbbell incline one arm lateral raise is a shoulder isolation exercise performed on an incline bench. It targets the deltoid muscles and helps improve shoulder strength and stability.','shoulders','trapezius, triceps','https://v2.exercisedb.io/image/WI93GUiGrIP1De');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (279,'dumbbell incline palm-in press','The dumbbell incline palm-in press is a chest exercise performed on an incline bench with dumbbells, focusing on the upper pectorals while also engaging the shoulders and triceps. The palms face each other throughout the movement, which can reduce shoulder strain and emphasize the inner chest.','chest','shoulders, triceps','https://v2.exercisedb.io/image/2q680vFTr-JNr4');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (280,'dumbbell incline raise','The dumbbell incline raise is a shoulder exercise performed on an incline bench, targeting the deltoid muscles. It also engages the trapezius and triceps as secondary muscles. The movement involves raising dumbbells from shoulder height to overhead while maintaining a stable position on the bench.','shoulders','trapezius, triceps','https://v2.exercisedb.io/image/HgpiBDBnSCKzWa');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (281,'dumbbell incline rear lateral raise','The dumbbell incline rear lateral raise targets the rear deltoids with secondary emphasis on the traps and rhomboids. It is performed on an incline bench to isolate the rear shoulder muscles.','shoulders','traps, rhomboids','https://v2.exercisedb.io/image/2CE0BPCs2E20aw');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (282,'dumbbell incline row','The dumbbell incline row is a strength exercise targeting the upper back, performed on an incline bench with dumbbells. It emphasizes scapular retraction and upper back development while also engaging the biceps and shoulders.','back','biceps, shoulders','https://v2.exercisedb.io/image/6dinak-fm11LSq');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (283,'dumbbell incline shoulder raise','The dumbbell incline shoulder raise targets the serratus anterior and also works the deltoids and trapezius. It is performed on an incline bench and involves raising dumbbells above the head while maintaining control and proper form.','chest','deltoids, trapezius','https://v2.exercisedb.io/image/X6cILwnC68OHay');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (284,'dumbbell incline shrug','The dumbbell incline shrug targets the trapezius muscles by having the lifter sit on an incline bench and perform a shrugging motion with dumbbells. This variation emphasizes the upper traps and can help improve posture and upper back strength.','back','shoulders','https://v2.exercisedb.io/image/zV7fmAqJv1QlVA');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (285,'dumbbell incline triceps extension','The dumbbell incline triceps extension is an isolation exercise targeting the triceps, performed on an incline bench to increase the stretch and activation of the triceps muscles.','upper arms','shoulders','https://v2.exercisedb.io/image/dTAzSQOg6wlGWe');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (286,'dumbbell incline twisted flyes','The dumbbell incline twisted flye is a chest exercise performed on an incline bench, targeting the upper pectorals with an added wrist rotation for increased muscle activation.','chest','shoulders, triceps','https://v2.exercisedb.io/image/dt6byxinCSH9KM');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (287,'dumbbell iron cross','The dumbbell iron cross is a shoulder exercise that targets the deltoids by raising the arms out to the sides while holding dumbbells, forming a T shape with the body. It also engages the triceps and chest as secondary muscles.','shoulders','triceps, chest','https://v2.exercisedb.io/image/EFu5-IWmQw5tE7');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (288,'dumbbell kickback','The dumbbell kickback is an isolation exercise targeting the triceps. It involves extending the arm backward while keeping the upper arm stationary, effectively working the triceps and engaging the shoulders as secondary muscles.','upper arms','shoulders','https://v2.exercisedb.io/image/CNzfFftZ1Zhdeh');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (289,'dumbbell lateral raise','The dumbbell lateral raise is an isolation exercise that targets the deltoid muscles, particularly the lateral (side) head. It is commonly used to build shoulder width and strength.','shoulders','traps','https://v2.exercisedb.io/image/IlrS95NtRJCcYO');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (290,'dumbbell lateral to front raise','The dumbbell lateral to front raise is a shoulder exercise that targets the deltoids by combining both lateral and front raises in one movement. It also engages the trapezius and biceps as secondary muscles. This exercise helps build shoulder strength and stability.','shoulders','trapezius, biceps','https://v2.exercisedb.io/image/ny3bXkPmqeH50T');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (291,'dumbbell lunge','The dumbbell lunge is a lower body exercise that targets the glutes, quadriceps, hamstrings, and calves. It involves stepping forward into a lunge position while holding dumbbells, then returning to the starting position and alternating legs.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/uZM25O8GSqOcxZ');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (292,'dumbbell lying extension (across face)','The dumbbell lying extension (across face) is an isolation exercise targeting the triceps, performed lying on a bench while extending a dumbbell in an arc behind the head.','upper arms','shoulders','https://v2.exercisedb.io/image/26jOAmMZB-FRGo');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (293,'dumbbell lying elbow press','The dumbbell lying elbow press is an upper arm exercise targeting the triceps, performed while lying on a bench and pressing dumbbells by extending the elbows.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/kYWKqn6i2xh8Kb');
