INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (295,'dumbbell lying hammer press','The dumbbell lying hammer press is a chest exercise performed on a bench with dumbbells held in a neutral grip (palms facing each other). It targets the pectorals while also engaging the triceps and shoulders.','chest','triceps, shoulders','https://v2.exercisedb.io/image/tf6Gs9MbGmef2K');
