INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (317,'dumbbell one arm upright row','The dumbbell one arm upright row is a unilateral shoulder exercise that targets the deltoids, with secondary emphasis on the traps and biceps. It involves lifting a dumbbell with one arm in an upright rowing motion.','shoulders','traps, biceps','https://v2.exercisedb.io/image/eGhNhjrVJsixEJ');
