INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (335,'dumbbell rear lunge','The dumbbell rear lunge is a lower body exercise that targets the glutes, with secondary emphasis on the quadriceps, hamstrings, and calves. It involves stepping backward into a lunge while holding dumbbells, challenging balance and unilateral leg strength.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/RDGJC996qa3lH4');
