INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (341,'dumbbell seated alternate front raise','The dumbbell seated alternate front raise is a shoulder exercise that targets the deltoids, with secondary emphasis on the trapezius and biceps. It is performed seated, which helps stabilize the body and isolate the shoulder muscles.','shoulders','trapezius, biceps','https://v2.exercisedb.io/image/XiDepWx95O-d2B');
