INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (344,'dumbbell seated biceps curl (on stability ball)','The dumbbell seated biceps curl (on stability ball) is a biceps-focused exercise performed while seated on a stability ball, which adds an element of balance and core engagement. It targets the biceps and also works the forearms as secondary muscles.','upper arms','forearms','https://v2.exercisedb.io/image/epfxP1SNZ65Y62');
