INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (347,'dumbbell seated inner biceps curl','The dumbbell seated inner biceps curl targets the biceps and forearms by having the lifter sit on a bench, rest their upper arms on their thighs, and curl dumbbells upward. This isolates the biceps and minimizes momentum, making it an effective strength-building exercise.','upper arms','forearms','https://v2.exercisedb.io/image/GVAly6DDziczfv');
