INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (362,'dumbbell side lying one hand raise','The dumbbell side lying one hand raise targets the deltoid muscles and is performed lying on your side, lifting a dumbbell with one arm to shoulder height. This exercise isolates the shoulder muscles and helps improve strength and stability.','shoulders','trapezius, rhomboids','https://v2.exercisedb.io/image/8uYq8cZuau-C5E');
