INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (378,'dumbbell standing one arm reverse curl','The dumbbell standing one arm reverse curl targets the biceps and forearms using a dumbbell with an overhand grip, emphasizing the brachialis and forearm extensors.','upper arms','forearms','https://v2.exercisedb.io/image/oL2NvGLnaBiA1a');
