INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (386,'dumbbell straight arm pullover','The dumbbell straight arm pullover is a chest exercise that also targets the lats and triceps. It involves lying on a bench and moving a dumbbell in an arc over and behind your head while keeping your arms straight.','chest','latissimus dorsi, triceps','https://v2.exercisedb.io/image/zDnSWAFAYWrZzO');
