INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (402,'ez barbell spider curl','The EZ barbell spider curl is an isolation exercise targeting the biceps, performed with the upper arms supported on a preacher bench or stability ball to minimize cheating and maximize biceps engagement.','upper arms','forearms','https://v2.exercisedb.io/image/eSsOdTsYVj9NAu');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (403,'finger curls','Finger curls are an isolation exercise targeting the forearms, specifically the finger flexors and grip muscles. This movement helps improve grip strength and forearm development.','lower arms','wrist flexors, grip muscles','https://v2.exercisedb.io/image/XwdLsikqA7HTIw');
