INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (406,'floor fly (with barbell)','The floor fly with barbell is a chest exercise performed lying on the floor, focusing on stretching and contracting the pectoral muscles while using a barbell for resistance.','chest','deltoids, triceps','https://v2.exercisedb.io/image/EWUzbWNxcgmab2');
