INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (408,'front plank with twist','The front plank with twist is a core exercise that targets the abs and obliques while also engaging the shoulders. It involves rotating the torso while maintaining a plank position, which challenges stability and coordination.','waist','obliques, shoulders','https://v2.exercisedb.io/image/CPDkhnKwna3EhT');
