INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (417,'hanging straight twisting leg hip raise','The hanging straight twisting leg hip raise is a challenging core exercise that targets the abs, obliques, and hip flexors. It requires hanging from a pull-up bar, lifting the legs, and twisting the hips to engage the entire core.','waist','obliques, hip flexors','https://v2.exercisedb.io/image/R0junlJg2bZIwW');
