INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (422,'incline leg hip raise (leg straight)','The incline leg hip raise (leg straight) is an abdominal exercise performed on an incline bench. It targets the abs and also works the hip flexors. The movement requires you to lift your straight legs upward while lying on an incline, emphasizing core control and strength.','waist','hip flexors','https://v2.exercisedb.io/image/2ctszn1wExVKlA');
