INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (428,'inverted row v. 2','The inverted row v. 2 is a bodyweight exercise targeting the upper back, performed by pulling your chest up to a bar or suspension trainer while keeping your body straight. It also engages the biceps and forearms.','back','biceps, forearms','https://v2.exercisedb.io/image/wOMcebzTyUW4X6');
