INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (467,'kettlebell seesaw press','The kettlebell seesaw press is a shoulder exercise that involves pressing kettlebells overhead in an alternating fashion, challenging both strength and coordination.','shoulders','triceps, core','https://v2.exercisedb.io/image/2txheizD1A1AVx');
