INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (469,'kettlebell swing','The kettlebell swing is a dynamic exercise that targets the glutes and also engages the hamstrings and core. It involves swinging a kettlebell between the legs and up to shoulder height using hip drive and momentum.','upper legs','hamstrings, core','https://v2.exercisedb.io/image/Zhr-cDX-RU4Z4Z');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (470,'kettlebell thruster','The kettlebell thruster is a compound exercise that combines a squat with an overhead press, targeting the shoulders while also engaging the quadriceps, glutes, and core. It requires coordination, strength, and some experience with kettlebell handling.','shoulders','quadriceps, glutes, core','https://v2.exercisedb.io/image/qpwLUSv1CnBrHU');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (471,'kettlebell turkish get up (squat style)','The kettlebell Turkish get up (squat style) is a complex, full-body movement that targets the glutes and also works the quadriceps, hamstrings, and core. It requires strength, coordination, balance, and mobility, making it a challenging exercise.','upper legs','quadriceps, hamstrings, core','https://v2.exercisedb.io/image/7MDvIxMZQp5AYX');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (472,'kettlebell two arm clean','The kettlebell two arm clean is a dynamic movement that targets the deltoids while also engaging the traps and forearms. It requires coordination, explosive power, and proper technique to safely transition the kettlebell from the ground to the rack position.','shoulders','traps, forearms','https://v2.exercisedb.io/image/bHQBxuqwG0ezV4');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (473,'kettlebell two arm military press','The kettlebell two arm military press is a shoulder exercise that involves pressing two kettlebells overhead from shoulder level, targeting the deltoids and engaging the triceps and upper back.','shoulders','triceps, upper back','https://v2.exercisedb.io/image/VewBNtpDTLL6BV');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (474,'kettlebell windmill','The kettlebell windmill is a compound exercise that targets the abs and obliques while also engaging the shoulders and improving overall core stability and mobility. It requires holding a kettlebell overhead and bending at the waist, demanding strength, balance, and coordination.','waist','obliques, shoulders','https://v2.exercisedb.io/image/JsufMCMUwRdcPG');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (475,'kick out sit','The kick out sit is a bodyweight exercise that targets the hamstrings while also engaging the quadriceps and glutes. It involves sitting on the edge of a bench or chair, extending the legs out, and then returning to the starting position.','upper legs','quadriceps, glutes','https://v2.exercisedb.io/image/UvxfpMGDG44HXl');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (476,'kipping muscle up','The kipping muscle up is a dynamic bodyweight exercise that combines a pull-up with a dip, using momentum to transition from below to above the bar. It primarily targets the lats and requires significant upper body strength, coordination, and explosive power.','back','biceps, triceps, shoulders, core','https://v2.exercisedb.io/image/S09Oc7pRWoHlIQ');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (477,'landmine 180','The landmine 180 is a rotational core exercise performed with a barbell anchored at one end. It targets the abs and obliques, requiring the lifter to swing the barbell in an arc from side to side, engaging the core, hips, and legs for stability and power.','waist','obliques, quadriceps','https://v2.exercisedb.io/image/mjQgi68FoCewPi');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (478,'leg pull in flat bench','The leg pull in flat bench is an abdominal exercise performed on a flat bench using only body weight. It targets the abs and also works the hip flexors and lower back. The movement involves pulling the knees toward the chest while sitting on a bench, requiring core strength and stability.','waist','hip flexors, lower back','https://v2.exercisedb.io/image/7dLgbiSuOhitOh');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (479,'lever alternating narrow grip seated row','The lever alternating narrow grip seated row is a machine-based exercise targeting the upper back, performed by alternately pulling each handle towards the torso while maintaining proper posture.','back','biceps, forearms','https://v2.exercisedb.io/image/VCqq710eC8NPhb');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (480,'lever assisted chin-up','The lever assisted chin-up is a machine-based exercise that helps users perform chin-ups with assistance, making it easier to build strength in the lats, biceps, and forearms. It is ideal for those who are not yet able to perform unassisted chin-ups.','back','biceps, forearms','https://v2.exercisedb.io/image/5fH8HdsDBeTj0d');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (481,'lever back extension','The lever back extension is a machine-based exercise targeting the muscles of the lower back (spine extensors), with secondary emphasis on the glutes and hamstrings. It is performed by sitting on a leverage machine, securing the feet, and extending the back against resistance.','back','glutes, hamstrings','https://v2.exercisedb.io/image/xLhnSXUlUg4p8o');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (482,'lever bent over row','The lever bent over row is a compound strength exercise targeting the upper back, performed with a barbell. It requires good posture, core stability, and proper technique to avoid injury.','back','biceps, forearms','https://v2.exercisedb.io/image/ZmM28M4D02R7xv');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (483,'lever bicep curl','The lever bicep curl is a machine-based exercise targeting the biceps, with secondary emphasis on the forearms. It is performed using a leverage machine, which provides guided resistance and stability, making it accessible for most users.','upper arms','forearms','https://v2.exercisedb.io/image/Jorr0AaVggFdrk');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (484,'lever chest press','The lever chest press is a machine-based exercise that targets the pectoral muscles, with secondary emphasis on the triceps and shoulders. It is performed on a leverage machine, providing guided movement for safety and stability.','chest','triceps, shoulders','https://v2.exercisedb.io/image/mTP9Y0SemsxS2j');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (485,'lever chest press','The lever chest press is a machine-based exercise targeting the pectoral muscles. It provides a controlled pressing movement, making it suitable for building chest strength with added support and stability from the machine.','chest','triceps, shoulders','https://v2.exercisedb.io/image/nuwCGZFgXfwnsZ');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (486,'lever deadlift','The lever deadlift is a machine-based exercise targeting the glutes, with secondary emphasis on the hamstrings and quadriceps. It is performed on a leverage machine, providing guided movement and stability, making it accessible to a wide range of users.','upper legs','hamstrings, quadriceps','https://v2.exercisedb.io/image/bKx6Vq1BG2mSUJ');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (487,'lever front pulldown','The lever front pulldown is a machine-based exercise targeting the latissimus dorsi (lats) and is commonly used to build back strength and muscle mass. It involves pulling handles down towards the chest while seated, using a leverage machine.','back','biceps, rhomboids, rear deltoids','https://v2.exercisedb.io/image/za3eEaYOJNCEje');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (488,'lever gripless shrug','The lever gripless shrug is performed on a leverage machine to target the trapezius muscles by elevating the shoulders without gripping the handles. This isolates the traps and minimizes forearm involvement.','back','shoulders, forearms','https://v2.exercisedb.io/image/pRxDnI8u86flEc');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (489,'lever high row','The lever high row is a machine-based exercise targeting the upper back, with secondary emphasis on the biceps and rear deltoids. It is performed by sitting on a leverage machine, gripping the handles, and pulling them towards the body while keeping the chest against the pad.','back','biceps, rear deltoids','https://v2.exercisedb.io/image/2iuZH-mXfgKqMw');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (490,'lever kneeling leg curl','The lever kneeling leg curl is an isolation exercise targeting the hamstrings, performed on a leverage machine while kneeling. It primarily works the hamstrings and also engages the glutes as secondary muscles.','upper legs','glutes','https://v2.exercisedb.io/image/vUqdTSRszo-QD6');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (491,'lever kneeling twist','The lever kneeling twist is an abdominal exercise performed on a leverage machine, targeting the abs with secondary emphasis on the obliques and lower back. The movement involves twisting the torso from side to side while kneeling, engaging the core muscles.','waist','obliques, lower back','https://v2.exercisedb.io/image/yQShW1vcriA7lD');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (492,'lever lateral raise','The lever lateral raise is a machine-based exercise targeting the deltoid muscles of the shoulders. It involves raising the arms out to the sides against resistance, primarily working the lateral deltoids, with secondary emphasis on the traps and upper back. The machine provides stability, making it accessible for those with less experience.','shoulders','traps, upper back','https://v2.exercisedb.io/image/qJ1u9lqU5aT8Vy');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (493,'lever leg extension','The lever leg extension is an isolation exercise performed on a leverage machine to target the quadriceps. It involves extending the knees to lift a weight, primarily working the front of the thighs.','upper legs','hamstrings','https://v2.exercisedb.io/image/MfLpezBy-CY1jB');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (494,'lever lying leg curl','The lever lying leg curl is an isolation exercise targeting the hamstrings, performed on a leverage machine. It involves curling the legs upward against resistance while lying face down, emphasizing hamstring contraction and control.','upper legs','calves','https://v2.exercisedb.io/image/JqPdbP57TOwzKp');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (495,'lever military press','The lever military press is a shoulder exercise performed on a leverage machine, primarily targeting the deltoid muscles. It also engages the triceps and upper chest as secondary muscles. The machine provides stability, making it suitable for those developing strength and technique.','shoulders','triceps, upper chest','https://v2.exercisedb.io/image/yDp-FANFfjmRMC');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (496,'lever narrow grip seated row','The lever narrow grip seated row is a machine-based exercise targeting the upper back, with secondary emphasis on the biceps and forearms. It involves pulling handles towards the torso while seated, focusing on squeezing the shoulder blades together.','back','biceps, forearms','https://v2.exercisedb.io/image/8fQX9ooVNSwRv-');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (497,'lever one arm bent over row','The lever one arm bent over row is a unilateral back exercise performed with a barbell. It targets the upper back and also works the biceps and forearms. The movement requires maintaining a stable bent-over position while rowing the weight with one arm, demanding core stability and coordination.','back','biceps, forearms','https://v2.exercisedb.io/image/dlBhGZIlxyW1kp');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (498,'lever one arm shoulder press','The lever one arm shoulder press is a machine-based exercise targeting the deltoid muscles of the shoulder. It is performed one arm at a time, allowing for focused muscle engagement and unilateral strength development. The exercise also involves the triceps and upper back as secondary muscles.','shoulders','triceps, upper back','https://v2.exercisedb.io/image/dYCivEHXN6SjIc');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (499,'lever overhand triceps dip','The lever overhand triceps dip is a machine-based exercise targeting the triceps, with secondary emphasis on the chest and shoulders. It involves lowering and raising the body using a leverage machine, which provides stability and controlled resistance.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/UcKLRvhrNGWyfB');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (500,'lever preacher curl','The lever preacher curl is a strength training exercise performed on a leverage machine, primarily targeting the biceps with secondary activation of the forearms. It involves curling the handles upward while keeping the upper arms supported on a pad, which isolates the biceps and minimizes cheating.','upper arms','forearms','https://v2.exercisedb.io/image/G4oWbYsPi7tXcO');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (501,'lever reverse hyperextension','The lever reverse hyperextension is a machine-based exercise targeting the glutes, with secondary emphasis on the hamstrings and lower back. It involves lying face down on a leverage machine and lifting the legs upward using the glutes and hamstrings.','upper legs','hamstrings, lower back','https://v2.exercisedb.io/image/WbTOZDIy6eY3Gz');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (502,'lever seated calf raise','The lever seated calf raise is a machine-based exercise that targets the calf muscles, particularly the gastrocnemius and soleus. It is performed while seated, using a leverage machine to provide resistance as you raise and lower your heels.','lower legs','soleus, ankle stabilizers','https://v2.exercisedb.io/image/UWbZlYQuAbk2fT');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (503,'lever seated crunch (chest pad)','The lever seated crunch (chest pad) is an abdominal exercise performed on a leverage machine. It primarily targets the abs and also engages the obliques. The movement involves controlled flexion and extension of the torso against resistance, making it suitable for building core strength.','waist','obliques','https://v2.exercisedb.io/image/n1XSyzC5WERTFk');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (504,'lever seated fly','The lever seated fly is a machine-based exercise targeting the pectoral muscles, performed by bringing the handles together in front of the chest while seated.','chest','deltoids, trapezius','https://v2.exercisedb.io/image/YyJo9ca46lN2Ff');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (505,'lever seated hip abduction','The lever seated hip abduction is a machine-based exercise that targets the hip abductor muscles. It is performed while seated, pushing the legs apart against resistance provided by the machine.','upper legs','glutes, hamstrings','https://v2.exercisedb.io/image/H8GMelXD27PYwA');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (506,'lever seated hip adduction','The lever seated hip adduction is a machine-based exercise targeting the adductor muscles of the inner thighs. It is performed by bringing the legs together against resistance while seated.','upper legs','hamstrings, glutes','https://v2.exercisedb.io/image/QeuND6NuUmtYK7');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (507,'lever seated leg curl','The lever seated leg curl is a machine-based exercise that targets the hamstrings. It involves curling your lower legs against resistance while seated, isolating the hamstrings and minimizing involvement from other muscle groups.','upper legs','calves','https://v2.exercisedb.io/image/hCGQ87tBuP7mNY');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (508,'lever seated leg raise crunch','The lever seated leg raise crunch is an abdominal exercise performed on a leverage machine. It targets the abs and also works the hip flexors. The movement involves raising the legs and curling the torso forward simultaneously, providing a challenging core workout.','waist','hip flexors','https://v2.exercisedb.io/image/7tUYAQGwD1M6FC');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (509,'lever seated reverse fly (parallel grip)','The lever seated reverse fly (parallel grip) is a machine-based exercise targeting the rear deltoids, with secondary emphasis on the trapezius and rhomboids. It involves pulling the handles back and outward while seated, focusing on squeezing the shoulder blades together.','shoulders','trapezius, rhomboids','https://v2.exercisedb.io/image/jrjvYcYuHQs9HZ');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (510,'lever seated reverse fly','The lever seated reverse fly is a machine-based exercise targeting the rear deltoids, with secondary emphasis on the trapezius and rhomboids. It is performed seated, using a leverage machine, which provides stability and helps isolate the target muscles.','shoulders','trapezius, rhomboids','https://v2.exercisedb.io/image/R7MnhBeyk2sbIt');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (511,'lever shoulder press','The lever shoulder press is a machine-based exercise targeting the deltoid muscles, with secondary emphasis on the triceps and chest. It is performed using a leverage machine, providing guided movement for safety and stability.','shoulders','triceps, chest','https://v2.exercisedb.io/image/VF1S3HEB4wU-c4');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (512,'lever shrug','The lever shrug is a machine-based exercise targeting the trapezius muscles. It involves elevating the shoulders while keeping the arms straight, using a leverage machine for resistance.','back','shoulders','https://v2.exercisedb.io/image/YaBpoTkIJuRm1h');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (513,'lever standing calf raise','The lever standing calf raise is a strength exercise performed on a leverage machine, targeting the calves. It involves raising and lowering the heels while standing, using resistance provided by the machine.','lower legs','soleus, ankle stabilizers','https://v2.exercisedb.io/image/H5fckIflIG8Ncr');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (514,'lever t bar row','The lever T bar row is a machine-based exercise targeting the upper back, with secondary emphasis on the biceps and forearms. It is performed seated with the chest supported, reducing lower back strain and allowing for focused engagement of the upper back muscles.','back','biceps, forearms','https://v2.exercisedb.io/image/ljv1VoovZR1Ocl');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (515,'lever triceps extension','The lever triceps extension is an isolation exercise performed on a leverage machine to target the triceps. It involves extending the arms against resistance, focusing on triceps activation while minimizing shoulder involvement.','upper arms','shoulders','https://v2.exercisedb.io/image/ci5bo-v3YSTCrw');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (516,'london bridge','The London Bridge exercise targets the upper back using a rope attached to a high anchor point. It involves pulling the rope towards the body while squeezing the shoulder blades together, engaging the upper back, shoulders, biceps, and forearms.','back','shoulders, biceps, forearms','https://v2.exercisedb.io/image/onm3yD20T9g4ed');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (517,'lying (side) quads stretch','A static stretch performed lying on your side to target the quadriceps, often used to improve flexibility and reduce muscle tightness.','upper legs','hamstrings','https://v2.exercisedb.io/image/VIqWV52otlmyWm');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (518,'lying leg raise flat bench','The lying leg raise flat bench is an abdominal exercise performed on a flat bench using only body weight. It primarily targets the abs and also engages the hip flexors. The movement involves lifting straight legs up towards the ceiling while lying flat, then lowering them back down under control.','waist','hip flexors','https://v2.exercisedb.io/image/PASReCXxgJ20QO');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (519,'march sit (wall)','The march sit (wall) is a lower body exercise performed with body weight, targeting the glutes and also engaging the quadriceps, hamstrings, and calves. It involves holding a wall sit position while alternately lifting each knee towards the chest, mimicking a marching motion.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/ZqIOjugpFfnSmG');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (520,'mixed grip chin-up','The mixed grip chin-up is a bodyweight exercise targeting the lats, with secondary emphasis on the biceps and forearms. It involves pulling your body up to a bar using a mixed grip, which challenges grip strength and upper body pulling power.','back','biceps, forearms','https://v2.exercisedb.io/image/G-2eeZg5dECu7r');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (521,'monster walk','The monster walk is a lower body exercise that targets the glutes and also works the hamstrings and quadriceps. It is typically performed with a resistance band around the ankles to increase intensity. The movement involves stepping side-to-side while maintaining tension in the band and a slight knee bend.','upper legs','hamstrings, quadriceps','https://v2.exercisedb.io/image/AauLsSFMlr1Qo7');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (522,'mountain climber','Mountain climbers are a dynamic bodyweight exercise that targets the cardiovascular system while also engaging the core, shoulders, and triceps. The movement mimics a running motion in a plank position, making it effective for both cardio and muscular endurance.','cardio','core, shoulders, triceps','https://v2.exercisedb.io/image/HSRQJ5tvE9u9MH');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (523,'muscle up','The muscle up is a challenging bodyweight exercise that combines a pull-up with a dip, requiring significant upper body strength, coordination, and explosive power. It targets the lats primarily, with secondary engagement of the biceps, triceps, shoulders, and chest.','back','biceps, triceps, shoulders, chest','https://v2.exercisedb.io/image/Xp6V-RrzAmNa7d');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (524,'negative crunch','The negative crunch is an abdominal exercise focusing on the eccentric (lowering) phase of the crunch to increase core strength and control.','waist','hip flexors','https://v2.exercisedb.io/image/PNVCX-rdpvlYpC');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (525,'oblique crunches floor','Oblique crunches on the floor target the abdominal muscles, especially the obliques, by incorporating a twisting motion as you crunch up. This exercise is performed lying on your back, using only body weight, and is suitable for most fitness levels.','waist','obliques','https://v2.exercisedb.io/image/rZFlskoc1dQRRe');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (526,'olympic barbell hammer curl','The olympic barbell hammer curl is a strength exercise targeting the biceps and forearms. It involves curling an Olympic barbell with a neutral grip, emphasizing both the biceps and brachialis muscles.','upper arms','forearms','https://v2.exercisedb.io/image/5cUpv9c6pUDpLw');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (527,'olympic barbell triceps extension','The olympic barbell triceps extension is a strength exercise targeting the triceps, performed by raising an Olympic barbell overhead and lowering it behind the head before extending the arms back up.','upper arms','shoulders','https://v2.exercisedb.io/image/DodOoLutvGpoey');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (528,'one arm chin-up','The one arm chin-up is a highly advanced bodyweight exercise that targets the latissimus dorsi (lats) and requires significant strength, coordination, and grip power. It is performed by pulling your body up to a bar using only one arm, with the other hand optionally supporting the wrist.','back','biceps, forearms','https://v2.exercisedb.io/image/-5TWL2d7kxWP-W');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (529,'one arm dip','The one arm dip is a challenging bodyweight exercise that targets the triceps, with secondary emphasis on the chest and shoulders. It requires significant upper body strength, balance, and coordination, as you support your body weight with one arm while performing the dip motion.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/e1hOJYJmy8IBoA');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (530,'one arm slam (with medicine ball)','The one arm slam with a medicine ball is a dynamic exercise targeting the abs, shoulders, and back. It involves forcefully slamming a medicine ball to the ground with one arm, requiring core strength, power, and coordination.','waist','shoulders, back','https://v2.exercisedb.io/image/6WLzCikT743rFY');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (531,'otis up','The Otis Up is a weighted abdominal exercise that targets the abs, with secondary emphasis on the hip flexors and lower back. It involves curling the torso up from a lying position, requiring core strength and stability.','waist','hip flexors, lower back','https://v2.exercisedb.io/image/EDJRuAUlZptpmP');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (532,'outside leg kick push-up','The outside leg kick push-up is a dynamic bodyweight exercise that combines a traditional push-up with a lateral leg kick, targeting the glutes and engaging the quadriceps, hamstrings, and calves. This movement challenges upper body strength, core stability, coordination, and lower body mobility.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/g7fYYQtJump8I0');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (533,'overhead triceps stretch','The overhead triceps stretch is a static stretching exercise that targets the triceps and also stretches the shoulders. It is performed by extending one arm overhead, bending at the elbow, and using the opposite hand to gently pull the elbow for a deeper stretch.','upper arms','shoulders','https://v2.exercisedb.io/image/ZuuA0guZwzcLU1');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (534,'power clean','The power clean is a compound Olympic weightlifting movement that involves lifting a barbell from the floor to the shoulders in one explosive motion. It targets the hamstrings, glutes, quadriceps, and calves, and requires significant strength, coordination, and technique.','upper legs','glutes, quadriceps, calves','https://v2.exercisedb.io/image/Id68KLk8WXyB7X');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (535,'pull-in (on stability ball)','The pull-in on a stability ball is an abdominal exercise that also engages the hip flexors. It requires balance and core strength as you bring your knees toward your chest while stabilizing your body on the ball.','waist','hip flexors','https://v2.exercisedb.io/image/wPqsjIKZQ7auRy');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (536,'pull up (neutral grip)','The neutral grip pull-up is a bodyweight exercise targeting the latissimus dorsi (lats) and also engaging the biceps and forearms. It is performed by hanging from a pull-up bar with palms facing each other, pulling the chin above the bar, and lowering back down with control.','back','biceps, forearms','https://v2.exercisedb.io/image/B6-sMAXMAh4hCk');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (537,'pull-up','The pull-up is a bodyweight exercise that primarily targets the latissimus dorsi muscles of the back. It also engages the biceps and forearms as secondary muscles. The movement requires significant upper body strength, coordination, and control, making it a challenging exercise for many individuals.','back','biceps, forearms','https://v2.exercisedb.io/image/Ci5Yh6vCqVn81Q');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (538,'push-up (bosu ball)','The push-up (bosu ball) is a variation of the traditional push-up performed with hands on a BOSU ball, increasing instability and engaging more core and stabilizer muscles.','chest','triceps, shoulders, core','https://v2.exercisedb.io/image/AxKKO0Kgrf-8Qu');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (539,'push-up (on stability ball)','The push-up on a stability ball is a challenging variation of the traditional push-up that requires additional balance and core engagement. By placing your hands on a stability ball, you increase the instability of the movement, forcing your chest, triceps, shoulders, and core to work harder to maintain proper form.','chest','triceps, shoulders, core','https://v2.exercisedb.io/image/B5o-tlzg2T5Kf8');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (540,'push-up (on stability ball)','The push-up on a stability ball is a challenging variation of the traditional push-up that increases instability, requiring greater core engagement and balance. It primarily targets the pectorals, with significant involvement from the triceps, shoulders, and core.','chest','triceps, shoulders, core','https://v2.exercisedb.io/image/3vp0Stf24gcyBN');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (541,'push-up (wall) v. 2','The wall push-up is a beginner-friendly variation of the traditional push-up, performed standing and pressing against a wall. It primarily targets the pectorals, with secondary emphasis on the triceps and shoulders. This exercise is ideal for those new to strength training or individuals seeking a low-impact alternative to floor push-ups.','chest','triceps, shoulders','https://v2.exercisedb.io/image/QbPkVd5G02GEaY');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (542,'push-up (wall)','The wall push-up is a beginner-friendly variation of the traditional push-up, performed standing and pressing against a wall. It primarily targets the pectorals, with secondary emphasis on the triceps and deltoids. This exercise is ideal for those new to strength training or individuals needing a low-impact alternative.','chest','triceps, deltoids','https://v2.exercisedb.io/image/tLdYh1EE16afcZ');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (543,'push-up close-grip off dumbbell','The push-up close-grip off dumbbell is a variation of the push-up that targets the triceps, with additional emphasis on the chest and shoulders. It is performed by gripping dumbbells placed on the ground, which increases the range of motion and challenges stability.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/FBpsr3esGlHcPM');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (544,'push-up inside leg kick','The push-up inside leg kick is a dynamic bodyweight exercise that combines a standard push-up with a lateral leg kick, targeting the glutes and engaging the core, quadriceps, hamstrings, and calves. It requires coordination, balance, and strength.','upper legs','quadriceps, hamstrings, calves, core','https://v2.exercisedb.io/image/qSRF6QSh7x2vnB');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (545,'push-up','The push-up is a classic bodyweight exercise that targets the pectoral muscles, triceps, deltoids, and core. It is performed by lowering and raising the body using the arms while maintaining a straight line from head to heels.','chest','triceps, deltoids, core','https://v2.exercisedb.io/image/VnK6T4oB9C7JIX');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (546,'push-up medicine ball','The push-up medicine ball is a challenging variation of the traditional push-up that requires you to place both hands on a medicine ball. This increases the demand on your chest, triceps, shoulders, and core, while also challenging your balance and stability.','chest','triceps, shoulders, core','https://v2.exercisedb.io/image/WLGBVTBK6R9vAe');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (547,'push-up to side plank','The push-up to side plank is a compound bodyweight exercise that combines a traditional push-up with a rotational movement into a side plank. This exercise targets the abs while also engaging the shoulders, chest, and triceps, and challenges core stability and balance.','waist','shoulders, chest, triceps','https://v2.exercisedb.io/image/j0ffaRkPnubTxL');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (548,'raise single arm push-up','The raise single arm push-up is a challenging bodyweight exercise that targets the pectorals while also engaging the triceps, shoulders, and core. It requires significant strength, balance, and coordination as one arm is extended out to the side while performing a push-up.','chest','triceps, shoulders, core','https://v2.exercisedb.io/image/--xXi9eMPo02nn');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (549,'rear decline bridge','The rear decline bridge is a bodyweight exercise targeting the glutes, with secondary emphasis on the hamstrings and lower back. It involves lifting the hips off the ground while lying on your back, engaging the posterior chain.','upper legs','hamstrings, lower back','https://v2.exercisedb.io/image/sNNtOKKvK8yp07');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (550,'rear deltoid stretch','The rear deltoid stretch is a bodyweight exercise targeting the deltoid muscles, particularly the rear (posterior) delts. It also stretches the trapezius and rhomboids. This movement is commonly used to improve shoulder flexibility and relieve tension.','shoulders','trapezius, rhomboids','https://v2.exercisedb.io/image/1vEkEKmJDMVTGw');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (551,'rear pull-up','The rear pull-up is a bodyweight exercise targeting the latissimus dorsi (lats) and also engaging the biceps and forearms. It involves pulling your body up to a bar with an overhand grip, focusing on back strength and control.','back','biceps, forearms','https://v2.exercisedb.io/image/prLgKvF9GT0zGO');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (552,'reverse dip','The reverse dip is a bodyweight exercise targeting the triceps, performed between two parallel bars. It also engages the chest and shoulders as secondary muscles.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/GhL6snbRqkHnO7');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (553,'reverse grip machine lat pulldown','The reverse grip machine lat pulldown targets the latissimus dorsi using a leverage machine and an underhand grip, also engaging the biceps and forearms. It is performed seated with controlled movement, focusing on pulling the handles down to the chest and squeezing the shoulder blades together.','back','biceps, forearms','https://v2.exercisedb.io/image/B6ZdxkMNJFDgmm');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (554,'reverse grip pull-up','The reverse grip pull-up is a bodyweight exercise targeting the lats, performed by pulling the body up to a bar with an underhand grip. It also engages the biceps and forearms.','back','biceps, forearms','https://v2.exercisedb.io/image/OnZKX3XcjPuY18');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (555,'reverse hyper extension (on stability ball)','The reverse hyper extension on a stability ball targets the glutes, with secondary emphasis on the hamstrings and lower back. It requires balance and core stability due to the use of the stability ball, making it more challenging than a floor-based version.','upper legs','hamstrings, lower back','https://v2.exercisedb.io/image/i9XjO1g5MeQfLC');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (556,'ring dips','Ring dips are a challenging bodyweight exercise performed on gymnastic rings, primarily targeting the triceps, with significant engagement of the chest and shoulders. The instability of the rings requires considerable strength, balance, and coordination.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/C81Ow9SnH0NLiQ');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (557,'rocky pull-up pulldown','The rocky pull-up pulldown is a bodyweight exercise targeting the lats, with secondary emphasis on the biceps and forearms. It involves pulling the body up to a bar and lowering it under control, requiring significant upper body strength and coordination.','back','biceps, forearms','https://v2.exercisedb.io/image/kQcVMv1VJQdfjq');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (558,'rope climb','The rope climb is a challenging upper body exercise that targets the upper back, forearms, biceps, and shoulders. It requires significant grip strength, coordination, and core stability, as well as the ability to use both the upper and lower body to ascend and descend a rope safely.','back','forearms, biceps, shoulders','https://v2.exercisedb.io/image/kzPWck-OqnMKZx');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (559,'run (equipment)','Running in place is a cardiovascular exercise that elevates the heart rate and improves overall endurance. It requires no equipment and can be performed anywhere, making it accessible for most fitness levels.','cardio','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/Dfgqe3AfuU9dTp');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (560,'run','Running is a fundamental cardiovascular exercise that involves jogging or running in place or over a distance. It primarily targets the cardiovascular system and also engages the lower body muscles.','cardio','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/ujahQcdGSoqbgw');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (561,'russian twist','The Russian twist is a core exercise that targets the abdominal muscles and obliques. It involves rotating the torso from side to side while balancing on the sit bones, often with the feet lifted off the ground.','waist','obliques','https://v2.exercisedb.io/image/UAQCC52VRRGJog');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (562,'scapular pull-up','The scapular pull-up is a bodyweight exercise that targets the trapezius muscles and helps improve scapular control and shoulder stability. It is performed by hanging from a pull-up bar and retracting the shoulder blades without bending the elbows.','back','biceps, rhomboids, rear deltoids','https://v2.exercisedb.io/image/A3hkJoQmuknBk2');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (563,'seated leg raise','The seated leg raise is an abdominal exercise performed while sitting on a bench. It primarily targets the abs and also engages the hip flexors. The movement involves raising the legs while keeping them straight, which requires core strength and stability.','waist','hip flexors','https://v2.exercisedb.io/image/UTGilp0lRSCpwc');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (564,'seated lower back stretch','A gentle stretch performed while seated to target the lower back and lats, also engaging the glutes and hamstrings. This exercise is suitable for improving flexibility and relieving tension in the lower back area.','back','glutes, hamstrings','https://v2.exercisedb.io/image/tagNPpNmkHxcto');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (565,'seated side crunch (wall)','The seated side crunch (wall) is an abdominal exercise performed while sitting on the floor with your back against a wall. It targets the abs and obliques by having you lean side to side, bringing your elbow toward your hip.','waist','obliques','https://v2.exercisedb.io/image/B1nTADISrwAkmI');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (566,'self assisted inverse leg curl (on floor)','The self assisted inverse leg curl (on floor) is a bodyweight exercise targeting the hamstrings, with secondary emphasis on the glutes and calves. It involves curling the legs towards the glutes while keeping the hips lifted, requiring significant hamstring strength and control.','upper legs','glutes, calves','https://v2.exercisedb.io/image/PTTzzBSh6nLRlb');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (567,'self assisted inverse leg curl','The self assisted inverse leg curl is a bodyweight exercise targeting the hamstrings, with secondary emphasis on the glutes and calves. It involves curling the legs towards the chest while lying on your back, using your hands for support if needed.','upper legs','glutes, calves','https://v2.exercisedb.io/image/NxoolEkh3UYq23');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (568,'shoulder tap push-up','The shoulder tap push-up is a bodyweight exercise that combines a standard push-up with an alternating shoulder tap at the top of each rep. This movement challenges the chest, triceps, and core while also requiring balance and coordination to stabilize the body during the shoulder tap.','chest','triceps, core','https://v2.exercisedb.io/image/ys73Uoh9GIkmlH');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (569,'side bridge v. 2','The side bridge v. 2 is a core stability exercise performed on the floor using only body weight. It targets the abs, with secondary emphasis on the obliques and glutes. The movement involves holding a side plank position, which challenges core strength and stability.','waist','obliques, glutes','https://v2.exercisedb.io/image/SWCctfdSdz0R2t');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (570,'side hip (on parallel bars)','The side hip (on parallel bars) is a challenging core exercise that targets the abs, obliques, and hip flexors by requiring you to lift your legs to the side while supporting your body weight on parallel bars.','waist','obliques, hip flexors','https://v2.exercisedb.io/image/pCAWWrzdKfyUaD');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (571,'side hip abduction','Side hip abduction is a bodyweight exercise that targets the hip abductors, helping to strengthen the outer thighs and hips. It also engages the glutes and quadriceps as secondary muscles. This movement is commonly used for strengthening, mobility, and rehabilitation purposes.','upper legs','glutes, quadriceps','https://v2.exercisedb.io/image/n5kYtkM4sEwpV9');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (572,'side push neck stretch','The side push neck stretch is a gentle stretching exercise targeting the levator scapulae and other neck muscles. It helps improve flexibility and relieve tension in the neck and upper shoulders.','neck','trapezius, sternocleidomastoid','https://v2.exercisedb.io/image/cFK8R4ylvs3isx');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (573,'side push-up','The side push-up is a bodyweight exercise that primarily targets the triceps, while also engaging the shoulders, chest, and core. It is performed by lying on your side and pressing your body up using your bottom arm, which challenges your upper arm strength and stability.','upper arms','shoulders, chest, core','https://v2.exercisedb.io/image/vO5Iwjtv5PWKLJ');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (574,'side-to-side chin','The side-to-side chin is a bodyweight exercise targeting the lats, performed by pulling yourself up to a bar and shifting your chin from one side to the other at the top of the movement. This variation increases the challenge to the lats and requires greater strength and control than a standard chin-up.','back','biceps, forearms','https://v2.exercisedb.io/image/xPHHWYZe6wQCeV');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (575,'side wrist pull stretch','The side wrist pull stretch is a bodyweight exercise that targets the forearms and helps improve flexibility and mobility in the wrists and hands. It is performed by extending one arm to the side and gently pulling the hand towards the body with the opposite hand, creating a stretch in the forearm.','lower arms','wrists, hands','https://v2.exercisedb.io/image/4d4B1JakcLuTYe');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (576,'single arm push-up','The single arm push-up is a challenging bodyweight exercise that targets the pectorals while also engaging the triceps, shoulders, and core. It requires significant strength, balance, and coordination, making it suitable for advanced practitioners.','chest','triceps, shoulders, core','https://v2.exercisedb.io/image/j68z9fNeaHwvLN');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (577,'single leg calf raise (on a dumbbell)','The single leg calf raise (on a dumbbell) is a lower leg exercise that targets the calves, with secondary emphasis on the ankles and feet. It involves balancing on one leg while holding a dumbbell and performing a calf raise, which increases the challenge to balance and strength.','lower legs','ankles, feet','https://v2.exercisedb.io/image/hfTTQmZmth7J7a');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (578,'single leg platform slide','The single leg platform slide is a bodyweight exercise targeting the hamstrings, with secondary emphasis on the glutes and quadriceps. It involves sliding one foot backward on a platform while maintaining balance and core engagement.','upper legs','glutes, quadriceps','https://v2.exercisedb.io/image/vSv-ZLn-mWIryq');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (579,'sit-up v. 2','The sit-up v. 2 is a bodyweight abdominal exercise that targets the abs and also engages the hip flexors. It involves curling the torso up from a lying position to a 45-degree angle, then lowering back down.','waist','hip flexors','https://v2.exercisedb.io/image/aVDp7IFy9QMogN');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (580,'sled 45° calf press','The sled 45° calf press is a machine-based exercise that targets the calves by pressing a weighted sled away using the balls of your feet, focusing on ankle extension.','lower legs','hamstrings','https://v2.exercisedb.io/image/a-G5O6ReS4JEqW');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (581,'sled 45° leg press','The sled 45° leg press is a compound lower body exercise performed on a sled machine. It primarily targets the glutes, with secondary emphasis on the quadriceps, hamstrings, and calves. The exercise involves pushing a weighted footplate away from the body while seated at a 45-degree angle, making it a popular choice for building lower body strength.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/gEHj-7ZcIUbEvx');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (582,'sled 45° leg wide press','The sled 45° leg wide press is a compound lower body exercise performed on a sled machine set at a 45-degree angle. It targets the glutes primarily, with significant involvement from the quadriceps, hamstrings, and calves. The wide stance emphasizes the glutes and inner thighs more than a standard leg press.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/JupSOVqrehqt-U');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (583,'sled closer hack squat','The sled closer hack squat is a lower body exercise performed on a sled machine, primarily targeting the glutes while also engaging the quadriceps, hamstrings, and calves. It involves squatting with your back against a pad and feet on a platform, moving the weight by extending and flexing the knees and hips.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/sRbIcWInOf-dhN');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (584,'sled forward angled calf raise','The sled forward angled calf raise is a resistance exercise performed on a sled machine, targeting the calf muscles. The movement involves raising and lowering the heels while the toes remain on the platform, using the sled machine for added resistance.','lower legs','hamstrings, glutes','https://v2.exercisedb.io/image/MKXuqlOWZ2CUZI');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (585,'sled hack squat','The sled hack squat is a lower body strength exercise performed on a sled machine. It primarily targets the glutes, with secondary emphasis on the quadriceps, hamstrings, and calves. The movement involves squatting down with the support of the sled machine, which helps guide the motion and provides stability.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/ZmEWnIk-pJnFmi');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (586,'sled lying squat','The sled lying squat is a lower body exercise performed on a sled machine, targeting the glutes as the primary muscle group. It also engages the quadriceps, hamstrings, and calves. The movement involves lying on your back, pushing the sled upward with your legs, and then lowering it back down in a controlled manner.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/UaJudsmMn9sQb6');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (587,'smith back shrug','The smith back shrug is a strength exercise targeting the trapezius muscles, performed using a smith machine. It involves lifting the shoulders straight up towards the ears while holding a barbell, focusing on squeezing the traps at the top of the movement.','back','shoulders','https://v2.exercisedb.io/image/-aAEQ-wAiXAHRV');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (588,'smith behind neck press','The smith behind neck press is a shoulder exercise performed on a smith machine, targeting the deltoids with secondary emphasis on the triceps and upper back. The movement involves pressing a barbell from behind the neck to overhead, requiring good shoulder mobility and stability.','shoulders','triceps, upper back','https://v2.exercisedb.io/image/xPzP5kosLkW8GC');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (589,'smith bench press','The smith bench press is a chest exercise performed on a smith machine, which provides a guided bar path for pressing movements. It primarily targets the pectorals, with secondary emphasis on the triceps and shoulders. The smith machine offers additional stability compared to a free-weight bench press, making it accessible for those with less experience or those seeking a safer alternative to heavy pressing.','chest','triceps, shoulders','https://v2.exercisedb.io/image/pw3rgZJYB3R-WX');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (590,'smith bent knee good morning','The smith bent knee good morning is a lower body exercise performed on a Smith machine. It primarily targets the glutes, with secondary emphasis on the hamstrings and lower back. The movement involves hinging at the hips with a slight knee bend, lowering the torso while keeping the back straight, and then returning to the starting position.','upper legs','hamstrings, lower back','https://v2.exercisedb.io/image/RoblxnYh3Y2g60');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (591,'smith chair squat','The smith chair squat is a lower body exercise performed using a smith machine. It primarily targets the quadriceps, with secondary emphasis on the glutes, hamstrings, and calves. The guided bar path of the smith machine provides stability, making it suitable for those developing squat technique or seeking a safer alternative to free-weight squats.','upper legs','glutes, hamstrings, calves','https://v2.exercisedb.io/image/nRONWG1DcvrMbI');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (592,'smith close-grip bench press','The smith close-grip bench press is a compound exercise performed on a smith machine, targeting the triceps with secondary emphasis on the chest and shoulders. It involves pressing a barbell with a close grip, which increases triceps activation.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/OPHiabd9ps27ip');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (593,'smith deadlift','The smith deadlift is a compound lower body exercise performed using a smith machine. It primarily targets the glutes, with secondary emphasis on the hamstrings, quadriceps, and lower back. The smith machine provides a guided bar path, which can help with stability and form for those learning the deadlift movement.','upper legs','hamstrings, quadriceps, lower back','https://v2.exercisedb.io/image/PGYvp4oppMCV4a');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (594,'smith decline bench press','The smith decline bench press is a chest exercise performed on a decline bench using a smith machine. It primarily targets the pectoral muscles, with secondary emphasis on the triceps and shoulders. The smith machine provides guided movement, making it safer and more stable than a free-weight decline bench press.','chest','triceps, shoulders','https://v2.exercisedb.io/image/AMk1TOjbjB-Li0');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (595,'smith decline reverse-grip press','The smith decline reverse-grip press is a chest exercise performed on a smith machine in a decline position, using a reverse (underhand) grip to target the lower pectorals and engage the triceps and shoulders.','chest','triceps, shoulders','https://v2.exercisedb.io/image/1zJddB1iUsKWOt');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (596,'smith hack squat','The smith hack squat is a lower body exercise performed on a smith machine, targeting the glutes as the primary muscle group, with secondary emphasis on the quadriceps, hamstrings, and calves. It involves squatting with the barbell resting on the upper traps and shoulders, providing stability and support for the movement.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/RBEHDWBfklHTMN');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (597,'smith hip raise','The smith hip raise is an exercise performed on a smith machine that primarily targets the abdominal muscles, with secondary emphasis on the glutes and hamstrings. It involves raising the hips off the ground while keeping the body aligned, engaging the core and lower body.','waist','glutes, hamstrings','https://v2.exercisedb.io/image/MK9b3e1GuxsQL2');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (598,'smith incline bench press','The smith incline bench press is a chest exercise performed on a smith machine with the bench set at a 30-45 degree incline. It primarily targets the upper pectorals, with secondary emphasis on the shoulders and triceps. The smith machine provides stability, making it accessible for those with less experience, but still requires proper form and control.','chest','shoulders, triceps','https://v2.exercisedb.io/image/nfnAgUVXGxsPc8');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (599,'smith incline reverse-grip press','The smith incline reverse-grip press is a chest exercise performed on a smith machine with an incline bench. It targets the pectoral muscles using a reverse (underhand) grip, which also engages the triceps and shoulders. The smith machine provides stability, but the reverse grip and incline angle require good coordination and some experience.','chest','triceps, shoulders','https://v2.exercisedb.io/image/GDsvOJz7xOQpn3');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (600,'smith incline shoulder raises','Smith incline shoulder raises target the serratus anterior and are performed on a smith machine. The movement involves raising the barbell upwards while standing at an incline, focusing on shoulder and upper chest engagement.','chest','deltoids, trapezius','https://v2.exercisedb.io/image/zIOIRPLwKmzsIn');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (601,'smith leg press','The smith leg press is a lower body exercise performed on a smith machine, targeting the glutes with secondary emphasis on the quadriceps, hamstrings, and calves. It involves pressing a footplate away from the body while seated, using the legs to extend and flex at the knees and hips.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/5qOkBhwgoBEr5Y');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (602,'smith narrow row','The smith narrow row is a machine-based rowing exercise targeting the upper back, performed with a narrow grip to emphasize the upper back muscles and rear deltoids. It is performed on a Smith machine, which provides guided movement for added stability.','back','biceps, rear deltoids','https://v2.exercisedb.io/image/hC8d7rB6R6ECuR');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (603,'smith rear delt row','The smith rear delt row is a machine-based exercise targeting the rear deltoids, with secondary emphasis on the trapezius, rhomboids, and biceps. It involves pulling a bar towards your chest while keeping your chest against a pad, focusing on squeezing the shoulder blades together.','shoulders','trapezius, rhomboids, biceps','https://v2.exercisedb.io/image/lSFinavT9lKiJk');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (604,'smith reverse calf raises','The smith reverse calf raises is a lower leg exercise performed on a smith machine, primarily targeting the calves and secondarily engaging the hamstrings. The movement involves raising and lowering the heels while standing on a step, using the smith machine bar for support.','lower legs','hamstrings','https://v2.exercisedb.io/image/txPbfuDpO6OO-S');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (605,'smith reverse-grip press','The smith reverse-grip press is a chest exercise performed on a smith machine using a reverse (underhand) grip. This variation targets the upper chest and also engages the triceps and shoulders. The smith machine provides stability, making it suitable for those looking to focus on form and muscle activation.','chest','triceps, shoulders','https://v2.exercisedb.io/image/HqfzhxXRJQtgn8');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (606,'smith seated shoulder press','The smith seated shoulder press is a machine-based exercise targeting the deltoid muscles of the shoulders. It provides stability and support, making it suitable for those looking to build shoulder strength with reduced risk of losing balance. The movement also engages the triceps and upper back as secondary muscles.','shoulders','triceps, upper back','https://v2.exercisedb.io/image/PHLXNXhUY8xzVB');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (607,'smith shoulder press','The smith shoulder press is a compound exercise performed on a smith machine that targets the deltoid muscles of the shoulders. It provides stability for the lifter, making it easier to focus on pressing strength and muscle development.','shoulders','triceps, upper back','https://v2.exercisedb.io/image/2ewebwQCqe3rmK');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (608,'smith shrug','The smith shrug is an exercise performed on a Smith machine to target the trapezius muscles. It involves lifting the shoulders towards the ears while holding a barbell, focusing on squeezing the traps at the top of the movement.','back','shoulders','https://v2.exercisedb.io/image/AYXzPiN8GVDhM7');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (609,'smith single leg split squat','The smith single leg split squat is a lower body exercise performed using a smith machine. It targets the quadriceps while also engaging the glutes and hamstrings. The exercise requires balance and unilateral strength, as one leg is elevated behind you on a bench or step.','upper legs','glutes, hamstrings','https://v2.exercisedb.io/image/8Tl7dirZDZGWiK');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (610,'smith sprint lunge','The smith sprint lunge is a lower body exercise performed using a smith machine. It targets the glutes primarily, with secondary emphasis on the quadriceps, hamstrings, and calves. The movement involves stepping back and placing one foot on the barbell, then performing a lunge, which challenges balance, strength, and coordination.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/Q3YCrSP5YP8Lpg');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (611,'smith squat','The smith squat is a lower body exercise performed using a smith machine. It primarily targets the glutes, with secondary emphasis on the quadriceps, hamstrings, and calves. The guided bar path of the smith machine provides stability, making it suitable for those learning proper squat form or looking to focus on muscle activation without balancing a free barbell.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/0V1FQyOyh7VMy3');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (612,'smith standing back wrist curl','The smith standing back wrist curl is an isolation exercise targeting the forearms, performed using a smith machine. It involves curling the wrists upwards while holding the barbell with an overhand grip, focusing on forearm strength.','lower arms','biceps, triceps','https://v2.exercisedb.io/image/cd8hyFdgS3rW1r');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (613,'smith standing behind head military press','The smith standing behind head military press is a shoulder exercise performed using a smith machine. The movement targets the deltoids and involves pressing a barbell from behind the head to overhead while standing.','shoulders','triceps, upper back','https://v2.exercisedb.io/image/egJkJYMFiyztNn');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (614,'smith standing leg calf raise','The smith standing leg calf raise is a lower leg exercise performed using a smith machine. It primarily targets the calves, with secondary emphasis on the hamstrings and glutes. The movement involves raising the heels to stand on the toes, then lowering back down, using the smith machine for stability and added resistance.','lower legs','hamstrings, glutes','https://v2.exercisedb.io/image/EE6fs5v7Mn3c0d');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (615,'smith standing military press','The Smith standing military press is a compound exercise targeting the deltoid muscles of the shoulders, performed using a Smith machine for added stability. It also engages the triceps and upper back as secondary muscles. The fixed bar path of the Smith machine can make the movement more accessible for those learning the overhead press, but it still requires good shoulder mobility and core stability.','shoulders','triceps, upper back','https://v2.exercisedb.io/image/nyPV-VSyV83g8s');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (616,'smith upright row','The smith upright row is a shoulder exercise performed on a smith machine, targeting the deltoids and also engaging the traps and biceps. It involves pulling a barbell upwards towards the chin while keeping the elbows higher than the wrists.','shoulders','traps, biceps','https://v2.exercisedb.io/image/wK0BBz68Hfz-J5');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (617,'snatch pull','The snatch pull is a compound Olympic weightlifting movement that develops explosive power and strength in the lower body, particularly targeting the quads, hamstrings, and glutes. It requires coordination, balance, and proper technique to perform safely and effectively.','upper legs','hamstrings, glutes, calves','https://v2.exercisedb.io/image/bMxVFYUviKVJPr');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (618,'spell caster','The spell caster is a rotational core exercise performed with a dumbbell, targeting the abs and obliques. It involves hinging at the waist and rotating the torso while moving the dumbbell from side to side.','waist','obliques, lower back','https://v2.exercisedb.io/image/y-DL-XjXjncf7m');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (619,'spider crawl push up','The spider crawl push up is a challenging bodyweight exercise that combines a push-up with a dynamic knee drive, targeting the glutes, core, chest, and shoulders. It requires coordination, strength, and stability.','upper legs','core, chest, shoulders','https://v2.exercisedb.io/image/rrVK6z-sqvsrx3');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (620,'squat jerk','The squat jerk is an advanced Olympic weightlifting movement that combines a squat and a jerk, requiring explosive power, coordination, and balance. It targets the quads primarily, with significant involvement from the glutes, hamstrings, calves, and core.','upper legs','glutes, hamstrings, calves, core','https://v2.exercisedb.io/image/ZR2AR94hCqC0Yw');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (621,'standing behind neck press','The standing behind neck press is a barbell exercise targeting the deltoids, performed by pressing a barbell from behind the neck to overhead while standing. It also engages the triceps and upper back.','shoulders','triceps, upper back','https://v2.exercisedb.io/image/yXtL3r-8yQu0DW');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (622,'standing lateral stretch','The standing lateral stretch is a bodyweight exercise that targets the lats and stretches the sides of the torso. It also engages the shoulders and obliques. This movement is performed by standing with feet shoulder-width apart, extending the arms, and leaning to each side to stretch the lateral muscles.','back','shoulders, obliques','https://v2.exercisedb.io/image/VbV4n1maCTHKyv');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (623,'standing single leg curl','The standing single leg curl is a bodyweight exercise targeting the hamstrings and glutes. It involves balancing on one leg while curling the opposite heel toward the glutes, emphasizing hamstring activation and single-leg stability.','upper legs','glutes','https://v2.exercisedb.io/image/FqcplVI7KvozHI');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (624,'standing wheel rollerout','The standing wheel rollout is an advanced core exercise that primarily targets the abdominal muscles, while also engaging the lower back and shoulders. It requires significant core strength, balance, and control to perform safely and effectively.','waist','lower back, shoulders','https://v2.exercisedb.io/image/c2TGDcbMJXjj2o');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (625,'stationary bike walk','The stationary bike walk is a cardiovascular exercise performed on a leverage machine (stationary bike). It primarily targets the cardiovascular system and also engages the quadriceps, hamstrings, and calves. The exercise involves pedaling at a steady pace, with the option to adjust resistance for increased intensity.','cardio','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/15MI3yPkzA5q98');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (626,'superman push-up','The superman push-up is a challenging bodyweight exercise that targets the pectorals while also engaging the core and shoulders. It involves alternating the extension of opposite arms and legs during the push-up, requiring significant balance, strength, and coordination.','chest','core, shoulders','https://v2.exercisedb.io/image/qBMQGTWlHMq17G');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (627,'suspended abdominal fallout','The suspended abdominal fallout is a challenging core exercise performed with a suspension trainer. It targets the abs and also engages the obliques and hip flexors. The movement requires significant core strength, stability, and control to maintain proper form while leaning forward and returning to the starting position.','waist','obliques, hip flexors','https://v2.exercisedb.io/image/6fB7ldsM49TpWM');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (628,'suspended push-up','The suspended push-up is a challenging variation of the traditional push-up performed using a suspension trainer. This exercise increases instability, requiring greater core engagement and upper body strength.','chest','triceps, shoulders, core','https://v2.exercisedb.io/image/9LJ7XE1EqR3G1X');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (629,'suspended reverse crunch','The suspended reverse crunch is an advanced core exercise performed by hanging from a pull-up bar and curling the knees up towards the chest, targeting the abdominal muscles and hip flexors.','waist','hip flexors','https://v2.exercisedb.io/image/HSTOZdUXDiCMN4');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (630,'suspended row','The suspended row is a bodyweight exercise performed using a suspension trainer. It targets the upper back and also engages the biceps and shoulders. The movement requires pulling your chest towards the handles while maintaining a straight body position, making it effective for building upper body strength and stability.','back','biceps, shoulders','https://v2.exercisedb.io/image/3NnjT4xrHJOxZf');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (631,'suspended split squat','The suspended split squat is a lower body exercise that targets the quads, with secondary emphasis on the glutes, hamstrings, and calves. It is performed using body weight and a suspension trainer, requiring balance, strength, and coordination.','upper legs','glutes, hamstrings, calves','https://v2.exercisedb.io/image/q0pMVojyiJyvol');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (632,'trap bar deadlift','The trap bar deadlift is a compound lower body exercise that targets the glutes, hamstrings, quadriceps, and lower back. It is performed using a trap bar, which allows for a more upright torso and can be easier on the lower back compared to a conventional barbell deadlift.','upper legs','hamstrings, quadriceps, lower back','https://v2.exercisedb.io/image/XpdEIKiyqUNyW0');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (633,'triceps dip (bench leg)','The triceps dip (bench leg) is a bodyweight exercise targeting the triceps, performed using a bench for support. It also engages the chest and shoulders as secondary muscles. The movement involves lowering and raising the body using the arms while keeping the legs extended and feet on the ground.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/t8iFqdz2j8zsdS');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (634,'triceps dip (between benches)','The triceps dip (between benches) is a bodyweight exercise targeting the triceps, performed by supporting your weight on your hands between two benches and lowering and raising your body.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/wBu9U4TbMXSO1h');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (635,'triceps dip','The triceps dip is a bodyweight exercise that targets the triceps and also engages the chest and shoulders. It is performed using a bench or chair and involves lowering and raising the body using the arms.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/n4voNg6vqdsnAL');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (636,'triceps dips floor','A bodyweight exercise targeting the triceps, performed using the floor or a stable surface like a chair or bench. It also engages the chest and shoulders as secondary muscles.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/yB94zdv9wWZk2Z');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (637,'triceps press','The triceps press is a bodyweight exercise targeting the triceps, with secondary emphasis on the shoulders. It involves pressing your body away from the ground using your triceps strength, typically performed in a standing position with arms extended forward.','upper arms','shoulders','https://v2.exercisedb.io/image/Llw-7F7Nib0jkr');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (638,'triceps stretch','A static stretch targeting the triceps and shoulders, performed by extending one arm overhead and gently pulling the elbow with the opposite hand.','upper arms','shoulders','https://v2.exercisedb.io/image/Wiw7ac1u9QYHwn');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (639,'twin handle parallel grip lat pulldown','The twin handle parallel grip lat pulldown is a cable machine exercise targeting the latissimus dorsi, with secondary emphasis on the biceps, rhomboids, and rear deltoids. It involves pulling parallel handles down towards the chest while seated, focusing on squeezing the shoulder blades together.','back','biceps, rhomboids, rear deltoids','https://v2.exercisedb.io/image/uU2-aej3u0Svcp');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (640,'vertical leg raise (on parallel bars)','The vertical leg raise (on parallel bars) is an abdominal exercise performed by hanging from parallel bars and lifting the legs up in front of the body, targeting the abs and hip flexors.','waist','hip flexors','https://v2.exercisedb.io/image/n-B46E6aQWXMCo');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (641,'weighted bench dip','The weighted bench dip is an upper body exercise that targets the triceps, with secondary emphasis on the chest and shoulders. It involves lowering and raising your body using your arms while your feet are on the floor and your hands are on a bench, with added weight for increased resistance.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/uy5wxMYV0VoZFc');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (642,'weighted crunch','The weighted crunch is an abdominal exercise that increases resistance to strengthen the abs and obliques. It is performed lying on your back, holding a weight on your chest, and curling your upper body upward.','waist','obliques','https://v2.exercisedb.io/image/vVsd8i-s0ob6pu');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (643,'weighted donkey calf raise','The weighted donkey calf raise is a calf-focused exercise performed on a raised platform, where the lifter raises and lowers their heels while holding additional weight. This movement targets the calves and also engages the hamstrings and glutes as secondary muscles.','lower legs','hamstrings, glutes','https://v2.exercisedb.io/image/UVBs4tyW92lBm0');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (644,'weighted front raise','The weighted front raise is a shoulder exercise that targets the deltoids by lifting dumbbells in front of the body. It also engages the biceps and forearms as secondary muscles. The movement requires control and proper form to avoid swinging or using momentum.','shoulders','biceps, forearms','https://v2.exercisedb.io/image/BKc8eErd3oRpsE');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (645,'weighted hyperextension (on stability ball)','The weighted hyperextension on a stability ball targets the spinal erectors and is performed by lying face down on a stability ball, anchoring the feet, and extending the back while holding additional weight. This exercise also engages the glutes and hamstrings as secondary muscles.','back','glutes, hamstrings','https://v2.exercisedb.io/image/JEABLBaEAa8ezB');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (646,'weighted overhead crunch (on stability ball)','The weighted overhead crunch on a stability ball targets the abdominal muscles while also engaging the obliques and lower back. The use of a stability ball increases the balance and core stabilization requirements, and holding a weight overhead adds resistance, making the movement more challenging.','waist','obliques, lower back','https://v2.exercisedb.io/image/JXgMMSZmnF0CAO');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (647,'weighted pull-up','The weighted pull-up is an advanced variation of the standard pull-up, where additional weight is used to increase resistance. This exercise primarily targets the latissimus dorsi (lats) and also engages the biceps and forearms. It requires significant upper body strength, coordination, and experience to perform safely and effectively.','back','biceps, forearms','https://v2.exercisedb.io/image/BHECqHw3trkuZs');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (648,'weighted round arm','The weighted round arm is a shoulder exercise that targets the deltoids while also engaging the triceps and upper back. It involves lifting weights in a controlled, circular motion, which requires good form and coordination.','shoulders','triceps, upper back','https://v2.exercisedb.io/image/s1PFKtRSJsHoik');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (649,'weighted russian twist (legs up)','The weighted Russian twist (legs up) is a core exercise that targets the abdominal muscles, particularly the obliques, while also engaging the hip flexors. The movement involves twisting the torso from side to side while holding a weight and keeping the legs elevated, which increases the challenge to balance and core stability.','waist','obliques, hip flexors','https://v2.exercisedb.io/image/aiQ5Qd-hBCFdXz');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (650,'weighted russian twist','The weighted Russian twist is a core exercise that targets the abs and obliques, performed by twisting the torso while holding a weight or medicine ball.','waist','obliques, lower back','https://v2.exercisedb.io/image/MqaNSJvZxH7vS-');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (651,'weighted seated bicep curl (on stability ball)','A bicep curl performed while seated on a stability ball, using a medicine ball for resistance. This variation challenges core stability and balance in addition to targeting the biceps.','upper arms','forearms','https://v2.exercisedb.io/image/1twJuK7HgGK4ki');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (652,'weighted seated twist (on stability ball)','The weighted seated twist on a stability ball is an exercise that targets the abdominal muscles, particularly the obliques, while also engaging the lower back. It requires core strength, balance, and coordination due to the instability of the ball and the added resistance from the weight.','waist','obliques, lower back','https://v2.exercisedb.io/image/03kkhdzttzdCPA');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (653,'weighted side bend (on stability ball)','The weighted side bend on a stability ball targets the abdominal muscles, particularly the obliques, and also engages the lower back. The use of a stability ball increases the balance and core activation required, while the added weight increases resistance for strength gains.','waist','obliques, lower back','https://v2.exercisedb.io/image/KI87QauPsBS0aW');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (654,'weighted sissy squat','The weighted sissy squat is a challenging lower body exercise that targets the quadriceps while also engaging the glutes, hamstrings, and calves. It requires balance, strength, and coordination, especially when performed with added weight.','upper legs','glutes, hamstrings, calves','https://v2.exercisedb.io/image/0syCoH-8SCOcXQ');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (655,'weighted squat','A weighted squat is a compound lower-body exercise that targets the glutes, quadriceps, hamstrings, and calves. It involves holding a weight while performing a squat, increasing resistance and intensity.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/EBxmFAUxELFY8P');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (656,'weighted standing curl','The weighted standing curl is a classic strength exercise targeting the biceps, performed with dumbbells while standing. It also engages the forearms as secondary muscles.','upper arms','forearms','https://v2.exercisedb.io/image/BOONGXWz1ZcpMQ');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (657,'weighted standing hand squeeze','The weighted standing hand squeeze is an exercise targeting the forearms, performed by squeezing weights in each hand while standing. This movement helps to improve grip strength and forearm endurance.','lower arms','biceps, triceps','https://v2.exercisedb.io/image/wC0lrFSAeXM8kz');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (658,'weighted svend press','The weighted Svend press is a chest exercise performed by pressing a weight plate out in front of the body, emphasizing the pectoral muscles while also engaging the shoulders and triceps.','chest','shoulders, triceps','https://v2.exercisedb.io/image/UaDEWQdzHnoBIL');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (659,'wheel rollout','The wheel rollout is an advanced core exercise that targets the abdominal muscles and also engages the lower back. It requires significant core strength, stability, and control to perform safely and effectively.','waist','lower back','https://v2.exercisedb.io/image/AZ4dkoX0od-bkM');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (660,'wind sprints','Wind sprints are high-intensity running intervals performed over a short distance or time, focusing on explosive speed and cardiovascular endurance. They primarily target the abs for stabilization, while also engaging the quadriceps, hamstrings, and calves.','waist','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/30Yz6QfjzvRFL5');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (661,'wrist rollerer','The wrist roller is an exercise that targets the forearms by using a weighted rope or bar. It involves rolling a weight up and down using wrist flexion and extension, which helps build forearm strength and endurance.','lower arms','biceps, triceps','https://v2.exercisedb.io/image/fhcsVPEkZHiT9g');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (662,'cable kickback','The cable kickback is an isolation exercise targeting the triceps, performed using a cable machine. It involves extending the arm backward against resistance to work the triceps, with some secondary engagement of the shoulders.','upper arms','shoulders','https://v2.exercisedb.io/image/gGf3or-rqLJB2Z');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (663,'cable seated row','The cable seated row is a strength exercise that targets the upper back, with secondary emphasis on the biceps and forearms. It is performed using a cable row machine and involves pulling handles towards the torso while maintaining a straight back and squeezing the shoulder blades together.','back','biceps, forearms','https://v2.exercisedb.io/image/zpzFP1wAVMYzLk');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (664,'cable twist (up-down)','The cable twist (up-down) is an exercise that targets the abdominal muscles, especially the obliques and lower back, by using a cable machine to add resistance to rotational movements of the torso.','waist','obliques, lower back','https://v2.exercisedb.io/image/Ol99okUb4tdQ1O');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (665,'dumbbell lying external shoulder rotation','The dumbbell lying external shoulder rotation is an exercise that targets the deltoid muscles and the rotator cuff, helping to improve shoulder stability and strength. It is performed lying on your side, rotating the forearm upward while keeping the upper arm against the side.','shoulders','rotator cuff, triceps','https://v2.exercisedb.io/image/DA-Audp2k4MtPz');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (666,'dumbbell upright shoulder external rotation','The dumbbell upright shoulder external rotation is an exercise that targets the deltoids and also engages the rotator cuff and trapezius muscles. It involves raising the arms to shoulder height and externally rotating the shoulders while holding dumbbells.','shoulders','rotator cuff, trapezius','https://v2.exercisedb.io/image/KHD42pCBUz0ivu');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (667,'lying leg-hip raise','The lying leg-hip raise is an abdominal exercise performed on the floor using only body weight. It targets the abs and also works the hip flexors. The movement involves lifting the legs and hips off the ground while keeping the core engaged, then lowering them back down with control.','waist','hip flexors','https://v2.exercisedb.io/image/ohDuBwsf-enMdt');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (668,'weighted hanging leg-hip raise','The weighted hanging leg-hip raise is an advanced core exercise that targets the abdominal muscles, with additional emphasis on the hip flexors and lower back. The movement requires hanging from a pull-up bar while lifting weighted legs up to engage the core.','waist','hip flexors, lower back','https://v2.exercisedb.io/image/4-3EvxmvCf6D6s');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (669,'cable curl','The cable curl is a strength exercise targeting the biceps, performed using a cable machine. It involves curling a cable attachment towards the shoulders while keeping the elbows close to the body, providing constant tension on the biceps throughout the movement.','upper arms','forearms','https://v2.exercisedb.io/image/RZXS3rePPCk9PN');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (670,'lever shoulder press v. 2','The lever shoulder press v. 2 is a machine-based exercise targeting the deltoid muscles, with secondary emphasis on the triceps and chest. It is performed seated on a leverage machine, pressing handles upward and forward to work the shoulders.','shoulders','triceps, chest','https://v2.exercisedb.io/image/-2P-sJ4UCdXfvd');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (671,'butt-ups','Butt-ups are a bodyweight exercise targeting the abdominal muscles. The movement involves lying on your back, lifting your legs towards your chest, and engaging your core to raise your hips off the ground. This exercise also works the hip flexors and lower back as secondary muscles.','waist','hip flexors, lower back','https://v2.exercisedb.io/image/4rpbGZ6Ak1KZJu');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (672,'tuck crunch','The tuck crunch is a bodyweight abdominal exercise that targets the abs and also engages the hip flexors. It involves curling the upper body and bringing the knees toward the chest simultaneously, making it an effective core strengthening movement.','waist','hip flexors','https://v2.exercisedb.io/image/Khbjt5LBqhg5bu');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (673,'reverse crunch','The reverse crunch is a bodyweight exercise that targets the abdominal muscles, especially the lower abs, by curling the hips off the floor and bringing the knees toward the chest.','waist','hip flexors','https://v2.exercisedb.io/image/EIiV2BakMyz2sp');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (674,'cable reverse crunch','The cable reverse crunch is an abdominal exercise that utilizes a cable machine to add resistance to the traditional reverse crunch movement. It primarily targets the abs and also engages the hip flexors.','waist','hip flexors','https://v2.exercisedb.io/image/Hf1XYBBWqjaKeM');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (675,'cable standing crunch (with rope attachment)','The cable standing crunch (with rope attachment) is an abdominal exercise performed using a cable machine and rope attachment. It targets the abs and also engages the obliques. The movement involves crunching the torso forward against resistance, providing a challenging core workout.','waist','obliques','https://v2.exercisedb.io/image/LQEcdsnFfCkF-K');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (676,'band alternating biceps curl','The band alternating biceps curl is an exercise targeting the biceps using a resistance band. It involves curling one arm at a time while keeping the elbows close to the body, providing resistance throughout the movement.','upper arms','forearms','https://v2.exercisedb.io/image/NcnL6uynJP9FHm');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (677,'band alternating v-up','The band alternating v-up is an abdominal exercise that targets the abs and hip flexors. It involves lying on your back, holding a resistance band, and simultaneously lifting your legs and upper body while alternating leg positions.','waist','hip flexors','https://v2.exercisedb.io/image/NWJGE0QU94GS-u');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (678,'band assisted pull-up','The band assisted pull-up is a variation of the traditional pull-up that uses a resistance band to provide assistance, making it easier to perform the movement. This exercise targets the latissimus dorsi (lats) and also works the biceps and forearms. It is commonly used to build strength and improve pull-up technique, especially for those who are not yet able to perform unassisted pull-ups.','back','biceps, forearms','https://v2.exercisedb.io/image/ZHFFPkzL63oMpa');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (679,'band assisted wheel rollerout','The band assisted wheel rollout is an abdominal exercise that uses a resistance band to help control the movement and reduce the difficulty compared to a standard ab wheel rollout. It targets the abs and also engages the lower back for stability.','waist','lower back','https://v2.exercisedb.io/image/bpC5bKAieTNTeR');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (680,'band bicycle crunch','The band bicycle crunch is a core exercise that targets the abs, with additional emphasis on the hip flexors and obliques. The use of a resistance band increases the challenge, requiring greater core stability and strength.','waist','hip flexors, obliques','https://v2.exercisedb.io/image/AFBT999z02xLJg');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (681,'band close-grip pulldown','The band close-grip pulldown is a resistance exercise targeting the latissimus dorsi (lats) using a resistance band anchored overhead. It mimics the motion of a cable pulldown but uses a band for resistance, making it accessible and effective for home workouts.','back','biceps, forearms','https://v2.exercisedb.io/image/3NWJWSc7fFh9xV');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (682,'band close-grip push-up','The band close-grip push-up is a variation of the traditional push-up that uses a resistance band to increase tension and target the triceps more effectively. The close hand placement emphasizes the triceps, while the band adds extra resistance throughout the movement.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/Zgf1yRV-uz9VnW');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (683,'band concentration curl','The band concentration curl is an isolation exercise targeting the biceps using a resistance band. It is performed seated, with the working arm braced against the thigh to minimize cheating and maximize biceps engagement.','upper arms','forearms','https://v2.exercisedb.io/image/i0q8J49OsNQwdP');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (684,'band front lateral raise','The band front lateral raise is a shoulder exercise that targets the deltoid muscles. Using a resistance band, you lift your arms straight in front of you, working the shoulders and upper back.','shoulders','traps, upper back','https://v2.exercisedb.io/image/XvlmhqTGtEvfYK');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (685,'band front raise','The band front raise is an exercise targeting the deltoid muscles of the shoulders. It is performed by standing on a resistance band and raising the arms straight in front of the body to shoulder height, then lowering them back down. This movement helps build shoulder strength and stability, with secondary activation of the triceps and upper back.','shoulders','triceps, upper back','https://v2.exercisedb.io/image/kZmdlmxCl2z8bE');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (686,'band horizontal pallof press','The band horizontal Pallof press is an anti-rotation core exercise that targets the abs and obliques, helping to build core stability and strength. It is performed using a resistance band anchored at waist height.','waist','obliques, glutes','https://v2.exercisedb.io/image/c9gdoHXP4geWO4');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (687,'band bent-over hip extension','The band bent-over hip extension is an exercise targeting the glutes, performed by extending one leg back against resistance from a band while maintaining a bent-over position. It also engages the hamstrings and lower back.','upper legs','hamstrings, lower back','https://v2.exercisedb.io/image/wTxcPQsnROwhpe');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (688,'band jack knife sit-up','The band jack knife sit-up is an abdominal exercise that uses a resistance band to increase difficulty. It targets the abs and also works the hip flexors. The movement involves simultaneously lifting the legs and upper body while holding a resistance band, requiring core strength and coordination.','waist','hip flexors','https://v2.exercisedb.io/image/hrSUDjfuNrkVQC');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (689,'band kneeling one arm pulldown','The band kneeling one arm pulldown is a resistance band exercise targeting the latissimus dorsi (lats) and also engaging the biceps and rhomboids. It involves kneeling and pulling a resistance band from overhead down to your side, focusing on controlled movement and muscle engagement.','back','biceps, rhomboids','https://v2.exercisedb.io/image/FGFQAI1xjrpEtA');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (690,'band lying hip internal rotation','The band lying hip internal rotation is an exercise that targets the glutes and helps improve hip mobility and strength. It is performed lying on your back with a resistance band looped around your feet, focusing on rotating the knees outward while keeping the feet together.','upper legs','hamstrings, quadriceps','https://v2.exercisedb.io/image/H1xN-P8OCYe8X8');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (691,'band kneeling twisting crunch','The band kneeling twisting crunch is an abdominal exercise that targets the abs and obliques using a resistance band. It involves kneeling and twisting the torso against the resistance of the band, engaging the core muscles.','waist','obliques','https://v2.exercisedb.io/image/n1GiMaM7RhXQBi');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (692,'band one arm overhead biceps curl','The band one arm overhead biceps curl is an isolation exercise targeting the biceps, performed with a resistance band. It involves curling the arm overhead while keeping the upper arm stationary, providing resistance throughout the movement.','upper arms','forearms, shoulders','https://v2.exercisedb.io/image/ApRFW6KvCTdEEM');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (693,'band one arm single leg split squat','The band one arm single leg split squat is a lower body exercise that targets the quadriceps, with secondary emphasis on the glutes and hamstrings. It involves performing a split squat on one leg with the rear foot elevated and a resistance band around the ankles, challenging balance and unilateral strength.','upper legs','glutes, hamstrings','https://v2.exercisedb.io/image/ZNyivDUH3Fhz7M');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (694,'band one arm standing low row','The band one arm standing low row is a resistance band exercise targeting the upper back, performed by pulling a band anchored at waist height towards your waist with one arm while standing.','back','biceps, shoulders','https://v2.exercisedb.io/image/fHvZg727xmX6MC');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (695,'band one arm twisting chest press','The band one arm twisting chest press is a unilateral chest exercise using a resistance band. It targets the pectorals while also engaging the shoulders and triceps. The twisting motion adds a rotational component, increasing core activation and coordination demands.','chest','shoulders, triceps','https://v2.exercisedb.io/image/djpGl0T7hK-xBc');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (696,'band one arm twisting seated row','The band one arm twisting seated row is a resistance exercise targeting the upper back, with secondary emphasis on the biceps and shoulders. It incorporates a twisting motion to engage the core and improve rotational strength.','back','biceps, shoulders','https://v2.exercisedb.io/image/UF93uhK4q4G3x3');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (697,'band pull through','The band pull through is a hip hinge exercise that targets the glutes, hamstrings, and lower back using a resistance band. It is performed by hinging at the hips while facing away from an anchored band, then driving the hips forward to stand upright.','upper legs','hamstrings, lower back','https://v2.exercisedb.io/image/12d9B1pst6hyDy');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (698,'band push sit-up','The band push sit-up is an abdominal exercise that incorporates resistance from a band to increase the challenge on the core muscles. It also engages the shoulders and chest as stabilizers during the movement.','waist','shoulders, chest','https://v2.exercisedb.io/image/p6Sk5vdWVBf7OD');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (699,'band reverse fly','The band reverse fly is an exercise that targets the deltoid muscles of the shoulders, as well as the upper back and trapezius. It is performed using a resistance band attached to a stationary object, and involves pulling the band apart with straight arms to strengthen the rear delts and upper back.','shoulders','upper back, trapezius','https://v2.exercisedb.io/image/bnRJYoT1OxbxB2');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (700,'band reverse wrist curl','The band reverse wrist curl is an isolation exercise targeting the forearms, specifically the wrist extensors, using a resistance band. It is performed seated, with the forearms resting on the thighs and the wrists curling upward against the resistance of the band.','lower arms','forearms','https://v2.exercisedb.io/image/5CTo7-ZrppUZAq');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (701,'band seated hip internal rotation','The band seated hip internal rotation is an exercise that targets the glutes and helps improve hip mobility and strength. It is performed while seated, using a resistance band to provide external resistance as you rotate your knees outward.','upper legs','hamstrings, quadriceps','https://v2.exercisedb.io/image/gMF9ChZdEN6-55');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (702,'band shoulder press','The band shoulder press is a resistance exercise targeting the deltoid muscles of the shoulders, using a resistance band for added tension. It also engages the triceps and upper back as secondary muscles. The movement involves pressing the band overhead from shoulder height, making it a fundamental strength exercise for the upper body.','shoulders','triceps, upper back','https://v2.exercisedb.io/image/hKrbB2hi7BtKtb');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (703,'band side triceps extension','The band side triceps extension is an exercise targeting the triceps using a resistance band. It also engages the shoulders as secondary muscles. The movement involves extending the arms out to the sides and bending the elbows to bring the hands toward the shoulders, then returning to the starting position.','upper arms','shoulders','https://v2.exercisedb.io/image/tCb7rkkqAnXcXk');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (704,'band single leg calf raise','The band single leg calf raise is a lower leg exercise that targets the calves using a resistance band. It also engages the ankles and feet, helping to improve strength and stability in the lower leg. The movement is performed one leg at a time, which increases the balance and coordination required.','lower legs','ankles, feet','https://v2.exercisedb.io/image/bLb2kCSTK22B48');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (705,'band single leg reverse calf raise','The band single leg reverse calf raise is a lower leg exercise that targets the calves, with secondary emphasis on the hamstrings and glutes. It uses a resistance band and requires balance and control as you raise your heel off the ground on one leg.','lower legs','hamstrings, glutes','https://v2.exercisedb.io/image/mc6LRp0Dbpdv2s');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (706,'band single leg split squat','The band single leg split squat is a lower body exercise targeting the quads, with secondary emphasis on the glutes and hamstrings. It uses a resistance band for added tension and requires balance and coordination.','upper legs','glutes, hamstrings','https://v2.exercisedb.io/image/BnNUdkRh5kG3pL');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (707,'band lying straight leg raise','The band lying straight leg raise is an abdominal exercise that also engages the hip flexors. It uses a resistance band to add difficulty and helps strengthen the core and lower body.','waist','hip flexors','https://v2.exercisedb.io/image/SIen8BfHT410Rl');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (708,'band squat row','The band squat row is a compound exercise that targets the glutes while also engaging the hamstrings, quadriceps, and back. It combines a squat with a rowing motion using a resistance band, making it effective for both lower and upper body strength.','upper legs','hamstrings, quadriceps, back','https://v2.exercisedb.io/image/GWZ3atgQnrugml');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (709,'band squat','The band squat is a lower body exercise that targets the glutes using a resistance band placed above the knees. It also engages the quadriceps, hamstrings, and calves. This exercise helps build strength and stability in the lower body.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/b2Caco1ulhetjs');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (710,'band standing crunch','The band standing crunch is an abdominal exercise performed with a resistance band anchored at waist height. It targets the abs and also engages the obliques. The movement involves crunching forward against the resistance of the band while standing, which can help strengthen the core.','waist','obliques','https://v2.exercisedb.io/image/lKU8-KeBCks3r4');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (711,'band standing twisting crunch','The band standing twisting crunch is an abdominal exercise that targets the abs and obliques using a resistance band. It involves twisting the torso while performing a crunch motion, engaging the core muscles.','waist','obliques','https://v2.exercisedb.io/image/33DJujgqcFOsF-');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (712,'band step-up','The band step-up is a lower body exercise that targets the glutes, with secondary emphasis on the quadriceps, hamstrings, and calves. It involves stepping onto a platform with resistance provided by a band around the thighs, enhancing muscle activation and stability.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/1YqdhjpTSKK0qw');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (713,'band stiff leg deadlift','The band stiff leg deadlift is a lower body exercise targeting the glutes, with secondary emphasis on the hamstrings and lower back. It uses a resistance band to provide tension throughout the movement, focusing on hip hinging and posterior chain activation.','upper legs','hamstrings, lower back','https://v2.exercisedb.io/image/mQcnfxt-QW13-f');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (714,'band straight leg deadlift','The band straight leg deadlift is a resistance exercise targeting the muscles of the lower back, hamstrings, and glutes. Using a resistance band, it mimics the movement of a traditional straight leg deadlift, focusing on hip hinging and posterior chain activation.','back','hamstrings, glutes','https://v2.exercisedb.io/image/sgyCKDgGHVb2f5');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (715,'band seated twist','The band seated twist is an exercise that targets the abdominal muscles, particularly the obliques, by incorporating rotational movement with resistance from a band. It is performed seated on the ground with legs extended and involves twisting the torso side to side.','waist','obliques','https://v2.exercisedb.io/image/MSS3hkVt6aKwRY');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (716,'band twisting overhead press','The band twisting overhead press is a dynamic shoulder exercise that combines an overhead press with a torso twist, engaging the deltoids, triceps, and upper back while also challenging core stability and coordination.','shoulders','triceps, upper back','https://v2.exercisedb.io/image/DZ6X-KpHGgz8Xa');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (717,'band underhand pulldown','The band underhand pulldown is a resistance band exercise targeting the latissimus dorsi (lats) and also engaging the biceps and forearms. It mimics the movement of a lat pulldown machine but uses a resistance band anchored overhead.','back','biceps, forearms','https://v2.exercisedb.io/image/S5UweHs540Oo5l');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (718,'band v-up','The band v-up is an abdominal exercise that uses a resistance band to increase the challenge. It targets the abs and also engages the hip flexors, requiring core strength and coordination to perform the simultaneous lifting of the upper and lower body.','waist','hip flexors','https://v2.exercisedb.io/image/lLtkE1dTNVftdn');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (719,'band vertical pallof press','The band vertical Pallof press is an anti-rotation core exercise that targets the abs and also engages the obliques and glutes. It is performed by pressing a resistance band away from the chest while resisting rotational forces, helping to build core stability and strength.','waist','obliques, glutes','https://v2.exercisedb.io/image/Bai9nayRZjWPAt');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (720,'band wrist curl','The band wrist curl is an isolation exercise targeting the forearms using a resistance band. It is performed seated, with the forearms resting on the thighs, and involves curling the wrists upward to strengthen the forearm muscles.','lower arms','biceps, triceps','https://v2.exercisedb.io/image/ZNAZMQhpWx0aGi');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (721,'band y-raise','The band Y-raise is a shoulder exercise that targets the deltoids and also engages the traps and rhomboids. It is performed using a resistance band and involves raising the arms in a \'Y\' shape to strengthen the upper back and shoulders.','shoulders','traps, rhomboids','https://v2.exercisedb.io/image/hi1LuYqla82R6F');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (722,'band shrug','The band shrug is an exercise targeting the trapezius muscles using a resistance band. It is performed by standing on the band, holding the ends, and shrugging the shoulders upward to engage the traps.','back','shoulders','https://v2.exercisedb.io/image/-4I8f-pe49cLhm');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (723,'band standing rear delt row','The band standing rear delt row is an exercise targeting the rear deltoids, with secondary emphasis on the trapezius, rhomboids, and biceps. It uses a resistance band and involves pulling the band towards the chest while hinging at the hips, focusing on squeezing the shoulder blades together.','shoulders','trapezius, rhomboids, biceps','https://v2.exercisedb.io/image/rokHfEa55yOz1Q');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (724,'band straight back stiff leg deadlift','The band straight back stiff leg deadlift is a lower body exercise targeting the glutes, with secondary emphasis on the hamstrings and lower back. It uses a resistance band and requires maintaining a straight back while hinging at the hips, focusing on posterior chain strength.','upper legs','hamstrings, lower back','https://v2.exercisedb.io/image/5XK4WjjAK1Cd22');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (725,'burpee','The burpee is a full-body exercise that combines a squat, push-up, and jump to elevate heart rate and build strength and endurance.','cardio','quadriceps, hamstrings, calves, shoulders, chest','https://v2.exercisedb.io/image/gEXlf2ZnuPl6Uw');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (726,'dynamic chest stretch (male)','The dynamic chest stretch (male) is a bodyweight exercise designed to increase flexibility and mobility in the chest, shoulders, and triceps. It involves controlled arm movements to stretch the pectoral muscles dynamically.','chest','shoulders, triceps','https://v2.exercisedb.io/image/tG1qM5ETim7y3d');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (727,'dumbbell burpee','The dumbbell burpee is a full-body exercise that combines a squat, push-up, and overhead press using dumbbells. It targets the cardiovascular system while also engaging multiple muscle groups, including the legs, shoulders, triceps, and core.','cardio','quadriceps, hamstrings, calves, shoulders, triceps, core','https://v2.exercisedb.io/image/ZJyTRNx--M-dJF');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (728,'lever donkey calf raise','The lever donkey calf raise is a machine-based exercise targeting the calf muscles. It involves standing on a platform with your heels hanging off, then raising and lowering your heels to work the calves. The leverage machine provides resistance and support, making it a controlled movement.','lower legs','hamstrings, glutes','https://v2.exercisedb.io/image/GbNXtM8OfSBD7Z');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (729,'band bench press','The band bench press is a resistance exercise targeting the pectoral muscles using a resistance band. It mimics the traditional bench press but uses bands instead of weights, making it accessible and effective for building chest strength with less equipment.','chest','triceps, shoulders','https://v2.exercisedb.io/image/p2RMmd0AmDYxmJ');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (730,'barbell decline pullover','The barbell decline pullover is a chest exercise performed on a decline bench, targeting the pectorals with secondary emphasis on the triceps and shoulders. It involves lowering a barbell in an arc behind the head and returning to the starting position, requiring control and stability.','chest','triceps, shoulders','https://v2.exercisedb.io/image/EURJIY5ACdPcR7');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (731,'barbell reverse grip decline bench press','The barbell reverse grip decline bench press is a chest exercise performed on a decline bench using a barbell with a reverse (underhand) grip. This variation targets the lower chest and places additional emphasis on the triceps and shoulders.','chest','triceps, shoulders','https://v2.exercisedb.io/image/VzrkHHwYBYTMAh');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (732,'barbell reverse grip incline bench press','The barbell reverse grip incline bench press is a chest exercise performed on an incline bench using a barbell with a reverse (underhand) grip. This variation targets the upper chest and also involves the triceps and shoulders. It requires good technique and control to perform safely, especially due to the unusual grip and incline position.','chest','triceps, shoulders','https://v2.exercisedb.io/image/6w4oDaUUWC8639');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (733,'barbell wide reverse grip bench press','The barbell wide reverse grip bench press is a chest exercise that targets the pectorals, with secondary emphasis on the triceps and shoulders. It involves lying on a bench and pressing a barbell with a wide, reverse (underhand) grip.','chest','triceps, shoulders','https://v2.exercisedb.io/image/tQxzfjizomRDCZ');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (734,'behind head chest stretch','The behind head chest stretch is a flexibility exercise that targets the pectoral muscles. It is performed by standing tall, interlacing the fingers behind the head, and gently squeezing the shoulder blades together to stretch the chest.','chest','shoulders, triceps','https://v2.exercisedb.io/image/eMv3EKl7ytxgx9');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (735,'cable decline one arm press','The cable decline one arm press is a unilateral chest exercise performed on a cable machine, targeting the lower pectorals while also engaging the triceps and shoulders. It requires stabilization and control, especially due to the single-arm nature and the decline angle.','chest','triceps, shoulders','https://v2.exercisedb.io/image/kR0yjYazn40Xpu');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (736,'cable decline press','The cable decline press is a chest exercise performed on a cable machine with a decline bench. It targets the lower portion of the pectoral muscles and also engages the triceps and shoulders. The movement involves pressing the handles away from the body in a decline position, providing constant tension through the range of motion.','chest','triceps, shoulders','https://v2.exercisedb.io/image/YB8SUDvO2jfvbY');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (737,'cable one arm decline chest fly','The cable one arm decline chest fly is an isolation exercise targeting the pectoral muscles using a cable machine and a decline bench. It emphasizes unilateral strength and control, helping to improve muscle symmetry and chest development.','chest','shoulders, triceps','https://v2.exercisedb.io/image/sXPU7aUvouTq5u');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (738,'cable one arm fly on exercise ball','The cable one arm fly on exercise ball is a unilateral chest exercise performed while seated on an exercise ball, which adds a balance component to the traditional cable fly movement. It targets the pectorals while also engaging the deltoids and triceps, and requires core stability to maintain posture on the ball.','chest','deltoids, triceps','https://v2.exercisedb.io/image/RgN8apYKcapasS');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (739,'cable one arm incline fly on exercise ball','The cable one arm incline fly on exercise ball is a chest exercise performed using a cable machine and an exercise ball, targeting the pectorals while also engaging the deltoids and triceps. The exercise requires balance and coordination due to the unstable surface of the exercise ball and the unilateral movement.','chest','deltoids, triceps','https://v2.exercisedb.io/image/VLIx1WmFXkzg7U');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (740,'cable one arm incline press','The cable one arm incline press is a unilateral chest exercise performed on an incline bench using a cable machine. It targets the pectoral muscles while also engaging the deltoids and triceps. This movement requires stability and coordination as you press the cable handle upward with one arm at a time.','chest','deltoids, triceps','https://v2.exercisedb.io/image/c7dPAAmzZejmVl');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (741,'cable one arm incline press on exercise ball','The cable one arm incline press on exercise ball is a unilateral chest exercise performed on an unstable surface, targeting the pectorals while also engaging the shoulders and triceps. The use of the exercise ball increases the demand for balance and core stability.','chest','shoulders, triceps','https://v2.exercisedb.io/image/gyaZCr-VOQOgF6');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (742,'cable one arm press on exercise ball','The cable one arm press on exercise ball is a unilateral chest exercise that also challenges core stability and balance by having the user sit on an unstable surface while pressing a cable handle forward.','chest','shoulders, triceps','https://v2.exercisedb.io/image/xUtPHjKaXfJyRC');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (743,'cable press on exercise ball','The cable press on exercise ball is a chest exercise that also engages the shoulders and triceps. It is performed by sitting on an exercise ball, holding cable handles, and pressing them forward while maintaining balance and core stability.','chest','shoulders, triceps','https://v2.exercisedb.io/image/2bo65DE2BytYaf');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (744,'cable standing up straight crossovers','Cable standing up straight crossovers are a chest exercise performed using a cable machine. The movement involves bringing the arms together in front of the body, crossing them over each other, which targets the pectoral muscles and also engages the deltoids and triceps.','chest','deltoids, triceps','https://v2.exercisedb.io/image/2AvcH29I-lomLe');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (745,'cable upper chest crossovers','Cable upper chest crossovers target the pectoral muscles using a cable machine, emphasizing the upper chest. The movement involves crossing the cables in front of the body, which also engages the deltoids and triceps.','chest','deltoids, triceps','https://v2.exercisedb.io/image/DqGfz0s2l152SA');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (746,'chest and front of shoulder stretch','A stretch targeting the chest and front of the shoulders, performed by crossing the arms in front of the body and pressing the palms together to open up the pectorals and deltoids.','chest','deltoids','https://v2.exercisedb.io/image/-fP-fXz088kHQQ');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (747,'chest stretch with exercise ball','A chest stretch performed using a stability ball to help open up the pectoral muscles, with some engagement of the shoulders and triceps. This exercise focuses on flexibility and mobility rather than strength or cardio.','chest','shoulders, triceps','https://v2.exercisedb.io/image/NOL3aJF0ybBkPL');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (748,'clap push up','The clap push up is a plyometric bodyweight exercise that targets the pectorals, triceps, and shoulders. It involves an explosive push off the ground, clapping the hands in mid-air, and landing back in the push-up position. This movement requires significant upper body strength, power, and coordination.','chest','triceps, shoulders','https://v2.exercisedb.io/image/ODNBpwKRcY4vI-');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (749,'deep push up','The deep push up is a variation of the traditional push up that increases the range of motion, targeting the pectorals more intensely and also engaging the triceps and shoulders.','chest','triceps, shoulders','https://v2.exercisedb.io/image/3omgjyq2OXGg-c');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (750,'drop push up','The drop push up is a bodyweight exercise that targets the pectorals and also works the triceps and shoulders. It involves lowering the chest towards the ground in a plank position, dropping the knees to the ground at the bottom, and then pushing back up.','chest','triceps, shoulders','https://v2.exercisedb.io/image/yWeJ7NipDxEgnp');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (751,'dumbbell decline one arm fly','The dumbbell decline one arm fly is a unilateral chest exercise performed on a decline bench, targeting the pectoral muscles and also engaging the shoulders. It requires good control and stability to perform safely, especially due to the decline angle and single-arm movement.','chest','shoulders','https://v2.exercisedb.io/image/4DcKEk-GtwMWPa');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (752,'dumbbell fly on exercise ball','The dumbbell fly on exercise ball is a chest exercise that also challenges your core and stability by performing the movement on an unstable surface. It targets the pectorals, with secondary emphasis on the shoulders and triceps.','chest','shoulders, triceps','https://v2.exercisedb.io/image/Mm3CKs4orYEnhU');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (753,'dumbbell incline fly on exercise ball','The dumbbell incline fly on exercise ball is a chest exercise that targets the pectorals while also engaging the shoulders and core for stability. It is performed by lying back on an exercise ball with dumbbells and performing a fly motion.','chest','shoulders','https://v2.exercisedb.io/image/1w3HEOHKdd87W4');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (754,'dumbbell incline one arm fly','The dumbbell incline one arm fly is a unilateral chest exercise performed on an incline bench. It targets the pectoral muscles and also engages the deltoids and triceps. The movement requires control and stability, as only one arm is working at a time, increasing the demand on core and shoulder stabilizers.','chest','deltoids, triceps','https://v2.exercisedb.io/image/FtgBreO5-DYHX8');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (755,'dumbbell incline one arm fly on exercise ball','The dumbbell incline one arm fly on exercise ball is a chest exercise that also challenges stability and balance by using an exercise ball. It targets the pectorals and also engages the shoulders and core for stabilization.','chest','shoulders','https://v2.exercisedb.io/image/AG1n2yuYxTf6nz');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (756,'dumbbell incline one arm press','The dumbbell incline one arm press is a unilateral chest exercise performed on an incline bench, targeting the upper pectorals while also engaging the shoulders and triceps. It requires balance and coordination due to the single-arm movement.','chest','shoulders, triceps','https://v2.exercisedb.io/image/P7o9W-H5p5neO6');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (757,'dumbbell incline one arm press on exercise ball','The dumbbell incline one arm press on exercise ball is a chest exercise that also engages the shoulders and triceps. It requires balance and core stability due to the use of an exercise ball and the unilateral pressing movement.','chest','shoulders, triceps','https://v2.exercisedb.io/image/b12wFvqWCnhafG');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (758,'dumbbell incline press on exercise ball','The dumbbell incline press on exercise ball is a chest exercise that also engages the shoulders and triceps. Performing this movement on an exercise ball increases the demand for balance and core stability compared to a traditional incline press on a bench.','chest','shoulders, triceps','https://v2.exercisedb.io/image/Vss5GtnQuBYpUX');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (759,'dumbbell lying pullover on exercise ball','The dumbbell lying pullover on exercise ball is a chest exercise that also engages the triceps, shoulders, and back. It requires balance and stability due to the use of the exercise ball, making it more challenging than the standard pullover.','chest','triceps, shoulders, back','https://v2.exercisedb.io/image/OioOWKBhaGuCgR');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (760,'dumbbell one arm bench fly','The dumbbell one arm bench fly is a unilateral chest exercise that targets the pectoral muscles and also engages the shoulders. It requires balance and control to stabilize the weight with one arm while lying on a bench.','chest','shoulders','https://v2.exercisedb.io/image/yCz74KVWXbWAJa');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (761,'dumbbell one arm chest fly on exercise ball','The dumbbell one arm chest fly on exercise ball is a unilateral chest exercise that also challenges core stability and balance by using an exercise ball as the base of support. It targets the pectoral muscles and also works the shoulders and triceps.','chest','shoulders, triceps','https://v2.exercisedb.io/image/AGqSP5crMKGyIl');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (762,'dumbbell one arm decline chest press','The dumbbell one arm decline chest press is a unilateral chest exercise performed on a decline bench, targeting the pectorals while also engaging the triceps and shoulders. It requires good stability and control due to the single-arm movement and the decline angle.','chest','triceps, shoulders','https://v2.exercisedb.io/image/lxdU0zeI7SciMU');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (763,'dumbbell one arm fly on exercise ball','The dumbbell one arm fly on exercise ball is a chest exercise that also challenges balance and core stability. It involves performing a single-arm fly movement while lying with your upper back on an exercise ball, which increases the demand on stabilizing muscles.','chest','shoulders, triceps','https://v2.exercisedb.io/image/PtT1yiOgL0i9-K');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (764,'dumbbell one arm incline chest press','The dumbbell one arm incline chest press is a unilateral upper body exercise that targets the pectoral muscles, with secondary emphasis on the shoulders and triceps. It is performed on an incline bench using a single dumbbell, which increases the demand for core stability and coordination.','chest','shoulders, triceps','https://v2.exercisedb.io/image/MxmFfpD8E2TmpH');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (765,'dumbbell one arm press on exercise ball','The dumbbell one arm press on exercise ball is a unilateral chest exercise that also challenges your core and balance by performing the movement on an unstable surface. It targets the pectorals while also engaging the shoulders, triceps, and core muscles.','chest','shoulders, triceps, core','https://v2.exercisedb.io/image/PjMI0gjFkSr9Pe');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (766,'dumbbell one arm pullover on exercise ball','The dumbbell one arm pullover on exercise ball is a chest exercise that also engages the triceps, latissimus dorsi, and rhomboids. It requires balance and core stability due to the use of the exercise ball, as well as unilateral strength and coordination.','chest','triceps, latissimus dorsi, rhomboids','https://v2.exercisedb.io/image/9hJGRfQqjpkLSA');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (767,'dumbbell one leg fly on exercise ball','The dumbbell one leg fly on exercise ball is a chest exercise that also challenges balance and core stability. It involves performing a dumbbell fly while balancing on one leg on an exercise ball, targeting the pectorals with secondary emphasis on shoulders and triceps.','chest','shoulders, triceps','https://v2.exercisedb.io/image/4WDozTqDlC7MPB');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (768,'dumbbell press on exercise ball','The dumbbell press on exercise ball is a chest exercise that also engages the shoulders and triceps, performed while balancing on an exercise ball to increase core activation and stability demands.','chest','shoulders, triceps','https://v2.exercisedb.io/image/l1PnZxdppxY9sf');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (769,'dumbbell pullover hip extension on exercise ball','The dumbbell pullover hip extension on exercise ball is a compound exercise that targets the pectorals while also engaging the triceps, shoulders, and core. It combines a pullover movement with a hip extension, performed on an unstable surface (exercise ball), which increases the demand for balance and coordination.','chest','triceps, shoulders, core','https://v2.exercisedb.io/image/akA3nYNsE31hlG');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (770,'dumbbell pullover on exercise ball','The dumbbell pullover on exercise ball is a chest exercise that also engages the triceps and latissimus dorsi. It is performed by lying on an exercise ball, holding a dumbbell above the chest, and lowering it behind the head before returning to the starting position.','chest','triceps, latissimus dorsi','https://v2.exercisedb.io/image/7IBVFoylQsMr4Y');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (771,'exercise ball pike push up','The exercise ball pike push up is a challenging upper body and core exercise that combines a pike movement with a push-up, performed with the shins on a stability ball. This exercise targets the pectorals while also engaging the shoulders, triceps, and core for stabilization and strength.','chest','shoulders, triceps, core','https://v2.exercisedb.io/image/2tRIE8yeIkdSvm');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (772,'isometric chest squeeze','The isometric chest squeeze is a bodyweight exercise that targets the pectoral muscles by requiring you to contract and hold tension in your chest while your arms are extended in front of you.','chest','triceps, shoulders','https://v2.exercisedb.io/image/UGHu2d0R9X0zh1');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (773,'kettlebell one arm floor press','The kettlebell one arm floor press is a unilateral chest exercise performed lying on the floor, pressing a kettlebell with one arm at a time. It targets the pectorals while also engaging the triceps and shoulders, and requires stability and control.','chest','triceps, shoulders','https://v2.exercisedb.io/image/6OmDJmdRcWDTIO');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (774,'lever incline chest press','The lever incline chest press is a machine-based exercise targeting the upper chest (pectorals), with secondary emphasis on the shoulders and triceps. It is performed on a leverage machine, providing guided movement for safety and stability.','chest','shoulders, triceps','https://v2.exercisedb.io/image/E7eKifj-AgwEpc');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (775,'lever decline chest press','The lever decline chest press is a machine-based exercise targeting the pectoral muscles, with secondary emphasis on the triceps and shoulders. It is performed on a leverage machine, providing guided movement for safety and stability.','chest','triceps, shoulders','https://v2.exercisedb.io/image/XndYFONPyfe6tP');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (776,'machine inner chest press','The machine inner chest press is a chest-focused exercise performed on a leverage machine. It targets the pectoral muscles and also works the triceps and shoulders. The machine provides stability and guided movement, making it accessible for most users.','chest','triceps, shoulders','https://v2.exercisedb.io/image/4Xva32P2GZP060');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (777,'medicine ball chest pass','The medicine ball chest pass is an explosive upper body exercise that targets the pectorals, shoulders, and triceps. It involves forcefully passing a medicine ball from the chest, often against a wall or to a partner, and catching it on the rebound.','chest','shoulders, triceps','https://v2.exercisedb.io/image/rzHj9KLFT8jr6p');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (778,'medicine ball chest push from 3 point stance','The medicine ball chest push from a 3 point stance is a dynamic exercise targeting the pectoral muscles, with additional engagement of the shoulders and triceps. It involves starting in a 3 point stance, lowering the chest towards the ground, and explosively pushing the medicine ball away from the body.','chest','shoulders, triceps','https://v2.exercisedb.io/image/7ddaV8mx7sxyTP');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (779,'medicine ball chest push multiple response','A chest-focused exercise using a medicine ball to develop pressing strength and coordination. The movement involves pushing the medicine ball away from the chest and returning it, engaging the pectorals, triceps, and shoulders.','chest','triceps, shoulders','https://v2.exercisedb.io/image/D91ITUgTyPKDzU');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (780,'medicine ball chest push single response','The medicine ball chest push single response is an exercise that targets the pectoral muscles by pushing a medicine ball away from the chest, engaging the triceps and shoulders as secondary muscles. It is performed standing and requires coordination and strength to execute the movement effectively.','chest','triceps, shoulders','https://v2.exercisedb.io/image/0ZsJK4zNGp-Djm');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (781,'plyo push up','The plyo push up is an explosive bodyweight exercise that targets the pectoral muscles and also works the triceps, shoulders, and core. It involves pushing off the ground with enough force for your hands to leave the floor, requiring power, coordination, and upper body strength.','chest','triceps, shoulders, core','https://v2.exercisedb.io/image/zm6xsRiqZjD-QF');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (782,'push up on bosu ball','A push-up variation performed with hands on a BOSU ball (flat side up), increasing instability and core engagement.','chest','triceps, shoulders, core','https://v2.exercisedb.io/image/QrAXIZ0jEEZWgt');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (783,'smith wide grip bench press','The smith wide grip bench press is a chest exercise performed on a smith machine with a wide grip to target the pectoral muscles. It also engages the triceps and shoulders as secondary muscles. The smith machine provides stability, making it accessible to those with less experience, but proper form and control are still required.','chest','triceps, shoulders','https://v2.exercisedb.io/image/rHiXsGwskVC4X8');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (784,'smith wide grip decline bench press','The smith wide grip decline bench press is a chest exercise performed on a smith machine with a wide grip, targeting the lower pectorals and also engaging the triceps and shoulders. The decline angle and wide grip emphasize the lower chest and require good control and technique.','chest','triceps, shoulders','https://v2.exercisedb.io/image/ibFYIkUbSQSdTy');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (785,'weighted drop push up','The weighted drop push up is an advanced plyometric chest exercise that involves explosive push-ups with alternating hand positions, performed with added weight for increased resistance. This movement challenges strength, power, coordination, and control, making it suitable for experienced individuals.','chest','triceps, shoulders','https://v2.exercisedb.io/image/-2M0sn8Ph8drsK');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (786,'wide hand push up','The wide hand push up is a bodyweight exercise that targets the pectoral muscles by increasing the distance between the hands, placing more emphasis on the chest compared to a standard push up. It also engages the triceps and shoulders as secondary muscles.','chest','triceps, shoulders','https://v2.exercisedb.io/image/s9--Ba0RQYnADz');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (787,'medicine ball chest push with run release','A dynamic exercise that combines a chest push with a running release and catch, targeting the pectorals while also engaging the triceps, shoulders, and core. This movement requires coordination, explosive power, and agility.','chest','triceps, shoulders, core','https://v2.exercisedb.io/image/iQQp4t3XZZ9h0v');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (788,'lever unilateral row','The lever unilateral row is a machine-based exercise targeting the upper back. It involves pulling a lever arm with one side of the body at a time, focusing on the upper back muscles while also engaging the biceps and forearms. This exercise is performed on a leverage machine, providing stability and controlled resistance.','back','biceps, forearms','https://v2.exercisedb.io/image/Yd5ML07il1TQOu');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (789,'back extension on exercise ball','The back extension on an exercise ball is a bodyweight exercise that targets the spinal erectors and helps strengthen the lower back. It also engages the glutes and hamstrings as secondary muscles. The use of a stability ball requires core engagement and balance, making it more challenging than a standard floor back extension.','back','glutes, hamstrings','https://v2.exercisedb.io/image/fq2hb9OMoh3ydL');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (790,'barbell bent arm pullover','The barbell bent arm pullover is a compound exercise that targets the lats, with secondary emphasis on the triceps and chest. It involves lying on a bench and moving a barbell in an arc over and behind the head, requiring control and strength.','back','triceps, chest','https://v2.exercisedb.io/image/xVS6DNzSJcg3V1');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (791,'barbell reverse grip incline bench row','The barbell reverse grip incline bench row targets the upper back and also engages the biceps and forearms. It is performed on an incline bench with a reverse grip on the barbell, focusing on pulling the weight towards the upper abdomen while maintaining a strong, stable posture.','back','biceps, forearms','https://v2.exercisedb.io/image/UwRonk-HGvQU7t');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (792,'cable incline bench row','The cable incline bench row is a strength exercise targeting the upper back, performed using a cable machine and an incline bench. It also engages the biceps and rear deltoids as secondary muscles.','back','biceps, rear deltoids','https://v2.exercisedb.io/image/ryEH5ERDlItNL3');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (793,'cable palm rotational row','The cable palm rotational row is a cable-based exercise targeting the upper back, with secondary emphasis on the biceps and forearms. It involves pulling a cable handle towards the body while rotating the palms, engaging the upper back muscles and improving grip strength.','back','biceps, forearms','https://v2.exercisedb.io/image/EUBqyPX-C4UQ7m');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (794,'cable rope crossover seated row','The cable rope crossover seated row is a strength exercise targeting the upper back, performed on a cable machine using rope attachments. It also engages the biceps and forearms as secondary muscles.','back','biceps, forearms','https://v2.exercisedb.io/image/GubFjiGklD5HHm');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (795,'cable rope elevated seated row','The cable rope elevated seated row is a strength exercise targeting the upper back, performed on an elevated seat using a cable machine with rope handles. It emphasizes scapular retraction and upper back engagement while also working the biceps and forearms.','back','biceps, forearms','https://v2.exercisedb.io/image/7PWWLcojpyWfg3');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (796,'cable rope extension incline bench row','The cable rope extension incline bench row targets the upper back using a cable machine and an incline bench. It requires pulling a rope attachment towards the upper chest while seated on an incline bench, emphasizing scapular retraction and upper back engagement.','back','biceps, shoulders','https://v2.exercisedb.io/image/pJEnjhZBkCTjOc');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (797,'cable rope seated row','The cable rope seated row is a strength exercise targeting the upper back, performed using a cable machine with rope attachment. It also engages the biceps and forearms as secondary muscles.','back','biceps, forearms','https://v2.exercisedb.io/image/pH1LCjsDn8Qqx3');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (798,'cable upper row','The cable upper row is a compound exercise targeting the upper back, performed using a cable machine and a straight bar. It involves pulling the bar towards the upper chest, engaging the upper back, biceps, and shoulders.','back','biceps, shoulders','https://v2.exercisedb.io/image/jhr6KGmkUQw47A');
