INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (866,'smith seated one leg calf raise','The smith seated one leg calf raise is a lower leg exercise performed on a smith machine, targeting the calf muscles by raising one heel at a time while seated.','lower legs','hamstrings','https://v2.exercisedb.io/image/ritP7WpvY3n6hF');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (867,'smith toe raise','The smith toe raise is a calf exercise performed on a Smith machine, focusing on raising the heels to strengthen the calves. It uses a raised platform to increase the range of motion and is performed with the barbell resting on the shoulders.','lower legs','ankles, shins','https://v2.exercisedb.io/image/8A5cE41H7i5K3G');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (868,'standing calves','The standing calves exercise is a bodyweight movement targeting the calf muscles. It involves raising your heels off the ground to stand on your toes, then lowering them back down, which helps build strength and endurance in the calves.','lower legs','hamstrings, glutes','https://v2.exercisedb.io/image/DDUj5e2yu7RQPN');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (869,'standing calves calf stretch','The standing calves calf stretch is a bodyweight exercise designed to stretch the calf muscles. It is performed by standing facing a wall, placing your hands on the wall, stepping one foot back, and leaning forward to stretch the calf of the back leg.','lower legs','hamstrings, glutes','https://v2.exercisedb.io/image/0QzNGcyYc0sQ4d');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (870,'bench dip on floor','The bench dip on floor is a bodyweight exercise targeting the triceps, with secondary activation of the chest and shoulders. It is performed by supporting your body on your hands at the edge of a bench or chair, lowering your body by bending your elbows, and then pressing back up.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/LBieA9gSQTko8f');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (871,'muscle-up (on vertical bar)','The muscle-up on a vertical bar is a challenging bodyweight exercise that combines a pull-up with a dip, requiring significant upper body strength, coordination, and technique. It primarily targets the lats, with secondary emphasis on the biceps, triceps, and forearms.','back','biceps, triceps, forearms','https://v2.exercisedb.io/image/k4mhJpdX778zw5');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (872,'neck side stretch','A gentle stretch targeting the side of the neck, primarily the levator scapulae, performed by tilting the head to the side while standing or sitting.','neck','trapezius, sternocleidomastoid','https://v2.exercisedb.io/image/kKudaBxd1QfgUe');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (873,'back pec stretch','The back pec stretch is a bodyweight exercise designed to stretch the lats, shoulders, and chest. It involves crossing the arms, interlocking the fingers, and raising the arms to feel a stretch across the upper back and chest.','back','shoulders, chest','https://v2.exercisedb.io/image/Ua-98S7zNf5F0w');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (874,'calf push stretch with hands against wall','The calf push stretch with hands against wall is a bodyweight exercise that targets the calves and also stretches the hamstrings. It is performed by standing facing a wall, placing your hands against it, stepping one foot back, and leaning forward to stretch the calf muscle.','lower legs','hamstrings','https://v2.exercisedb.io/image/wYXq3sThW-U-tp');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (875,'band hip lift','The band hip lift is a glute-focused exercise performed on the floor with a resistance band placed above the knees. It targets the glutes and also works the hamstrings and quadriceps. The movement involves lifting the hips off the ground while keeping the core engaged and squeezing the glutes at the top.','upper legs','hamstrings, quadriceps','https://v2.exercisedb.io/image/5ahOunbEZc1oGj');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (876,'barbell glute bridge','The barbell glute bridge is a strength exercise that targets the glutes, with secondary emphasis on the hamstrings and lower back. It involves lifting the hips off the ground while supporting a barbell across the hips, requiring core engagement and proper form to ensure safety and effectiveness.','upper legs','hamstrings, lower back','https://v2.exercisedb.io/image/n2hIsJntQU39-e');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (877,'barbell lateral lunge','The barbell lateral lunge is a lower body exercise that targets the glutes and also works the quadriceps, hamstrings, and calves. It involves stepping laterally while supporting a barbell on your upper back, requiring strength, balance, and coordination.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/GBYA-9SggTdrQC');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (878,'barbell palms down wrist curl over a bench','The barbell palms down wrist curl over a bench is an isolation exercise targeting the forearms, specifically the wrist extensors. It is performed by sitting on a bench, resting the forearms on the thighs or a bench, and curling a barbell upward using only the wrists.','lower arms','biceps, brachialis','https://v2.exercisedb.io/image/gOOgYE7ynk5YMM');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (879,'barbell palms up wrist curl over a bench','The barbell palms up wrist curl over a bench is an isolation exercise targeting the forearms, specifically the wrist flexors. It is performed by sitting on a bench, resting the forearms on the bench with wrists hanging off, and curling a barbell upwards using only the wrists.','lower arms','biceps, shoulders','https://v2.exercisedb.io/image/-DFHs1g5ghiGXB');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (880,'cable reverse one arm curl','The cable reverse one arm curl is an isolation exercise targeting the biceps and forearms, performed using a cable machine. It involves curling the handle with a reverse grip to emphasize the forearms and brachialis.','upper arms','forearms','https://v2.exercisedb.io/image/i1pElpkBqql0D5');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (881,'dumbbell one arm reverse preacher curl','The dumbbell one arm reverse preacher curl is an isolation exercise targeting the biceps, performed on a preacher bench with a single dumbbell. It emphasizes strict form and control, helping to build biceps and forearm strength.','upper arms','forearms','https://v2.exercisedb.io/image/nzZAHCf0NyZS3M');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (882,'dumbbell one arm seated neutral wrist curl','The dumbbell one arm seated neutral wrist curl is an isolation exercise targeting the forearm muscles, particularly the wrist flexors. It is performed seated, with the forearm resting on the thigh and the wrist curling a dumbbell upward.','lower arms','biceps, brachialis','https://v2.exercisedb.io/image/13RrGcmR93y9x5');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (883,'exercise ball one leg prone lower body rotation','This exercise involves lying face down on a stability ball and performing one-leg lower body rotations, targeting the glutes and engaging the core for stabilization.','upper legs','hamstrings, quadriceps, core','https://v2.exercisedb.io/image/F6g6dEWTSagqBh');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (884,'exercise ball one legged diagonal kick hamstring curl','This exercise targets the glutes and also works the hamstrings and calves. It requires balance and coordination as you perform a single-leg hamstring curl and diagonal kick on a stability ball.','upper legs','hamstrings, calves','https://v2.exercisedb.io/image/F5K24KnFHWz9Dk');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (885,'hug knees to chest','The \'hug knees to chest\' exercise is a bodyweight movement that involves squatting down and hugging your knees to your chest, targeting the glutes and also engaging the hamstrings and quadriceps.','upper legs','hamstrings, quadriceps','https://v2.exercisedb.io/image/FLXUsNg52H6eEm');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (886,'iron cross stretch','The iron cross stretch is a dynamic movement that targets the glutes and also stretches the hamstrings and quadriceps. It involves lying on your back, raising your legs, and rotating them side to side to touch the floor, promoting flexibility and mobility in the hips and lower back.','upper legs','hamstrings, quadriceps','https://v2.exercisedb.io/image/E1NtYrymDSWDuA');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (887,'kneeling jump squat','The kneeling jump squat is a dynamic lower body exercise that targets the glutes and also works the quadriceps, hamstrings, and calves. It involves starting from a kneeling position and explosively jumping into the air while holding a barbell across the upper back.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/buS2ouDdga30CG');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (888,'modified push up to lower arms','The modified push up to lower arms is a bodyweight exercise targeting the forearms, with secondary emphasis on the triceps, chest, and shoulders. It involves transitioning from a push-up position to lowering the forearms to the ground and then pressing back up.','lower arms','triceps, chest, shoulders','https://v2.exercisedb.io/image/kvFGOXkIGRCOE4');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (889,'pelvic tilt into bridge','The pelvic tilt into bridge is a bodyweight exercise that targets the glutes, while also engaging the hamstrings and core. It involves tilting the pelvis and lifting the hips off the ground to form a bridge, then lowering back down.','upper legs','hamstrings, core','https://v2.exercisedb.io/image/VpEoWb8Y7OyFY0');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (890,'reverse hyper on flat bench','The reverse hyper on flat bench is a bodyweight exercise targeting the glutes, with secondary emphasis on the hamstrings and lower back. It involves lying face down on a flat bench and lifting the legs upward, focusing on squeezing the glutes at the top of the movement.','upper legs','hamstrings, lower back','https://v2.exercisedb.io/image/9LnkORb2W6dBKE');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (891,'seated glute stretch','The seated glute stretch is a flexibility exercise targeting the gluteal muscles. It is performed seated on the ground, crossing one ankle over the opposite thigh and gently pressing down on the knee to deepen the stretch. This exercise helps improve hip mobility and relieve tension in the glutes and hamstrings.','upper legs','hamstrings','https://v2.exercisedb.io/image/CnUeCgBvVJCraC');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (892,'sled 45 degrees one leg press','The sled 45 degrees one leg press is a lower body exercise performed on a sled machine at a 45-degree angle, focusing on one leg at a time to target the glutes, quadriceps, hamstrings, and calves. It helps build unilateral leg strength and muscle balance.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/86qmTfMyovjm3m');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (893,'smith seated wrist curl','The smith seated wrist curl is an isolation exercise targeting the forearms, performed using a Smith machine. It involves curling the wrists upward while seated, with the forearms resting on the thighs.','lower arms','biceps, brachialis','https://v2.exercisedb.io/image/XGrs4l4gpDkxiU');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (894,'straight leg outer hip abductor','The straight leg outer hip abductor is a bodyweight exercise performed lying on your side, targeting the hip abductor muscles. It helps strengthen the outer thighs and hips, and also engages the glutes and hamstrings.','upper legs','glutes, hamstrings','https://v2.exercisedb.io/image/nNJpnpSF8yCYt1');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (895,'wrist circles','Wrist circles are a bodyweight exercise focused on improving mobility and flexibility in the wrists and forearms. This movement is commonly used as a warm-up or rehabilitation exercise to increase blood flow and prepare the wrists for more strenuous activities.','lower arms','hands, wrists','https://v2.exercisedb.io/image/74XIR7gPUrtUun');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (896,'wide grip pull-up','The wide grip pull-up is a bodyweight exercise targeting the latissimus dorsi (lats) with significant involvement of the biceps and forearms. It requires hanging from a pull-up bar with a grip wider than shoulder-width, pulling the chin above the bar, and lowering back down with control.','back','biceps, forearms','https://v2.exercisedb.io/image/sA7DVfzN188I04');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (897,'chest dip (on dip-pull-up cage)','The chest dip (on dip-pull-up cage) is a bodyweight exercise targeting the pectoral muscles, with secondary emphasis on the triceps and shoulders. It involves supporting your body weight on parallel bars, lowering yourself by bending your elbows, and then pushing back up.','chest','triceps, shoulders','https://v2.exercisedb.io/image/ejK6AGATnrtwdL');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (898,'assisted standing chin-up','The assisted standing chin-up is a machine-based exercise that helps users perform chin-ups with added support, making it easier to build strength in the lats, biceps, and forearms. The leverage machine reduces the amount of body weight lifted, allowing for proper form and gradual progression.','back','biceps, forearms','https://v2.exercisedb.io/image/68M4AePqV2HzC5');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (899,'assisted standing pull-up','The assisted standing pull-up is a machine-based exercise targeting the latissimus dorsi (lats) with assistance to help perform the pull-up movement. It is suitable for those building strength to perform unassisted pull-ups.','back','biceps, forearms','https://v2.exercisedb.io/image/9krbIKsOnyqpAT');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (900,'smith front squat (clean grip)','The smith front squat (clean grip) is a lower body exercise performed on a smith machine, targeting the glutes with significant involvement from the quadriceps, hamstrings, calves, and core. The clean grip requires good shoulder and wrist mobility, and the movement demands proper technique to maintain balance and safety.','upper legs','quadriceps, hamstrings, calves, core','https://v2.exercisedb.io/image/Now26gE2Qu0hgz');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (901,'smith low bar squat','The smith low bar squat is a compound lower body exercise performed on a smith machine, targeting the glutes as the primary muscle group, with secondary emphasis on the quadriceps, hamstrings, and calves. The smith machine provides stability, making it accessible for those learning squat mechanics while still offering a challenging strength workout.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/JkOkH7Xa-naYiY');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (902,'barbell low bar squat','The barbell low bar squat is a compound lower body exercise that targets the glutes, with significant involvement of the quadriceps, hamstrings, and calves. It is performed with a barbell positioned lower on the back (across the rear deltoids), requiring good technique, core stability, and hip mobility.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/7ybu4XzAzpbKr0');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (903,'barbell high bar squat','The barbell high bar squat is a compound lower body exercise that primarily targets the glutes, with significant involvement from the quadriceps, hamstrings, calves, and core. It requires placing a barbell on the upper back (traps) and performing a squat movement.','upper legs','quadriceps, hamstrings, calves, core','https://v2.exercisedb.io/image/fnf-m0VEMWPvRP');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (904,'dumbbell finger curls','Dumbbell finger curls are an isolation exercise targeting the forearms, specifically the muscles responsible for finger flexion. This exercise helps improve grip strength and forearm development.','lower arms','wrist flexors, wrist extensors','https://v2.exercisedb.io/image/MZVrKaKfm5k0qB');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (905,'kettlebell seated two arm military press','The kettlebell seated two arm military press is a shoulder exercise performed while seated, pressing two kettlebells overhead to target the deltoids, with secondary emphasis on the triceps and upper back.','shoulders','triceps, upper back','https://v2.exercisedb.io/image/NuwzF7D1f1zOD-');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (906,'lever gripless shrug v. 2','The lever gripless shrug v. 2 is performed on a leverage machine and targets the trapezius muscles. It involves elevating the shoulders while keeping the arms straight, focusing on the upper back and traps.','back','shoulders, forearms','https://v2.exercisedb.io/image/9v5IYaT4oJFSBS');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (907,'dumbbell over bench one arm reverse wrist curl','The dumbbell over bench one arm reverse wrist curl targets the forearms, specifically the extensors, and is performed by curling the wrist upwards while the forearm is supported on a bench.','lower arms','biceps, brachialis','https://v2.exercisedb.io/image/BUMLyevJjL0A7G');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (908,'lever seated dip','The lever seated dip is a machine-based exercise targeting the triceps, with secondary emphasis on the chest and shoulders. It involves pressing down on handles while seated, simulating a dip movement in a controlled environment.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/xuBfAeu8WkGkSm');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (909,'lever seated crunch','The lever seated crunch is an abdominal exercise performed on a leverage machine. It targets the abs and also engages the obliques. The movement involves crunching forward against resistance, making it a controlled and effective core strengthening exercise.','waist','obliques','https://v2.exercisedb.io/image/3WqXbCt71x1SAr');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (910,'barbell standing close grip military press','The barbell standing close grip military press is a compound strength exercise targeting the deltoids, with secondary emphasis on the triceps and upper back. It is performed by pressing a barbell overhead from shoulder height with a close grip, requiring core stability and shoulder strength.','shoulders','triceps, upper back','https://v2.exercisedb.io/image/kb0UQrYFiY8Mm9');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (911,'barbell standing wide military press','The barbell standing wide military press is a compound exercise that targets the deltoid muscles of the shoulders. It also engages the triceps and upper back as secondary muscles. The movement requires pressing a barbell overhead from shoulder height while standing, with a grip wider than shoulder-width.','shoulders','triceps, upper back','https://v2.exercisedb.io/image/KNs3lzOVjI7smI');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (912,'ez barbell seated curls','The EZ barbell seated curl is an isolation exercise targeting the biceps, performed while seated to minimize body movement and focus on the arms. It uses an EZ barbell, which is easier on the wrists than a straight bar.','upper arms','forearms','https://v2.exercisedb.io/image/xq9bCjKrR-IZsG');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (913,'dumbbell romanian deadlift','The dumbbell Romanian deadlift is a strength exercise targeting the glutes, hamstrings, and lower back. It involves hinging at the hips while holding dumbbells, emphasizing posterior chain development and hip hinge mechanics.','upper legs','hamstrings, lower back','https://v2.exercisedb.io/image/5iFFbtrdLanTBX');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (914,'walking lunge','The walking lunge is a bodyweight exercise that targets the glutes while also engaging the quadriceps, hamstrings, and calves. It involves stepping forward into a lunge and alternating legs as you walk forward, requiring balance, coordination, and lower body strength.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/ABwE8o891DQpyU');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (915,'barbell full squat (back pov)','The barbell full squat (back POV) is a compound lower body exercise that targets the glutes, quadriceps, hamstrings, calves, and core. It involves holding a barbell across the upper back and performing a deep squat, requiring strength, balance, and proper technique.','upper legs','quadriceps, hamstrings, calves, core','https://v2.exercisedb.io/image/R2LCYPwiQ3Rg4I');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (916,'barbell full squat (side pov)','The barbell full squat (side POV) is a compound lower body exercise that targets the glutes, quadriceps, and hamstrings, while also engaging the calves and core for stability. It involves lowering the body with a barbell across the upper back and then driving back up to a standing position.','upper legs','quadriceps, hamstrings, calves, core','https://v2.exercisedb.io/image/7BQR64idkPBdLB');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (917,'sled 45° leg press (side pov)','The sled 45° leg press (side pov) is a compound lower body exercise performed on a sled machine. It primarily targets the glutes and also works the quadriceps, hamstrings, and calves. The movement involves pressing a weighted footplate away from the body by extending the legs, then returning to the starting position by bending the knees.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/N60Ox0gdRYTPtR');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (918,'sled 45° leg press (back pov)','The sled 45° leg press (back POV) is a compound lower body exercise performed on a sled machine. It primarily targets the glutes, with secondary emphasis on the quadriceps, hamstrings, and calves. The movement involves extending and flexing the legs to press a weighted footplate away from and toward the body.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/zWBAmVjUjjyGJB');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (919,'twist hip lift','The twist hip lift is a bodyweight exercise targeting the glutes, with additional engagement of the obliques and hamstrings. It involves lifting the hips off the ground and twisting the lower body side to side, challenging core stability and hip strength.','upper legs','obliques, hamstrings','https://v2.exercisedb.io/image/frkdbPYY0TjlcH');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (920,'push-up on lower arms','The push-up on lower arms is a bodyweight exercise targeting the triceps, performed from a plank position on the forearms. It also engages the chest and shoulders.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/hTU2gHM6NxxdI1');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (921,'crab twist toe touch','The crab twist toe touch is a bodyweight exercise targeting the abdominal muscles, with additional engagement of the obliques and hip flexors. It involves a dynamic movement pattern that requires coordination and balance, as you alternate reaching your hand to the opposite foot while supporting your body in a crab position.','waist','obliques, hip flexors','https://v2.exercisedb.io/image/7rxoKTFuC2yhCk');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (922,'inchworm','The inchworm is a bodyweight exercise that targets the abs while also engaging the shoulders and hamstrings. It involves bending forward, walking your hands out to a plank, and then returning to standing, which challenges core stability, flexibility, and coordination.','waist','shoulders, hamstrings','https://v2.exercisedb.io/image/vcBqQZeeGOslYt');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (923,'forward jump','The forward jump is a plyometric exercise that targets the quadriceps and also works the calves, hamstrings, and glutes. It involves jumping forward explosively from a squat position and landing softly, then repeating the movement.','upper legs','calves, hamstrings, glutes','https://v2.exercisedb.io/image/MkjN7zXQmSyl0y');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (924,'backward jump','The backward jump is a plyometric exercise that targets the quadriceps while also engaging the hamstrings, glutes, and calves. It involves jumping backward from a standing position, requiring coordination, balance, and explosive power.','upper legs','hamstrings, glutes, calves','https://v2.exercisedb.io/image/Ti6RU5uH5l5daO');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (925,'one leg squat','The one leg squat, also known as a pistol squat, is a challenging lower body exercise that targets the glutes while also engaging the quadriceps, hamstrings, and calves. It requires significant balance, strength, and coordination, as you lower your body on one leg while keeping the other leg extended off the ground.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/ZAdcr4zOMhokPz');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (926,'lever incline chest press v. 2','The lever incline chest press v. 2 is a machine-based exercise that targets the pectoral muscles, with secondary emphasis on the triceps and shoulders. It involves pressing handles away from the body while seated on a leverage machine, simulating an incline bench press motion.','chest','triceps, shoulders','https://v2.exercisedb.io/image/OotwAzzPXETzNP');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (927,'sissy squat','The sissy squat is a challenging bodyweight exercise that targets the quadriceps by requiring a deep knee bend and significant balance, often performed with minimal support. It emphasizes quad strength and control, while also engaging the calves and glutes.','upper legs','calves, glutes','https://v2.exercisedb.io/image/AOztfeTSIw5PB6');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (928,'standing calf raise (on a staircase)','The standing calf raise (on a staircase) is a bodyweight exercise that targets the calves by raising and lowering the heels while standing on the edge of a step. It also engages the ankles and feet for stabilization.','lower legs','ankles, feet','https://v2.exercisedb.io/image/MpKHePT-ZqStWK');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (929,'butterfly yoga pose','The butterfly yoga pose is a seated stretch that targets the adductors and inner thighs. It is commonly used to improve flexibility and mobility in the hips and groin area.','upper legs','hamstrings, groin','https://v2.exercisedb.io/image/z9I4DvMwbxZmhf');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (930,'oblique crunch v. 2','The oblique crunch v. 2 is a bodyweight exercise targeting the abdominal muscles, with a focus on the obliques. It involves a rotational crunch movement to engage the side muscles of the core.','waist','obliques','https://v2.exercisedb.io/image/znFkgbbH--GpdA');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (931,'sledge hammer','The sledge hammer exercise involves swinging a sledge hammer down towards the ground, engaging the core, forearms, and shoulders. It requires coordination, strength, and proper technique to perform safely.','waist','forearms, shoulders','https://v2.exercisedb.io/image/8Xa6nbUkeZ7743');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (932,'hamstring stretch','The hamstring stretch is a bodyweight exercise targeting the hamstrings and also engaging the glutes. It involves stepping forward, bending at the hips, and reaching toward the foot to stretch the back of the thigh.','upper legs','glutes','https://v2.exercisedb.io/image/6RU2UN9cITgsty');
