INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1002,'dumbbell one arm standing hammer curl','The dumbbell one arm standing hammer curl is an isolation exercise targeting the biceps and forearms. It is performed standing, with a dumbbell in one hand, curling the weight up while keeping the palm facing the torso throughout the movement.','upper arms','forearms','https://v2.exercisedb.io/image/cNKi72iZttP09Z');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1003,'dumbbell one arm zottman preacher curl','The dumbbell one arm Zottman preacher curl is an isolation exercise targeting the biceps and forearms, performed on a preacher bench with a dumbbell, emphasizing both the curl and rotational movement for forearm engagement.','upper arms','forearms','https://v2.exercisedb.io/image/w4Y-VDRVMz-l2s');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1004,'dumbbell preacher curl over exercise ball','The dumbbell preacher curl over exercise ball targets the biceps by isolating the muscle with the support of an exercise ball, requiring stability and control. It also engages the forearms as secondary muscles.','upper arms','forearms','https://v2.exercisedb.io/image/SwMNgsj9uJVhBD');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1005,'dumbbell prone incline hammer curl','The dumbbell prone incline hammer curl is an isolation exercise targeting the biceps and forearms. It is performed lying face down on an incline bench, which helps minimize momentum and focus the work on the biceps.','upper arms','forearms','https://v2.exercisedb.io/image/F69ftqWC34dtNH');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1006,'dumbbell reverse spider curl','The dumbbell reverse spider curl is an isolation exercise targeting the biceps and forearms. It is performed standing with dumbbells, focusing on curling the weights with palms facing the body, which emphasizes the brachialis and forearm muscles.','upper arms','forearms','https://v2.exercisedb.io/image/T8J-TltLixakW9');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1007,'dumbbell seated alternate hammer curl on exercise ball','The dumbbell seated alternate hammer curl on an exercise ball is a biceps-focused exercise that also engages the forearms and core due to the instability of the exercise ball. It involves curling dumbbells alternately while seated on an exercise ball, which requires additional balance and coordination.','upper arms','forearms','https://v2.exercisedb.io/image/-qHXSnFHfX0P8l');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1008,'dumbbell seated bicep curl','The dumbbell seated bicep curl is a strength exercise targeting the biceps, performed while seated to minimize body movement and focus on arm muscle engagement.','upper arms','forearms','https://v2.exercisedb.io/image/jke4KujLzyrmVO');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1009,'dumbbell seated hammer curl','The dumbbell seated hammer curl is an isolation exercise targeting the biceps and forearms. It is performed while seated, using a neutral grip (palms facing in) to emphasize the brachialis and brachioradialis muscles.','upper arms','forearms','https://v2.exercisedb.io/image/PjJXBU2y1HBCA6');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1010,'dumbbell seated one arm bicep curl on exercise ball with leg raised','This exercise involves performing a seated one-arm bicep curl on an exercise ball while raising one leg, increasing the challenge to balance and core stability in addition to targeting the biceps.','upper arms','forearms, shoulders','https://v2.exercisedb.io/image/p8LTkFrbMnwM6m');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1011,'dumbbell standing one arm curl over incline bench','The dumbbell standing one arm curl over incline bench is an isolation exercise targeting the biceps, with additional engagement of the forearms. It requires the use of an incline bench for support and a dumbbell for resistance. The movement emphasizes strict form and control, making it effective for building biceps strength and size.','upper arms','forearms','https://v2.exercisedb.io/image/ZM0RwkthT8Cq0L');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1012,'ez bar seated close grip concentration curl','The EZ bar seated close grip concentration curl is an isolation exercise targeting the biceps, performed while seated with the elbow braced against the thigh for stability. It uses an EZ barbell and emphasizes strict form to maximize biceps engagement.','upper arms','forearms','https://v2.exercisedb.io/image/ohxjYO6Fv6JPqu');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1013,'smith machine bicep curl','The smith machine bicep curl is a strength exercise targeting the biceps, performed using a smith machine for guided movement. It is suitable for those looking to build arm strength and muscle mass with added stability from the machine.','upper arms','forearms','https://v2.exercisedb.io/image/gLpYD2sgAaG9U8');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1014,'dumbbell step up single leg balance with bicep curl','A compound exercise combining a step-up with single-leg balance and a bicep curl, targeting the biceps and engaging the lower body and core for stability.','upper arms','quadriceps, glutes, hamstrings','https://v2.exercisedb.io/image/M34E2RYdTrbXME');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1015,'squat to overhead reach','The squat to overhead reach is a bodyweight exercise that combines a traditional squat with an overhead arm extension. It targets the quadriceps while also engaging the glutes, hamstrings, and core. This movement helps improve lower body strength, mobility, and coordination.','upper legs','glutes, hamstrings, core','https://v2.exercisedb.io/image/LbTkxtvPKPgwFM');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1016,'squat to overhead reach with twist','The squat to overhead reach with twist is a dynamic bodyweight exercise that combines a traditional squat with an overhead reach and torso twist, targeting the quads, glutes, hamstrings, and core. It enhances lower body strength, core stability, and rotational mobility.','upper legs','glutes, hamstrings, core','https://v2.exercisedb.io/image/svGIowuKKg2O6c');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1017,'posterior step to overhead reach','The posterior step to overhead reach is a dynamic bodyweight exercise that targets the abs while also engaging the glutes, hamstrings, quadriceps, and shoulders. It involves stepping back into a lunge and reaching overhead, promoting core stability, lower body strength, and shoulder mobility.','waist','glutes, hamstrings, quadriceps, shoulders','https://v2.exercisedb.io/image/-WWml0w1A1PbuQ');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1018,'lunge with twist','The lunge with twist is a dynamic exercise that combines a forward lunge with a torso rotation, targeting the abdominal muscles while also engaging the quadriceps, glutes, and hamstrings. This movement enhances core stability, balance, and lower body strength.','waist','quadriceps, glutes, hamstrings','https://v2.exercisedb.io/image/M0NvPSwu3k0gdy');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1019,'push and pull bodyweight','The push and pull bodyweight exercise is a variation of the push-up that emphasizes both the pushing and pulling phases of the movement, targeting the pectorals, triceps, and deltoids.','chest','triceps, deltoids','https://v2.exercisedb.io/image/H1aTqaLYF--bFY');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1020,'dumbbell push press','The dumbbell push press is a compound exercise that targets the deltoids (shoulders) and also engages the triceps and core. It involves a slight dip and drive from the legs to help press the dumbbells overhead, making it a dynamic movement that combines strength and power.','shoulders','triceps, core','https://v2.exercisedb.io/image/krSqWMzCWDk8Uj');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1021,'medicine ball close grip push up','A push-up variation performed with hands close together on a medicine ball, targeting the triceps and engaging the chest and shoulders.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/YTZ78PcvCzllU8');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1022,'squat on bosu ball','The squat on a BOSU ball is a lower body exercise that targets the quadriceps while also engaging the glutes, hamstrings, and calves. The unstable surface of the BOSU ball increases the challenge to balance and core stability, making the movement more demanding than a standard squat.','upper legs','glutes, hamstrings, calves','https://v2.exercisedb.io/image/8m2w3ZiWzQKtIr');
