INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1024,'assisted lying calves stretch','The assisted lying calves stretch is a flexibility exercise targeting the calves, performed lying on your back and using your hands or a towel to gently pull your toes toward your body.','lower legs','hamstrings','https://v2.exercisedb.io/image/dgY0qJwYFY6BQa');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1025,'assisted lying glutes stretch','The assisted lying glutes stretch is a flexibility exercise targeting the gluteal muscles. It is performed lying on your back, crossing one ankle over the opposite thigh, and gently pulling the thigh towards your chest to stretch the glutes and hamstrings.','upper legs','hamstrings','https://v2.exercisedb.io/image/50cyUvyzkXnX32');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1026,'assisted lying gluteus and piriformis stretch','The assisted lying gluteus and piriformis stretch is a flexibility exercise targeting the glutes and piriformis muscles. It is performed lying on your back, crossing one ankle over the opposite thigh, and gently pulling the thigh towards your chest to stretch the glutes and piriformis.','upper legs','hamstrings','https://v2.exercisedb.io/image/pFDu8ZKQaQX74L');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1027,'assisted side lying adductor stretch','The assisted side lying adductor stretch is a flexibility exercise targeting the inner thigh muscles (adductors), performed while lying on your side and using a bench or step for assistance.','upper legs','hamstrings, glutes','https://v2.exercisedb.io/image/Jj8VOOFC4TJm9v');
