INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1031,'cable squat row (with rope attachment)','The cable squat row (with rope attachment) is a compound exercise that combines a squat with a rowing motion, targeting the lats and engaging the biceps, rhomboids, and rear deltoids. It requires coordination, core stability, and strength.','back','biceps, rhomboids, rear deltoids','https://v2.exercisedb.io/image/5usmaikjKE1sAW');
