INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1035,'barbell reverse grip skullcrusher','The barbell reverse grip skullcrusher is a triceps-focused exercise performed lying on a bench, using a barbell held with a reverse (underhand) grip. It targets the triceps and also engages the forearms as secondary muscles. The movement requires control and proper form to avoid injury, especially to the elbows and wrists.','upper arms','forearms','https://v2.exercisedb.io/image/gfmHZhURkJYHcp');
