INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1038,'cable rope high pulley overhead tricep extension','The cable rope high pulley overhead tricep extension is an isolation exercise targeting the triceps, performed using a cable machine with a rope attachment. It emphasizes triceps development and also engages the shoulders for stability.','upper arms','shoulders','https://v2.exercisedb.io/image/ameVUsvk0d29vR');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1039,'cable rope incline tricep extension','The cable rope incline tricep extension is an isolation exercise targeting the triceps, performed on an incline bench using a rope attachment on a cable machine. It emphasizes triceps development and also engages the shoulders as secondary muscles.','upper arms','shoulders','https://v2.exercisedb.io/image/wfUkzrYpNlEJUA');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1040,'cable rope lying on floor tricep extension','The cable rope lying on floor tricep extension is an isolation exercise targeting the triceps, performed lying on the floor with a cable machine. It requires proper form to avoid strain on the elbows and shoulders.','upper arms','shoulders','https://v2.exercisedb.io/image/ANIbq2iWVf0J0M');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1041,'cable standing reverse grip one arm overhead tricep extension','The cable standing reverse grip one arm overhead tricep extension targets the triceps using a cable machine. It requires you to stand facing away from the machine, extend your arm overhead with an underhand grip, and perform an extension movement to work the triceps.','upper arms','shoulders','https://v2.exercisedb.io/image/vtFy6oFRCNX2SH');
