INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1048,'dumbbell kickbacks on exercise ball','A triceps isolation exercise performed while seated on an exercise ball, which adds an element of balance and core engagement. The movement targets the triceps with secondary involvement from the shoulders and back.','upper arms','shoulders, back','https://v2.exercisedb.io/image/vPnVhvM9RX8nGk');
