INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1056,'dumbbell tricep kickback with stork stance','The dumbbell tricep kickback with stork stance is a variation of the traditional tricep kickback that incorporates a balance challenge by having the exerciser stand on one leg (stork stance) while performing the movement. This targets the triceps while also engaging the core and stabilizing muscles.','upper arms','shoulders','https://v2.exercisedb.io/image/8tRg1n-YKOA7BQ');
