INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1058,'exercise ball dip','The exercise ball dip is a triceps-focused movement performed using a stability ball. It challenges the triceps, chest, and shoulders while also requiring balance and core engagement due to the unstable surface.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/gXtBvI0UgcJuY5');
