INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1061,'ez bar french press on exercise ball','The EZ bar French press on an exercise ball is a triceps-focused exercise performed while seated on an unstable surface, which also engages the core and shoulders for stabilization. It involves lowering an EZ barbell behind the head and pressing it back up, targeting the triceps.','upper arms','shoulders','https://v2.exercisedb.io/image/eJtDYNrY-L2Djg');
