INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1067,'three bench dip','The three bench dip is a bodyweight exercise targeting the triceps, performed using three benches to elevate the feet and hands, increasing the range of motion and difficulty compared to standard dips.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/f6iPcGgBPvOU7Y');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1068,'weighted three bench dips','The weighted three bench dips is a triceps-focused exercise that involves supporting your body weight between three benches while adding extra resistance. It targets the triceps and also works the chest and shoulders. This movement requires significant upper body strength, stability, and proper form to avoid injury.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/ZLGOYm4SKJiwsC');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1069,'weighted tricep dips','Weighted tricep dips are a challenging upper body exercise that primarily targets the triceps, with additional activation of the chest and shoulders. Adding weight increases the intensity and requires greater strength and stability compared to bodyweight dips.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/F6qet5mezH5V93');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1070,'barbell single leg deadlift','The barbell single leg deadlift is a unilateral lower body exercise that targets the glutes, with secondary emphasis on the hamstrings and lower back. It challenges balance, coordination, and strength by requiring you to hinge at the hips on one leg while holding a barbell.','upper legs','hamstrings, lower back','https://v2.exercisedb.io/image/PekCaJZW2Lnfz0');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1071,'dumbbell single leg deadlift','The dumbbell single leg deadlift is a unilateral lower body exercise that targets the glutes, hamstrings, and lower back. It challenges balance, coordination, and strength by requiring you to stabilize on one leg while hinging at the hips and lifting a dumbbell.','upper legs','hamstrings, lower back','https://v2.exercisedb.io/image/Y946dHINAU5XMn');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1072,'assisted sit-up','The assisted sit-up is a core exercise that targets the abdominal muscles with support, making it easier to perform than a standard sit-up. Assistance can come from a bench, partner, or anchored feet, reducing the strength and coordination required.','waist','hip flexors','https://v2.exercisedb.io/image/Aa0tDfKGmhbdn8');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1073,'single leg squat (pistol) male','The single leg squat (pistol squat) is a challenging lower body exercise that targets the glutes, quadriceps, hamstrings, and calves. It requires significant strength, balance, and mobility to perform correctly, making it suitable for advanced practitioners.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/3RU9yeqGsk8xp-');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1074,'dumbbell goblet squat','The dumbbell goblet squat is a lower body exercise that targets the quadriceps while also engaging the glutes, hamstrings, and calves. It is performed by holding a dumbbell close to the chest and squatting down, making it a great movement for building strength and improving squat technique.','upper legs','glutes, hamstrings, calves','https://v2.exercisedb.io/image/Hea89fe1zfoHtK');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1075,'hanging oblique knee raise','The hanging oblique knee raise is a core exercise performed by hanging from a pull-up bar and raising the knees towards the chest while twisting the torso to target the abs and obliques.','waist','obliques','https://v2.exercisedb.io/image/DuXKpz9ZH4R18F');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1076,'shoulder grip pull-up','The shoulder grip pull-up is a bodyweight exercise targeting the latissimus dorsi (lats) and also engaging the biceps and forearms. It requires the individual to pull their body up to a bar using a shoulder-width, overhand grip.','back','biceps, forearms','https://v2.exercisedb.io/image/b4zDaddzwQO413');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1077,'hanging leg hip raise','The hanging leg hip raise is a bodyweight exercise that targets the abdominal muscles by requiring you to hang from a pull-up bar and lift your legs, engaging your core and hip flexors.','waist','hip flexors, lower back','https://v2.exercisedb.io/image/JHAH4rJJ5nFSxl');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1078,'dumbbell upright row (back pov)','The dumbbell upright row (back pov) is a strength exercise targeting the deltoids, with secondary emphasis on the traps and biceps. It involves lifting dumbbells from thigh level to shoulder height, leading with the elbows.','shoulders','traps, biceps','https://v2.exercisedb.io/image/6JVjVCcxRF1RP0');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1079,'self assisted inverse leg curl','The self assisted inverse leg curl is a bodyweight exercise targeting the hamstrings, performed by lying face down and curling the legs upward against gravity, often using the arms for assistance. It primarily works the hamstrings, with secondary emphasis on the glutes and calves.','upper legs','glutes, calves','https://v2.exercisedb.io/image/f7nmWbVPwHtMJu');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1080,'weighted triceps dip on high parallel bars','The weighted triceps dip on high parallel bars is an advanced upper body exercise that primarily targets the triceps, while also engaging the chest and shoulders. The addition of weight increases the strength and stability demands, making it suitable for experienced lifters.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/Jxdfdk5oKNNgAF');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1081,'bodyweight side lying biceps curl','The bodyweight side lying biceps curl is a biceps-focused exercise performed lying on your side, using only your body weight for resistance. It primarily targets the biceps and also engages the forearms.','upper arms','forearms','https://v2.exercisedb.io/image/cbs3AFHPAqsZSY');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1082,'biceps leg concentration curl','The biceps leg concentration curl is an isolation exercise targeting the biceps, performed while seated and using the leg for support. It emphasizes strict form and muscle contraction.','upper arms','forearms','https://v2.exercisedb.io/image/qLbQSPL9oq4STV');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1083,'bodyweight kneeling triceps extension','The bodyweight kneeling triceps extension is a bodyweight exercise that targets the triceps, with secondary emphasis on the shoulders and chest. It involves lowering your body by bending the elbows while keeping the core engaged and then pressing back up to the starting position.','upper arms','shoulders, chest','https://v2.exercisedb.io/image/nR4JRI-mBPPcpM');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1084,'elbow lift - reverse push-up','The elbow lift - reverse push-up is a bodyweight exercise that targets the upper back, with secondary emphasis on the triceps and shoulders. It involves lifting the upper body off the ground while keeping the elbows close to the sides, focusing on squeezing the upper back muscles.','back','triceps, shoulders','https://v2.exercisedb.io/image/kvY-gX9DzChVGQ');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1085,'one arm towel row','The one arm towel row is a bodyweight exercise targeting the upper back, performed by pulling a towel with one arm while maintaining a strong core and straight back.','back','biceps, forearms','https://v2.exercisedb.io/image/wfUaHT4XEbp7kS');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1086,'side bridge hip abduction','The side bridge hip abduction is a bodyweight exercise that targets the hip abductors, glutes, and obliques. It involves holding a side plank position while lifting the top leg, challenging both strength and stability.','upper legs','glutes, obliques','https://v2.exercisedb.io/image/xX1Rw7IqKegeXP');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1087,'side plank hip adduction','The side plank hip adduction is a bodyweight exercise that targets the adductors while also engaging the obliques and glutes. It requires maintaining a side plank position while lifting the top leg, challenging both strength and balance.','upper legs','obliques, glutes','https://v2.exercisedb.io/image/euBV7--OMRlMws');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1088,'farmers walk','The farmer\'s walk is a functional strength exercise where you walk while holding a dumbbell in each hand, engaging the quads, calves, forearms, and core. It improves grip strength, core stability, and overall conditioning.','upper legs','calves, forearms, core','https://v2.exercisedb.io/image/cfUolVq77b6HWy');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1089,'weighted front plank','The weighted front plank is a core stability exercise that increases the challenge of the traditional plank by adding external weight, requiring greater strength and endurance from the abdominal muscles, shoulders, and lower back.','waist','shoulders, lower back','https://v2.exercisedb.io/image/f3viDve-khtqP2');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1090,'dumbbell cuban press v. 2','The dumbbell Cuban press v. 2 is a shoulder exercise that targets the deltoids while also engaging the triceps and upper back. It involves a combination of pressing and rotational movement, making it effective for building strength and stability in the shoulder joint.','shoulders','triceps, upper back','https://v2.exercisedb.io/image/OLWgopPCMMFgFg');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1091,'dumbbell arnold press','The dumbbell Arnold press is a shoulder exercise that targets the deltoids while also engaging the triceps and upper chest. It involves a rotational movement as you press the dumbbells overhead, increasing the range of motion and muscle activation compared to a standard shoulder press.','shoulders','triceps, upper chest','https://v2.exercisedb.io/image/l9XTGPbM8iK1-c');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1092,'stationary bike run v. 3','The stationary bike run v. 3 is a cardiovascular exercise performed on a stationary bike. It primarily targets the cardiovascular system and also engages the quadriceps, hamstrings, and calves. The exercise involves pedaling at a steady rhythm, adjusting resistance as needed, and maintaining proper posture throughout the workout.','cardio','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/C0L8A9kMjkKgD2');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1093,'hands bike','The hands bike (upper body ergometer) is a cardiovascular exercise that targets the pectorals, triceps, and shoulders by requiring the user to pedal with their hands, simulating a cycling motion for the upper body.','chest','triceps, shoulders','https://v2.exercisedb.io/image/b4QKuUfnrIx-wz');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1094,'walk elliptical cross trainer','The walk elliptical cross trainer is a cardiovascular exercise performed on an elliptical machine. It simulates a walking or running motion with low impact on the joints, making it suitable for a wide range of fitness levels. The exercise targets the cardiovascular system while also engaging the quadriceps, hamstrings, glutes, and calves.','cardio','quadriceps, hamstrings, glutes, calves','https://v2.exercisedb.io/image/CQFYJ1dkD391ei');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1095,'ski ergometer','The ski ergometer exercise targets the triceps and simulates the motion of cross-country skiing using a skierg machine. It also engages the shoulders and forearms, providing a cardiovascular and strength workout.','upper arms','shoulders, forearms','https://v2.exercisedb.io/image/Wk6z1oV7upURm9');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1096,'dumbbell standing around world','The dumbbell standing around world is a shoulder exercise that involves moving dumbbells in a circular motion around the body, targeting the deltoids and engaging the triceps and forearms.','shoulders','triceps, forearms','https://v2.exercisedb.io/image/0Hen3ubbYJWd1A');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1097,'cable seated chest press','The cable seated chest press is a resistance exercise targeting the pectoral muscles using a cable machine. It also engages the shoulders and triceps as secondary muscles. The movement is performed while seated, pressing the cable handles forward and then returning to the starting position.','chest','shoulders, triceps','https://v2.exercisedb.io/image/RgKkRpyFLt-N1m');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1098,'ez barbell decline triceps extension','The EZ barbell decline triceps extension is an isolation exercise targeting the triceps, performed on a decline bench using an EZ bar. It requires good control and technique to avoid injury, especially to the elbows and shoulders.','upper arms','shoulders','https://v2.exercisedb.io/image/erOndOKF3RxIux');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1099,'barbell reverse close-grip bench press','The barbell reverse close-grip bench press is a compound exercise that targets the triceps, with secondary emphasis on the chest and shoulders. It involves lying on a bench and pressing a barbell with a reverse (underhand) grip, which shifts more focus to the triceps compared to a traditional bench press.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/M0IgAxIViT7ujA');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1100,'dumbbell seated triceps extension','The dumbbell seated triceps extension is an isolation exercise that targets the triceps, performed while seated and using a dumbbell held with both hands overhead.','upper arms','shoulders','https://v2.exercisedb.io/image/Rt8kPrnRWF9AOh');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1101,'dumbbells seated triceps extension','The dumbbells seated triceps extension is an isolation exercise targeting the triceps, performed while seated with a dumbbell held overhead. It is effective for building triceps strength and size.','upper arms','shoulders','https://v2.exercisedb.io/image/K0MN-fHQYFpJPw');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1102,'roller hip stretch','The roller hip stretch is a flexibility and mobility exercise that targets the glutes and also stretches the hamstrings and quadriceps. It uses a foam roller to help release tension and improve range of motion in the hip area.','upper legs','hamstrings, quadriceps','https://v2.exercisedb.io/image/-8IO8rpOk0Y9CA');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1103,'roller seated shoulder flexor depresor retractor','The roller seated shoulder flexor depresor retractor is an exercise that targets the pectorals while also engaging the deltoids and triceps. It involves sitting with legs extended, holding a roller, and performing a controlled rolling motion to extend and retract the arms.','chest','deltoids, triceps','https://v2.exercisedb.io/image/aJCeaNS-14eILC');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1104,'roller body saw','The roller body saw is a challenging core exercise that involves using a roller to extend and retract your body while maintaining a plank position. This movement targets the abs and also engages the shoulders, triceps, and overall core stability.','waist','shoulders, triceps, core','https://v2.exercisedb.io/image/3sEy03fzwijInn');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1105,'roller hip lat stretch','The roller hip lat stretch is a flexibility exercise that targets the glutes and also stretches the hamstrings and quadriceps. It uses a roller for support and to enhance the stretch, making it accessible for most people with basic mobility and balance.','upper legs','hamstrings, quadriceps','https://v2.exercisedb.io/image/uliHoYwm39Pen7');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1106,'roller reverse crunch','The roller reverse crunch is an abdominal exercise that uses a roller held between the feet to increase resistance and challenge core stability. It targets the abs and also engages the hip flexors.','waist','hip flexors','https://v2.exercisedb.io/image/KrZDz634XSYDZX');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1107,'roller side lat stretch','The roller side lat stretch is a flexibility exercise targeting the latissimus dorsi, using a roller to assist in deepening the stretch. It also engages the shoulders and triceps as secondary muscles. This movement is performed by hinging at the hips and rolling the roller forward to stretch the lats.','back','shoulders, triceps','https://v2.exercisedb.io/image/UbtzbsrNh55cYw');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1108,'roller back stretch','The roller back stretch is a mobility exercise that uses a foam roller to gently mobilize and stretch the spine, with secondary benefits for the hamstrings and glutes. It is performed by rolling the back over a foam roller from the lower to upper back.','back','hamstrings, glutes','https://v2.exercisedb.io/image/Ln5262A8gVwgM7');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1109,'roller seated single leg shoulder flexor depresor retractor','This exercise targets the pectoral muscles while also engaging the deltoids and triceps. It involves sitting with legs extended, holding a roller, and performing a controlled shoulder flexion movement.','chest','deltoids, triceps','https://v2.exercisedb.io/image/FXP6jEAVMf3sfi');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1110,'left hook (boxing)','The left hook in boxing is a bodyweight exercise that targets the deltoids and involves a rotational punching motion. It also engages the biceps, triceps, and forearms, and requires coordination, balance, and core engagement.','shoulders','biceps, triceps, forearms','https://v2.exercisedb.io/image/kDAHPbv-NsTYSI');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1111,'lever pullover','The lever pullover is a machine-based exercise targeting the latissimus dorsi (lats) and also engaging the triceps and shoulders. It is performed by sitting on a leverage machine, grasping the handles, and pulling them towards the chest in a controlled motion.','back','triceps, shoulders','https://v2.exercisedb.io/image/hVU3B7zNIpzILa');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1112,'lever hip extension v. 2','The lever hip extension v. 2 is a machine-based exercise that targets the glutes and also works the hamstrings. It involves extending the hips against resistance provided by a leverage machine, making it a controlled and isolated movement for the posterior chain.','upper legs','hamstrings','https://v2.exercisedb.io/image/D2feHPgOeWIj7k');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1113,'lever alternate leg press','The lever alternate leg press is a machine-based exercise targeting the quadriceps, with secondary emphasis on the hamstrings and glutes. It involves pressing one leg at a time against a foot platform, providing a controlled environment for building lower body strength.','upper legs','hamstrings, glutes','https://v2.exercisedb.io/image/5W6Zg6amnqTfCs');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1114,'lever gripper hands','The lever gripper hands exercise targets the forearms using a leverage machine. It involves gripping and squeezing the handles to strengthen the forearm muscles, with secondary activation of the biceps and triceps.','lower arms','biceps, triceps','https://v2.exercisedb.io/image/qTMxw52A6kiK5T');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1115,'lever calf press','The lever calf press is a machine-based exercise targeting the calf muscles. It involves pressing a lever pad with the toes while the heels hang off the edge, focusing on ankle extension to contract the calves. The movement is controlled and supported by the machine, making it accessible for most users.','lower legs','hamstrings','https://v2.exercisedb.io/image/dcrLyR4eEZfrHD');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1116,'dumbbell rear delt raise','The dumbbell rear delt raise is an isolation exercise targeting the rear deltoids, with secondary emphasis on the trapezius and rhomboids. It is performed by hinging at the hips and raising dumbbells out to the sides, focusing on shoulder movement.','shoulders','trapezius, rhomboids','https://v2.exercisedb.io/image/8bKI-VIsi3bk-n');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1117,'dumbbell standing zottman preacher curl','The dumbbell standing Zottman preacher curl is a biceps-focused exercise that also targets the forearms. It combines the preacher curl with a wrist rotation at the top of the movement to emphasize both the biceps and forearm muscles.','upper arms','forearms','https://v2.exercisedb.io/image/jXcGFxIVDCf7RP');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1118,'dumbbell zottman preacher curl','The dumbbell Zottman preacher curl is an isolation exercise that targets the biceps and forearms. It combines a standard preacher curl with a wrist rotation at the top, emphasizing both the biceps during the curl and the forearms during the lowering phase.','upper arms','forearms','https://v2.exercisedb.io/image/8mlKlYFa3ZcbUv');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1119,'stability ball crunch (full range hands behind head)','The stability ball crunch (full range hands behind head) is an abdominal exercise performed on a stability ball, targeting the abs and engaging the hip flexors as secondary muscles. The movement requires core engagement and balance to execute the crunch through a full range of motion while maintaining stability on the ball.','waist','hip flexors','https://v2.exercisedb.io/image/aSote0PJTJUtsY');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1120,'inverted row on bench','The inverted row on bench is a bodyweight exercise targeting the upper back, performed by pulling your chest up towards a bench while lying underneath it.','back','biceps, forearms','https://v2.exercisedb.io/image/B8I4yBtybAGXDa');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1121,'inverted row bent knees','The inverted row with bent knees is a bodyweight exercise targeting the upper back. It involves pulling your chest towards a bar while keeping your body straight and your knees bent, making it more accessible than the straight-leg version.','back','biceps, forearms','https://v2.exercisedb.io/image/Q5zX6zelUcYs8a');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1122,'walking on stepmill','Walking on a stepmill is a cardiovascular exercise performed on a machine that simulates stair climbing. It primarily targets the cardiovascular system while also engaging the lower body muscles.','cardio','quadriceps, hamstrings, glutes, calves','https://v2.exercisedb.io/image/5ZCngNhLusTvIN');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1123,'lying elbow to knee','The lying elbow to knee is a bodyweight abdominal exercise that targets the abs, with secondary emphasis on the hip flexors and lower back. It involves alternating elbow-to-knee movements while lying on your back, engaging the core and promoting coordination.','waist','hip flexors, lower back','https://v2.exercisedb.io/image/CLDcJZsDVugu3K');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1124,'lever rotary calf','The lever rotary calf exercise targets the calves using a leverage machine. It involves raising and lowering the heels while seated, focusing on the calf muscles and ankle stabilizers.','lower legs','soleus, ankle stabilizers','https://v2.exercisedb.io/image/cdbwUbVFqtb5gg');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1125,'dumbbell seated bent arm lateral raise','The dumbbell seated bent arm lateral raise targets the deltoid muscles in the shoulders, with secondary emphasis on the trapezius and rhomboids. It is performed while seated, which helps stabilize the body and focus the effort on the shoulders.','shoulders','trapezius, rhomboids','https://v2.exercisedb.io/image/DCNlIJRWSBySys');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1126,'lever shoulder press v. 3','The lever shoulder press v. 3 is a machine-based exercise targeting the deltoid muscles of the shoulders. It also engages the triceps and chest as secondary muscles. The movement involves pressing handles upward and forward while seated, providing a stable and controlled environment for developing shoulder strength.','shoulders','triceps, chest','https://v2.exercisedb.io/image/xPFcOpFEoIiYTA');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1127,'dumbbell standing inner biceps curl v. 2','The dumbbell standing inner biceps curl v. 2 is a strength exercise that targets the biceps, with secondary emphasis on the forearms. It involves curling dumbbells while standing, focusing on strict form and biceps contraction.','upper arms','forearms','https://v2.exercisedb.io/image/9kYQ88RHOZLWeP');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1128,'dumbbell reverse grip row (female)','The dumbbell reverse grip row is a strength exercise targeting the upper back, performed with dumbbells and a reverse (underhand) grip. It also engages the biceps and forearms.','back','biceps, forearms','https://v2.exercisedb.io/image/ubvsTnIqqWtICG');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1129,'narrow push-up on exercise ball','The narrow push-up on an exercise ball is a challenging upper body exercise that targets the triceps while also engaging the chest and shoulders. The instability of the ball increases the demand on core stability and balance.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/2zvMbT8R2N-bZy');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1130,'spine twist','The spine twist is a bodyweight exercise that targets the abs, obliques, and lower back. It involves sitting on the ground, engaging the core, and twisting the torso side to side, which helps improve core strength and mobility.','waist','obliques, lower back','https://v2.exercisedb.io/image/u6I2Sp5M2C8pKa');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1131,'cable lat pulldown full range of motion','The cable lat pulldown full range of motion is a strength exercise targeting the latissimus dorsi (lats) using a cable machine. It also engages the biceps, rhomboids, and rear deltoids. The movement involves pulling a cable bar down towards the chest while seated, emphasizing a full range of motion for optimal muscle activation.','back','biceps, rhomboids, rear deltoids','https://v2.exercisedb.io/image/zDpTNB4eecvqzm');
