INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1133,'arm slingers hanging straight legs','The arm slingers hanging straight legs exercise involves hanging from a pull-up bar and lifting your straight legs up in front of you, targeting the abdominal muscles while also engaging the shoulders and back.','waist','shoulders, back','https://v2.exercisedb.io/image/zxlWcUvVFUaHR6');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1134,'sled lying calf press','The sled lying calf press is a machine-based exercise targeting the calves, performed by pressing a weighted sled away using the balls of the feet while lying on the machine.','lower legs','hamstrings, glutes','https://v2.exercisedb.io/image/OnAohYiBi8z5J-');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1135,'lever seated calf press','The lever seated calf press is a machine-based exercise targeting the calf muscles. It involves pressing a weighted lever with the balls of your feet while seated, focusing on ankle extension to work the calves.','lower legs','soleus, hamstrings','https://v2.exercisedb.io/image/uNEObl6RFJsxJI');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1136,'arm slingers hanging bent knee legs','The arm slingers hanging bent knee legs exercise targets the abdominal muscles by requiring you to hang from a pull-up bar and lift your knees towards your chest. This movement also engages the shoulders and back for stabilization.','waist','shoulders, back','https://v2.exercisedb.io/image/qpwT2M9xMD8vXR');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1137,'wide-grip chest dip on high parallel bars','The wide-grip chest dip on high parallel bars is a bodyweight exercise that targets the pectoral muscles, with secondary emphasis on the triceps and shoulders. It requires significant upper body strength, stability, and control, as well as experience with dip movements.','chest','triceps, shoulders','https://v2.exercisedb.io/image/jZWuxOMxvuGq4n');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1138,'assisted wide-grip chest dip (kneeling)','The assisted wide-grip chest dip (kneeling) is a machine-based exercise targeting the pectorals, with secondary emphasis on the triceps and shoulders. The assistance from the machine makes it accessible for those who may not yet have the strength for unassisted dips.','chest','triceps, shoulders','https://v2.exercisedb.io/image/vQpIIr89oH85dF');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1139,'split squats','Split squats are a lower body exercise that primarily targets the quadriceps, while also engaging the glutes, hamstrings, and calves. This bodyweight movement involves stepping forward into a split stance and lowering the body until the front thigh is parallel to the ground, then returning to the starting position.','upper legs','glutes, hamstrings, calves','https://v2.exercisedb.io/image/FM45PdoVSB4glo');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1140,'weighted russian twist v. 2','The weighted Russian twist v.2 is a core exercise that targets the abdominal muscles, particularly the obliques, by incorporating rotational movement with added resistance. It requires balance, coordination, and core strength.','waist','obliques, lower back','https://v2.exercisedb.io/image/hPEkv-uAVblfH3');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1141,'dumbbell scott press','The dumbbell Scott press is a shoulder exercise performed while seated, pressing dumbbells overhead to target the deltoid muscles.','shoulders','triceps, chest','https://v2.exercisedb.io/image/m4qWyGQSy1Q0bo');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1142,'close-grip push-up (on knees)','The close-grip push-up (on knees) is a bodyweight exercise that primarily targets the triceps, with secondary emphasis on the chest and shoulders. It is performed from a kneeling position, making it more accessible for beginners and those building upper body strength.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/9bDwjkb-YKUklE');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1143,'cable seated twist','The cable seated twist is an exercise targeting the abdominal muscles, particularly the obliques, using a cable machine. It involves rotating the torso while seated, providing resistance throughout the movement.','waist','obliques','https://v2.exercisedb.io/image/b6TJP7PFFk5ZQf');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1144,'inverse leg curl (on pull-up cable machine)','The inverse leg curl (on pull-up cable machine) is a bodyweight exercise targeting the hamstrings, with secondary emphasis on the glutes and calves. It involves lying face down, attaching ankle straps to a cable machine, and curling the legs towards the glutes.','upper legs','glutes, calves','https://v2.exercisedb.io/image/SRV2eDV3JfpdK6');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1145,'dumbbell biceps curl (with arm blaster)','The dumbbell biceps curl (with arm blaster) is an isolation exercise targeting the biceps, using a specialized arm blaster to maintain strict form and minimize shoulder involvement. This exercise is performed with dumbbells and emphasizes biceps strength and hypertrophy.','upper arms','forearms','https://v2.exercisedb.io/image/9bNKOfkABJJ3yx');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1146,'dumbbell hammer curls (with arm blaster)','The dumbbell hammer curl with arm blaster is an isolation exercise targeting the biceps and forearms. The arm blaster helps maintain proper form by preventing the elbows from moving forward, increasing biceps activation.','upper arms','forearms','https://v2.exercisedb.io/image/oz7C14182fHa7f');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1147,'dumbbell alternate biceps curl (with arm blaster)','The dumbbell alternate biceps curl (with arm blaster) is an isolation exercise targeting the biceps, using an arm blaster to maintain strict form and minimize shoulder involvement. This exercise is performed by alternately curling dumbbells while keeping the upper arms stationary against the arm blaster.','upper arms','forearms','https://v2.exercisedb.io/image/Q9ACOpJiTP3Tlc');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1148,'ez-bar biceps curl (with arm blaster)','The EZ-bar biceps curl (with arm blaster) is a strength exercise targeting the biceps, using an EZ barbell and an arm blaster to isolate the upper arms and minimize cheating. It is performed standing, with the upper arms stabilized against the arm blaster, curling the barbell upward and then lowering it under control.','upper arms','forearms','https://v2.exercisedb.io/image/wBx2mXrZgbqAjr');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1149,'cable triceps pushdown (v-bar) (with arm blaster)','The cable triceps pushdown (v-bar) with arm blaster is an isolation exercise targeting the triceps, performed using a cable machine and a v-bar attachment. The arm blaster helps keep the upper arms stationary, increasing triceps engagement.','upper arms','forearms','https://v2.exercisedb.io/image/oAiRhDLr1cvKyu');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1150,'cable reverse grip triceps pushdown (sz-bar) (with arm blaster)','The cable reverse grip triceps pushdown (sz-bar) with arm blaster is an isolation exercise targeting the triceps, using a cable machine and an underhand grip for increased emphasis on the triceps\' long head. The arm blaster helps keep the upper arms stationary, improving form and muscle engagement.','upper arms','forearms','https://v2.exercisedb.io/image/sLQlDkz0VS33Cq');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1151,'barbell biceps curl (with arm blaster)','The barbell biceps curl with arm blaster is a strength exercise that isolates the biceps by preventing elbow movement and reducing cheating. The arm blaster helps maintain proper form, making the exercise more effective for targeting the biceps.','upper arms','forearms','https://v2.exercisedb.io/image/YmModnN0BwzedK');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1152,'barbell standing concentration curl','The barbell standing concentration curl is an isolation exercise targeting the biceps, performed standing with a barbell in one hand while the other hand supports the body. It emphasizes strict form and muscle contraction.','upper arms','forearms','https://v2.exercisedb.io/image/3psyS29ulMvkki');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1153,'frog crunch','The frog crunch is a bodyweight abdominal exercise that targets the abs and also engages the hip flexors. It is performed lying on your back, curling your torso up while keeping your feet together and knees bent.','waist','hip flexors','https://v2.exercisedb.io/image/iydwHNV2iHz68R');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1154,'ez-bar close-grip bench press','The EZ-bar close-grip bench press is a compound upper body exercise that primarily targets the triceps, with secondary emphasis on the chest and shoulders. It is performed lying on a bench, using a close grip on an EZ barbell to emphasize triceps activation.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/VC0a7PuSOq6M26');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1155,'tire flip','The tire flip is a full-body, explosive strength exercise that primarily targets the glutes, with significant involvement from the hamstrings, quadriceps, and core. It requires lifting and flipping a heavy tire, demanding power, coordination, and proper technique to perform safely.','upper legs','hamstrings, quadriceps, core','https://v2.exercisedb.io/image/r4gCbEbjL9xUKx');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1156,'chest dip on straight bar','The chest dip on a straight bar is a bodyweight exercise that targets the pectoral muscles, with secondary emphasis on the triceps and shoulders. It requires significant upper body strength, stability, and control.','chest','triceps, shoulders','https://v2.exercisedb.io/image/wwXJJJ1tflxK7U');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1157,'cable thibaudeau kayak row','The cable Thibaudeau kayak row is a unilateral rowing exercise that targets the latissimus dorsi using a cable machine. It mimics the motion of a kayak paddle, emphasizing back engagement and unilateral strength.','back','biceps, rhomboids, rear deltoids','https://v2.exercisedb.io/image/Mml1ew33VOXQue');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1158,'bridge - mountain climber (cross body)','The bridge - mountain climber (cross body) is a dynamic bodyweight exercise that targets the abs while also engaging the glutes, quadriceps, hamstrings, shoulders, and triceps. It combines core stabilization with a cross-body knee drive, challenging both strength and coordination.','waist','glutes, quadriceps, hamstrings, shoulders, triceps','https://v2.exercisedb.io/image/wQfpUd2Qg023qd');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1159,'dumbbell lying on floor rear delt raise','The dumbbell lying on floor rear delt raise is an isolation exercise targeting the rear deltoids. It is performed lying face down on the floor, lifting dumbbells out to the sides to engage the rear shoulders and upper back.','shoulders','trapezius, rhomboids','https://v2.exercisedb.io/image/-kW0iKqZD3px1S');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1160,'seated piriformis stretch','The seated piriformis stretch targets the glutes and helps improve flexibility and relieve tension in the piriformis muscle. It is performed seated on the ground, crossing one leg over the other and gently twisting the torso to stretch the gluteal region.','upper legs','hamstrings','https://v2.exercisedb.io/image/IrQcXIcWdWmy8V');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1161,'rocking frog stretch','The rocking frog stretch is a bodyweight exercise that targets the glutes and also stretches the hamstrings and quadriceps. It involves kneeling, leaning forward, and rocking the hips back to stretch the lower body muscles.','upper legs','hamstrings, quadriceps','https://v2.exercisedb.io/image/fjeaNhhZK3FsQa');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1162,'lever horizontal one leg press','The lever horizontal one leg press is a lower body strength exercise performed on a leverage machine. It primarily targets the glutes, with secondary emphasis on the quadriceps, hamstrings, and calves. The exercise involves pressing a footplate away from the body using one leg at a time, which increases the demand for unilateral strength and stability.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/SmFR-xBdXbnr8M');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1163,'jump rope','Jump rope is a cardiovascular exercise that involves continuously jumping over a swinging rope. It primarily targets the cardiovascular system while also engaging the calves, quadriceps, hamstrings, and glutes.','cardio','calves, quadriceps, hamstrings, glutes','https://v2.exercisedb.io/image/MN5GNEAfArARqb');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1164,'cable lateral pulldown with v-bar','The cable lateral pulldown with v-bar is a strength exercise targeting the latissimus dorsi (lats) using a cable machine and v-bar attachment. It also engages the biceps and forearms as secondary muscles.','back','biceps, forearms','https://v2.exercisedb.io/image/jOEx6lTk2GWAOa');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1165,'dumbbell lying pronation on floor','The dumbbell lying pronation on floor targets the forearms by requiring you to rotate your palms downward while lifting dumbbells, emphasizing forearm strength and stability.','lower arms','biceps, triceps','https://v2.exercisedb.io/image/IaeygTHmMsI08u');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1166,'dumbbell lying supination on floor','The dumbbell lying supination on floor is an isolation exercise targeting the forearms, with secondary engagement of the biceps and shoulders. It involves lying on your back and performing a supination curl motion with dumbbells.','lower arms','biceps, shoulders','https://v2.exercisedb.io/image/EIiUMgO4qnuaV5');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1167,'lever reverse grip lateral pulldown','The lever reverse grip lateral pulldown is a machine-based exercise targeting the latissimus dorsi (lats) with a reverse (underhand) grip, also engaging the biceps, rhomboids, and rear deltoids. It is performed on a leverage machine, making it accessible and safe for most users.','back','biceps, rhomboids, rear deltoids','https://v2.exercisedb.io/image/x-j3oK43IGteXt');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1168,'ez-barbell standing wide grip biceps curl','The EZ-barbell standing wide grip biceps curl is a strength exercise targeting the biceps, with secondary emphasis on the forearms. It involves curling an EZ barbell with a wide grip while standing.','upper arms','forearms','https://v2.exercisedb.io/image/P823VRBE0n0m9U');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1169,'dumbbell step-up lunge','The dumbbell step-up lunge is a compound lower body exercise that targets the quadriceps while also engaging the glutes, hamstrings, and calves. It involves stepping onto a raised platform while holding dumbbells, requiring balance, coordination, and lower body strength.','upper legs','glutes, hamstrings, calves','https://v2.exercisedb.io/image/efcqGffBRjCnqj');
