INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1171,'barbell sitted alternate leg raise','The barbell sitted alternate leg raise is an exercise targeting the abdominal muscles and hip flexors. Performed while seated on a bench with a barbell across the thighs, it involves alternately raising each leg while keeping the back straight.','waist','hip flexors','https://v2.exercisedb.io/image/FxZBkdhpxCKL88');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1172,'barbell sitted alternate leg raise (female)','The barbell sitted alternate leg raise (female) targets the abdominal muscles while also engaging the hip flexors and quadriceps. The exercise is performed seated on a bench, holding a barbell across the thighs, and alternately raising each leg while keeping it straight.','waist','hip flexors, quadriceps','https://v2.exercisedb.io/image/A3cm6V0h1tCKW6');
