INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1174,'twisted leg raise','The twisted leg raise is a bodyweight exercise targeting the abdominal muscles, with an emphasis on the obliques and hip flexors. It involves lifting the legs while twisting the hips to engage the core from different angles.','waist','obliques, hip flexors','https://v2.exercisedb.io/image/hGWhEgCvpwGcoa');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1175,'dumbbell supported squat','The dumbbell supported squat is a lower body exercise targeting the quadriceps, with additional activation of the glutes, hamstrings, and calves. It involves holding dumbbells at your sides while performing a squat, enhancing strength and stability.','upper legs','glutes, hamstrings, calves','https://v2.exercisedb.io/image/fnic6qvFhkxvxV');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1176,'dumbbell single leg deadlift with stepbox support','The dumbbell single leg deadlift with stepbox support is a unilateral lower body exercise that targets the glutes, with secondary emphasis on the hamstrings and lower back. It challenges balance, stability, and strength, making it suitable for those with some experience in weight training.','upper legs','hamstrings, lower back','https://v2.exercisedb.io/image/MF-ZwhgbOrsdcd');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1177,'dumbbell sumo pull through','The dumbbell sumo pull through is a lower body exercise that targets the glutes, with secondary emphasis on the hamstrings, quadriceps, and core. It involves a wide-stance squat and a hip hinge movement, using a dumbbell for resistance.','upper legs','hamstrings, quadriceps, core','https://v2.exercisedb.io/image/aD7kt5rJr3GXCL');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1178,'barbell split squat v. 2','The barbell split squat v. 2 is a lower body strength exercise that targets the quadriceps, while also engaging the glutes, hamstrings, and calves. It involves stepping forward into a split stance and lowering the body with a barbell across the upper back.','upper legs','glutes, hamstrings, calves','https://v2.exercisedb.io/image/QI-W7QK0JyImeH');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1179,'dumbbell step-up split squat','The dumbbell step-up split squat is a lower body exercise that targets the quadriceps, with additional emphasis on the glutes, hamstrings, and calves. It involves stepping up onto a bench or step while holding dumbbells, requiring balance, coordination, and strength.','upper legs','glutes, hamstrings, calves','https://v2.exercisedb.io/image/0lfoiTDrxoGQ7T');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1180,'captains chair straight leg raise','The captain\'s chair straight leg raise is an abdominal exercise performed on a captain\'s chair apparatus. It primarily targets the abdominal muscles and also engages the hip flexors. The movement requires core strength and stability to lift and control the legs while keeping the upper body stable.','waist','hip flexors','https://v2.exercisedb.io/image/2XppOhVCIfaJ6p');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1181,'weighted close grip chin-up on dip cage','The weighted close grip chin-up on dip cage is a challenging upper body exercise that targets the lats, with significant involvement from the biceps and forearms. It requires the use of additional weight, increasing the demand on strength and control.','back','biceps, forearms','https://v2.exercisedb.io/image/sx06jLUclpQvNu');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1182,'resistance band seated hip abduction','A seated exercise using a resistance band to target the hip abductors by pushing the knees apart against resistance. This movement also engages the glutes and hamstrings.','upper legs','glutes, hamstrings','https://v2.exercisedb.io/image/ZodR1whgiaQo3q');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1183,'resistance band leg extension','The resistance band leg extension targets the quadriceps by extending the leg against the resistance of a band, helping to build strength and endurance in the upper legs.','upper legs','hamstrings','https://v2.exercisedb.io/image/cwxapqyowlfgWh');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1184,'ez bar lying bent arms pullover','The EZ bar lying bent arms pullover is a strength exercise targeting the lats, with secondary emphasis on the triceps and chest. It involves lying on a bench and moving the EZ barbell in an arc over and behind the head, requiring control and stability.','back','triceps, chest','https://v2.exercisedb.io/image/cR4UvZeGSqQsss');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1185,'incline scapula push up','The incline scapula push up is a bodyweight exercise performed on an incline bench that primarily targets the serratus anterior. It also engages the triceps and shoulders. The movement emphasizes scapular retraction and protraction, helping to improve shoulder stability and strength.','chest','triceps, shoulders','https://v2.exercisedb.io/image/Id9f1uEeROjO6r');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1186,'scapula dips','Scapula dips are a bodyweight exercise targeting the traps and upper back, focusing on scapular retraction and depression. This movement helps improve shoulder stability and strength.','back','rhomboids, deltoids','https://v2.exercisedb.io/image/mkXqOktd94TShq');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1187,'low glute bridge on floor','The low glute bridge on floor is a bodyweight exercise that targets the glutes while also engaging the hamstrings and core. It is performed by lying on your back, lifting your hips off the ground, and squeezing your glutes at the top of the movement.','upper legs','hamstrings, core','https://v2.exercisedb.io/image/DLCQ1GM2oQpwow');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1188,'curl-up','The curl-up is a bodyweight exercise targeting the abdominal muscles. It involves lying on your back, bending your knees, and curling your upper body towards your knees to engage the abs.','waist','hip flexors','https://v2.exercisedb.io/image/JlQyOf1qdsmEBU');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1189,'barbell pendlay row','The barbell Pendlay row is a strength exercise targeting the upper back, performed by pulling a barbell from the floor to the upper abdomen with strict form.','back','biceps, forearms','https://v2.exercisedb.io/image/KULSiIbmvoXyvd');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1190,'bench pull-ups','Bench pull-ups are a bodyweight exercise targeting the lats, performed by pulling your chest up to a horizontal bar or surface while keeping your body straight. This movement also engages the biceps and forearms.','back','biceps, forearms','https://v2.exercisedb.io/image/X6vELdzpBdZCP0');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1191,'scapula push-up','The scapula push-up is a bodyweight exercise that targets the serratus anterior and helps improve scapular mobility and stability. It is performed in a high plank position, focusing on the movement of the shoulder blades rather than the elbows.','chest','triceps, shoulders','https://v2.exercisedb.io/image/Ht1HZDrlUTSFEA');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1192,'band fixed back underhand pulldown','The band fixed back underhand pulldown is a resistance band exercise targeting the latissimus dorsi (lats) and also working the biceps, rhomboids, and rear deltoids. It mimics the motion of a traditional lat pulldown but uses a resistance band anchored above the head.','back','biceps, rhomboids, rear deltoids','https://v2.exercisedb.io/image/ndX9Qtqy2guzIw');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1193,'band fixed back close grip pulldown','The band fixed back close grip pulldown is an exercise targeting the latissimus dorsi (lats) using a resistance band anchored above the user. It mimics the traditional cable pulldown but uses a band for resistance, making it accessible and effective for building back strength.','back','biceps, forearms','https://v2.exercisedb.io/image/wt8Q0WxrqmQYaF');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1194,'potty squat','The potty squat is a bodyweight exercise that targets the abs while also engaging the quadriceps and glutes. It involves squatting down as if sitting on a chair, maintaining a straight back and upright chest, and then returning to a standing position.','waist','quadriceps, glutes','https://v2.exercisedb.io/image/bWHiZ041TK0Bh6');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1195,'resistance band seated shoulder press','The resistance band seated shoulder press is an overhead pressing exercise performed while seated, using a resistance band to target the deltoid muscles. It also engages the triceps and upper back as secondary muscles. This exercise is suitable for building shoulder strength and stability, and is accessible for most fitness levels due to the controlled movement and support provided by the seated position.','shoulders','triceps, upper back','https://v2.exercisedb.io/image/EwC7i-JjKpy6JZ');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1196,'resistance band seated biceps curl','The resistance band seated biceps curl is an upper arm exercise that targets the biceps using a resistance band while seated, making it accessible and safe for most fitness levels.','upper arms','forearms','https://v2.exercisedb.io/image/JYl1UwFf-zHEBc');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1197,'resistance band seated chest press','The resistance band seated chest press is a chest-focused exercise performed while sitting, using a resistance band to provide tension. It targets the pectoral muscles and also works the shoulders and triceps. This movement is performed by pressing the band forward from the chest while seated, making it accessible and safe for most fitness levels.','chest','shoulders, triceps','https://v2.exercisedb.io/image/e55F1vMzi3UFKj');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1198,'potty squat with support','The potty squat with support is a bodyweight exercise targeting the glutes, performed with the assistance of a stable support for balance. It is suitable for those developing lower body strength and proper squat mechanics.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/tfOoHmj4Lzzxp3');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1199,'smith sumo squat','The smith sumo squat is a lower body exercise performed on a smith machine, targeting the glutes with secondary emphasis on the quadriceps, hamstrings, and calves. The wide stance and guided bar path make it accessible for those developing squat technique and lower body strength.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/GOyU4mb6nSxhyz');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1200,'resistance band seated straight back row','The resistance band seated straight back row targets the upper back muscles and is performed seated on the floor with a resistance band looped around the feet. It emphasizes scapular retraction and upper back strength.','back','biceps, shoulders','https://v2.exercisedb.io/image/AM5UHgAIzwODPk');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1201,'push-up plus','The push-up plus is a variation of the standard push-up that adds an extra movement at the top of the push-up by protracting the shoulder blades, which further engages the serratus anterior and improves shoulder stability.','chest','triceps, shoulders','https://v2.exercisedb.io/image/4zUyC548hzPNd7');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1202,'pelvic tilt','The pelvic tilt is a bodyweight exercise that targets the abdominal muscles and helps improve core stability and lower back health. It is often used in rehabilitation and as a foundational movement for beginners.','waist','lower back','https://v2.exercisedb.io/image/uENzYEgyLmtlmq');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1203,'bodyweight standing close-grip one arm row','The bodyweight standing close-grip one arm row is a unilateral exercise targeting the upper back, performed with body weight and focusing on pulling strength and stability.','back','biceps, forearms','https://v2.exercisedb.io/image/JE76F9IawtUn7p');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1204,'bodyweight standing close-grip row','The bodyweight standing close-grip row targets the upper back using only body weight for resistance. It involves pulling a bar or handles towards the body while maintaining a bent-over position, focusing on squeezing the shoulder blades together.','back','biceps, forearms','https://v2.exercisedb.io/image/ls244TVdR4bqez');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1205,'bodyweight standing one arm row (with towel)','A bodyweight exercise targeting the upper back, performed by pulling a towel with one arm while standing, engaging the biceps and forearms as secondary muscles.','back','biceps, forearms','https://v2.exercisedb.io/image/C6eqlOu8ePSscg');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1206,'bodyweight standing one arm row','The bodyweight standing one arm row is a unilateral exercise targeting the upper back, performed by hinging at the hips and pulling a weight toward the chest with one arm.','back','biceps, forearms','https://v2.exercisedb.io/image/SZ-RTTTcDXQYoo');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1207,'bodyweight standing row (with towel)','The bodyweight standing row (with towel) is a back exercise that targets the upper back using a towel for resistance. It also engages the biceps and shoulders. The movement is performed by pulling the towel towards your chest while maintaining a strong posture.','back','biceps, shoulders','https://v2.exercisedb.io/image/ZEj866xRDgx1-3');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1208,'bodyweight standing row','The bodyweight standing row is a back exercise that targets the upper back using only body weight for resistance. It also engages the biceps and shoulders as secondary muscles. The movement involves pulling a bar or handles towards the body while standing, focusing on squeezing the shoulder blades together.','back','biceps, shoulders','https://v2.exercisedb.io/image/Yn1akZZ9AnJQop');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1209,'bodyweight squatting row (with towel)','The bodyweight squatting row (with towel) is a compound exercise that targets the upper back while also engaging the biceps and shoulders. It combines a squat with a rowing motion using a towel for resistance, making it a functional movement that develops strength and coordination.','back','biceps, shoulders','https://v2.exercisedb.io/image/zSpNA6qw7vSIm5');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1210,'bodyweight squatting row','The bodyweight squatting row is a compound exercise that targets the upper back while also engaging the biceps and shoulders. It combines a squatting motion with a rowing movement, requiring coordination and strength.','back','biceps, shoulders','https://v2.exercisedb.io/image/nw2R5BsXlgRZlT');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1211,'glute-ham raise','The glute-ham raise is a bodyweight exercise that primarily targets the hamstrings, with secondary emphasis on the glutes and lower back. It is performed on a glute-ham raise machine and requires significant strength and control to execute properly.','upper legs','glutes, lower back','https://v2.exercisedb.io/image/BheV2al9ck1u-D');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1212,'frankenstein squat','The Frankenstein squat is a variation of the squat where the barbell is held in front of the body with straight arms, challenging the glutes, quadriceps, hamstrings, and calves. This exercise emphasizes posture, core stability, and lower body strength.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/Vrtj6j3V0fwfmN');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1213,'lever lying two-one leg curl','The lever lying two-one leg curl is an isolation exercise targeting the hamstrings using a leverage machine. It involves curling the legs towards the glutes while lying on the machine, focusing on one leg at a time for increased intensity and muscle engagement.','upper legs','glutes','https://v2.exercisedb.io/image/qFU3GZinh4Cur5');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1214,'lever bent-over row with v-bar','The lever bent-over row with v-bar is a machine-based exercise targeting the upper back, with secondary emphasis on the biceps and forearms. It involves pulling a v-bar attachment towards the abdomen while maintaining a bent-over position, focusing on squeezing the shoulder blades together.','back','biceps, forearms','https://v2.exercisedb.io/image/XualYrccZ2titb');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1215,'quarter sit-up','The quarter sit-up is an abdominal exercise that involves lifting your upper body off the ground to about a 45-degree angle, focusing on engaging the abs with minimal hip flexor involvement.','waist','hip flexors','https://v2.exercisedb.io/image/KTPn4qLxTBQgjE');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1216,'half sit-up (male)','The half sit-up (male) is an abdominal exercise performed with body weight. It involves curling the upper body off the ground to a 45-degree angle, primarily targeting the abs and secondarily engaging the hip flexors.','waist','hip flexors','https://v2.exercisedb.io/image/JLGmn6N56rXptx');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1217,'prisoner half sit-up (male)','The prisoner half sit-up is an abdominal exercise performed with body weight, focusing on the abs and hip flexors. It involves lying on your back, hands behind your head, and curling your torso up to a 45-degree angle before lowering back down.','waist','hip flexors','https://v2.exercisedb.io/image/NPiYLxGS6Og4Wh');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1218,'arms overhead full sit-up (male)','The arms overhead full sit-up is a bodyweight abdominal exercise where you lie on your back with arms extended overhead and perform a full sit-up, engaging the abs, hip flexors, and lower back.','waist','hip flexors, lower back','https://v2.exercisedb.io/image/Nq5OKIsNVKQPkL');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1219,'kneeling push-up (male)','The kneeling push-up (male) is a bodyweight exercise targeting the pectorals, with secondary emphasis on the triceps and shoulders. It is performed from a kneeling position, making it a less challenging variation of the standard push-up, suitable for building foundational upper body strength.','chest','triceps, shoulders','https://v2.exercisedb.io/image/5R0BBQq1IWW2f1');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1220,'basic toe touch (male)','The basic toe touch is a bodyweight exercise that primarily targets the glutes, with secondary emphasis on the hamstrings and calves. It involves bending forward at the waist to reach towards the toes, providing a stretch to the posterior chain.','upper legs','hamstrings, calves','https://v2.exercisedb.io/image/K3A92BVubWKXf2');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1221,'side-to-side toe touch (male)','The side-to-side toe touch is a bodyweight exercise targeting the abs, obliques, and hip flexors. It involves bending at the waist to touch each foot alternately, promoting core engagement and flexibility.','waist','obliques, hip flexors','https://v2.exercisedb.io/image/xNkKmA74kJpZh0');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1222,'arms apart circular toe touch (male)','The arms apart circular toe touch is a bodyweight exercise that targets the glutes, hamstrings, quadriceps, and calves. It involves bending forward at the waist to touch your toes with one hand while lifting the opposite leg behind you, alternating sides to challenge balance and flexibility.','upper legs','hamstrings, quadriceps, calves','https://v2.exercisedb.io/image/8lGu8wtnkM6u3y');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1223,'hands reversed clasped circular toe touch (male)','This exercise involves standing with feet shoulder-width apart, bending forward at the waist, clasping hands behind the legs, and performing a circular motion with the arms to touch the toes, targeting the glutes and stretching the lower body.','upper legs','hamstrings, quadriceps, calves','https://v2.exercisedb.io/image/wFaGzKhWdhJJBg');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1224,'chest tap push-up (male)','The chest tap push-up is a challenging bodyweight exercise that targets the pectorals while also engaging the triceps and shoulders. It requires strength, coordination, and balance as you momentarily support your body with one hand while tapping your chest with the other.','chest','triceps, shoulders','https://v2.exercisedb.io/image/8hbaedWLkYzCY7');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1225,'modified hindu push-up (male)','The modified Hindu push-up is a bodyweight exercise that targets the pectorals while also engaging the triceps, shoulders, and core. It involves a dynamic movement pattern that combines elements of a push-up with a downward dog-like position, challenging both strength and mobility.','chest','triceps, shoulders, core','https://v2.exercisedb.io/image/C4KE7Fs5419MAi');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1226,'hands clasped circular toe touch (male)','The hands clasped circular toe touch is a bodyweight exercise that targets the glutes and also engages the hamstrings, quadriceps, and calves. It involves hinging at the hips and making a circular motion with your hands towards your toes, promoting flexibility and mobility in the lower body.','upper legs','hamstrings, quadriceps, calves','https://v2.exercisedb.io/image/dR1ol2rwo1qJZ4');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1227,'scissor jumps (male)','Scissor jumps are a plyometric cardio exercise that involves jumping and alternating the crossing of your legs in mid-air. This movement elevates the heart rate and challenges coordination and lower body strength.','cardio','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/i2q-beKnWmBOQp');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1228,'astride jumps (male)','Astride jumps (male) are a plyometric cardio exercise that involves jumping explosively from a squat position, spreading the legs and arms in the air, and landing softly. This movement targets the cardiovascular system while also engaging the quadriceps, hamstrings, and calves.','cardio','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/OKWLDgGkMXCeBT');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1229,'half knee bends (male)','Half knee bends (male) are a bodyweight exercise that primarily targets the cardiovascular system while also engaging the quadriceps, hamstrings, and glutes. The movement involves bending the knees and lowering the body as if sitting back into a chair, then returning to standing. This exercise is often used for light cardio, warm-ups, or rehabilitation.','cardio','quadriceps, hamstrings, glutes','https://v2.exercisedb.io/image/mHlmNkNcVJQ1Tz');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1230,'semi squat jump (male)','The semi squat jump is a plyometric exercise that targets the cardiovascular system while also engaging the quadriceps, hamstrings, and calves. It involves performing a partial squat followed by an explosive jump, making it effective for improving cardiovascular fitness, lower body power, and coordination.','cardio','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/tSbf0aPLAMmyd2');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1231,'star jump (male)','The star jump (male) is a plyometric cardio exercise that involves jumping explosively while spreading the arms and legs out to form a star shape in the air. It targets the cardiovascular system and also engages the quadriceps, hamstrings, and calves.','cardio','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/lvS8exfWoHbnux');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1232,'jack jump (male)','A dynamic bodyweight exercise that involves jumping with feet apart and arms overhead, then returning to the starting position. This movement elevates the heart rate and targets the cardiovascular system, with secondary emphasis on the quadriceps and calves.','cardio','quadriceps, calves','https://v2.exercisedb.io/image/j85bUXawZxCKL8');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1233,'two toe touch (male)','The two toe touch (male) is a bodyweight exercise that primarily targets the spine, with secondary emphasis on the hamstrings and glutes. It involves bending forward at the waist to touch your toes, promoting flexibility and mobility in the posterior chain.','back','hamstrings, glutes','https://v2.exercisedb.io/image/jXD1JGn8zBFpCO');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1234,'hyght dumbbell fly','The hyght dumbbell fly is a chest exercise performed on a bench using dumbbells. It targets the pectoral muscles and also engages the shoulders. The movement involves lowering the dumbbells in a wide arc to stretch the chest and then bringing them back together above the chest.','chest','shoulders','https://v2.exercisedb.io/image/6nxd0FzOskCIzR');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1235,'cable assisted inverse leg curl','The cable assisted inverse leg curl is an exercise targeting the hamstrings, performed using a cable machine to provide resistance as you curl your legs toward your glutes while lying face down.','upper legs','glutes, calves','https://v2.exercisedb.io/image/vwvSPxVRTHwdai');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1236,'resistance band hip thrusts on knees (female)','Resistance band hip thrusts on knees (female) target the glutes primarily, with secondary activation of the hamstrings and quadriceps. The exercise is performed by kneeling, using a resistance band for added tension, and thrusting the hips forward to engage the glutes.','upper legs','hamstrings, quadriceps','https://v2.exercisedb.io/image/I7UP5iBS0CHGG-');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1237,'landmine lateral raise','The landmine lateral raise is a shoulder exercise performed using a barbell anchored at one end (landmine setup). It targets the deltoids and also engages the traps and upper back. The movement involves lifting the barbell laterally to shoulder height, emphasizing shoulder strength and stability.','shoulders','traps, upper back','https://v2.exercisedb.io/image/F4lV76pEUNEDYE');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1238,'kneeling plank tap shoulder (male)','The kneeling plank tap shoulder is a core stability exercise that targets the abs while also engaging the shoulders and triceps. It requires maintaining a stable plank position while alternately tapping each shoulder with the opposite hand, challenging balance and coordination.','waist','shoulders, triceps','https://v2.exercisedb.io/image/gMJhJPkeKnFdiB');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1239,'exercise ball on the wall calf raise (tennis ball between knees)','This exercise targets the calves by performing a calf raise while standing against a wall with an exercise ball supporting the lower back and a tennis ball held between the knees. Dumbbells are held for added resistance, and the movement requires balance and coordination.','lower legs','quadriceps, hamstrings','https://v2.exercisedb.io/image/kiMP7nWiJVbRim');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1240,'exercise ball on the wall calf raise (tennis ball between ankles)','This exercise targets the calves by performing a calf raise while holding a dumbbell in each hand, using an exercise ball for back support against the wall, and squeezing a tennis ball between the ankles to increase activation and control.','lower legs','hamstrings, quadriceps','https://v2.exercisedb.io/image/wK-8iHBl3iqf9C');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1241,'smith full squat','The smith full squat is a compound lower body exercise performed using a smith machine. It primarily targets the glutes, with secondary emphasis on the quadriceps, hamstrings, and calves. The smith machine provides stability, making it accessible to those who may not be comfortable with free-weight squats, but still requires proper form and core engagement.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/T0V5jhohuRLeF4');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1242,'weighted muscle up','The weighted muscle up is an advanced compound exercise that targets the lats and involves pulling your body above a bar with added resistance. It requires significant upper body strength, coordination, and technique, making it suitable for experienced athletes.','back','biceps, triceps, shoulders, chest','https://v2.exercisedb.io/image/DO6M2KM-VPf1Yg');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1243,'elbow dips','Elbow dips are a bodyweight exercise targeting the triceps, performed using a bench or chair. The movement involves lowering and raising the body by bending and straightening the elbows while keeping the back close to the bench.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/fhkxq087ZDdG44');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1244,'korean dips','Korean dips are a challenging bodyweight exercise performed on parallel bars, targeting the pectorals, triceps, and shoulders. The movement requires significant upper body strength, shoulder mobility, and stability, as the body is lowered deeply between the bars before pressing back up.','chest','triceps, shoulders','https://v2.exercisedb.io/image/6G1H2fojFdt0Ho');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1245,'impossible dips','Impossible dips are a challenging bodyweight exercise performed between two parallel bars, focusing on the triceps while also engaging the chest and shoulders. The movement requires significant upper body strength and control, as well as experience with dip variations.','upper arms','chest, shoulders','https://v2.exercisedb.io/image/vDir73UGMS8t9Y');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1246,'weighted one hand pull up','The weighted one hand pull up is an advanced bodyweight exercise that targets the latissimus dorsi (lats) and also engages the biceps and forearms. By adding weight, this movement significantly increases the strength and coordination required, making it a challenging exercise for experienced athletes.','back','biceps, forearms','https://v2.exercisedb.io/image/iSMtkEF7yFqWzK');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1247,'stalder press','The stalder press is a challenging bodyweight exercise that primarily targets the triceps, while also engaging the shoulders and core. It involves a combination of squatting and pressing movements, requiring significant strength, balance, and coordination.','upper arms','shoulders, core','https://v2.exercisedb.io/image/6KO6TNoi0yuOkq');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1248,'elevator','The elevator is a bodyweight exercise targeting the upper back. It involves bending forward at the waist while keeping the back straight, then returning to a standing position. This movement helps strengthen the upper back and improves posture.','back','shoulders, trapezius','https://v2.exercisedb.io/image/mHrXMXrZR9J1uT');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1249,'archer pull up','The archer pull up is a challenging bodyweight exercise that targets the lats and requires significant strength, coordination, and control. It involves pulling up with one arm while the other remains straight, alternating sides with each repetition.','back','biceps, forearms','https://v2.exercisedb.io/image/vOGBEuH0Om2YRf');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1250,'archer push up','The archer push up is a challenging bodyweight exercise that targets the pectorals and also works the triceps, shoulders, and core. It involves performing a push-up while extending one arm out to the side, increasing the load on the working arm and requiring significant strength, balance, and coordination.','chest','triceps, shoulders, core','https://v2.exercisedb.io/image/5yXQuEA92CfGXB');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1251,'front lever reps','The front lever is an advanced calisthenics exercise that targets the upper back, core, and shoulders. It requires significant strength, body control, and coordination to maintain a horizontal position while hanging from a bar.','back','core, shoulders','https://v2.exercisedb.io/image/MoACh8j3XrzSAp');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1252,'front lever','The front lever is a challenging bodyweight exercise that targets the abs and requires significant strength and control from the lats, shoulders, and forearms. It involves holding your body parallel to the ground while hanging from a pull-up bar.','waist','lats, shoulders, forearms','https://v2.exercisedb.io/image/pWurF6PsTncXBl');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1253,'back lever','The back lever is a challenging bodyweight exercise performed on a pull-up bar, requiring significant strength, balance, and body control. It targets the upper back and also engages the biceps, forearms, and core.','back','biceps, forearms, core','https://v2.exercisedb.io/image/ljcEgwXOvW7q2m');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1254,'straddle planche','The straddle planche is an advanced bodyweight exercise that targets the abs while also engaging the shoulders, triceps, and chest. It requires significant core strength, balance, and coordination to hold the body parallel to the ground with only the hands supporting the weight.','waist','shoulders, triceps, chest','https://v2.exercisedb.io/image/AbToU511vC8z6P');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1255,'full planche','The full planche is an advanced bodyweight exercise that requires significant core strength, balance, and upper body control. It involves holding your body parallel to the ground, supported only by your hands, with no other contact points.','waist','shoulders, chest, triceps','https://v2.exercisedb.io/image/h4zxUPDg7VbBEl');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1256,'lean planche','The lean planche is a challenging bodyweight exercise that targets the abdominal muscles while also engaging the shoulders, chest, and triceps. It requires significant core strength, balance, and upper body control as you lean your body forward in a plank-like position, shifting your weight past your hands.','waist','shoulders, chest, triceps','https://v2.exercisedb.io/image/IjuKEghjBGgGph');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1257,'frog planche','The frog planche is an advanced bodyweight exercise that targets the abs while also engaging the shoulders, chest, and triceps. It requires significant core strength, balance, and upper body control.','waist','shoulders, chest, triceps','https://v2.exercisedb.io/image/sWajHQxShCcB8i');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1258,'handstand','The handstand is a bodyweight exercise that primarily targets the triceps, while also engaging the shoulders and core. It requires significant balance, strength, and coordination to perform safely and effectively.','upper arms','shoulders, core','https://v2.exercisedb.io/image/uFkmpcloZukvHZ');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1259,'flag','The flag is an advanced bodyweight exercise that targets the abs and requires significant core, shoulder, and grip strength. It involves gripping a vertical pole and lifting the body horizontally, holding a straight line parallel to the ground.','waist','obliques, shoulders','https://v2.exercisedb.io/image/WB8-Qw7iLzA9mE');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1260,'skin the cat','Skin the cat is a gymnastic movement performed on a bar, where you hang, lift your legs over your head, rotate your body through your arms, and then return to the starting position. It requires significant upper body and core strength, as well as shoulder mobility and coordination.','back','shoulders, core','https://v2.exercisedb.io/image/B5A5LlYulelIcR');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1261,'barbell thruster','The barbell thruster is a compound exercise that combines a front squat with an overhead press, targeting the shoulders and engaging multiple muscle groups for strength and power.','shoulders','quadriceps, glutes, hamstrings, core','https://v2.exercisedb.io/image/A13bCKl-0LN5w6');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1262,'weighted muscle up (on bar)','The weighted muscle up (on bar) is an advanced calisthenics exercise that combines a pull-up with a dip, performed while adding extra weight. It targets the lats and also works the biceps, triceps, shoulders, and forearms. This movement requires significant upper body strength, coordination, and technique, especially when performed with additional weight.','back','biceps, triceps, shoulders, forearms','https://v2.exercisedb.io/image/Twl-xcg2LVACZB');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1263,'weighted straight bar dip','The weighted straight bar dip is a compound chest exercise performed on parallel bars with added weight for increased resistance. It primarily targets the pectorals, with significant involvement of the triceps and shoulders.','chest','triceps, shoulders','https://v2.exercisedb.io/image/-RW19UXh1uetNj');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1264,'straddle maltese','The straddle maltese is an advanced bodyweight exercise performed on rings, targeting the abs with significant involvement of the shoulders and chest. It requires exceptional core strength, shoulder stability, and body control, making it a challenging movement for experienced athletes.','waist','shoulders, chest','https://v2.exercisedb.io/image/xF7W-p9hqJQwPA');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1265,'full maltese','The full maltese is an advanced bodyweight exercise that primarily targets the abs, with significant involvement of the shoulders and chest. It requires a high degree of core strength, balance, and body control, making it a challenging movement for most practitioners.','waist','shoulders, chest','https://v2.exercisedb.io/image/-MZNXhveo-JMWc');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1266,'swing 360','The swing 360 is a dynamic bodyweight exercise that targets the cardiovascular system while also engaging the shoulders and core. It involves swinging the arms in a circular motion while rotating the torso, making it a great movement for increasing heart rate and improving coordination.','cardio','shoulders, core','https://v2.exercisedb.io/image/YLQfO6w2E3AX6k');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1267,'full planche push-up','The full planche push-up is an advanced bodyweight exercise that targets the pectorals, shoulders, triceps, and core. It requires significant strength, balance, and coordination as you perform a push-up while balancing your entire body off the ground with only your hands.','chest','shoulders, triceps, core','https://v2.exercisedb.io/image/gUAhHIqClnP4Q1');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1268,'bear crawl','The bear crawl is a full-body movement that targets the cardiovascular system while also engaging the core, shoulders, and triceps. It involves crawling on all fours with knees off the ground, requiring coordination and endurance.','cardio','core, shoulders, triceps','https://v2.exercisedb.io/image/3t4KI0MP0QpbfN');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1269,'skater hops','Skater hops are a dynamic, lateral jumping exercise that targets the cardiovascular system while also engaging the lower body muscles. The movement mimics a speed skater\'s motion, helping to improve agility, coordination, and cardiovascular endurance.','cardio','quadriceps, hamstrings, glutes, calves','https://v2.exercisedb.io/image/b2zctbWPJpOpem');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1270,'l-pull-up','The L-pull-up is a challenging bodyweight exercise that targets the lats while also engaging the core, biceps, and forearms. It requires the lifter to maintain an \'L\' position with the legs extended straight out in front, parallel to the ground, throughout the pull-up movement.','back','biceps, forearms','https://v2.exercisedb.io/image/nadXBxu0PuYyqt');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1271,'l-sit on floor','The L-sit on floor is a challenging core exercise that targets the abdominal muscles and hip flexors. It requires significant core strength, balance, and coordination to lift and hold the legs parallel to the floor while supporting the body with the arms.','waist','hip flexors','https://v2.exercisedb.io/image/n4olDF0pFhCMWX');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1272,'v-sit on floor','The V-sit on floor is a core exercise that targets the abdominal muscles and also engages the hip flexors. It requires balance, core strength, and coordination as you hold your body in a V-shape, balancing on your tailbone.','waist','hip flexors','https://v2.exercisedb.io/image/0SG31m4SGVp91j');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1273,'swimmer kicks v. 2 (male)','Swimmer kicks v. 2 (male) is a bodyweight exercise targeting the glutes, with secondary emphasis on the hamstrings, quadriceps, and calves. It involves lying face down and performing a flutter kick motion with the legs while keeping the chest and legs elevated off the ground.','upper legs','hamstrings, quadriceps, calves','https://v2.exercisedb.io/image/XVeWCtBiiDdtxW');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1274,'forward lunge (male)','The forward lunge is a bodyweight exercise targeting the glutes, with secondary emphasis on the quadriceps, hamstrings, and calves. It involves stepping forward into a lunge position and returning to standing, alternating legs.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/aOrDf6db5MIB5t');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1275,'glute bridge two legs on bench (male)','The glute bridge with two legs on a bench is a bodyweight exercise that targets the glutes, with secondary emphasis on the hamstrings and core. It involves lifting the hips off the ground while the upper back rests on a bench, creating a straight line from knees to shoulders.','upper legs','hamstrings, core','https://v2.exercisedb.io/image/wCqckTxiJkKjs8');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1276,'quads (bodyweight squat)','A bodyweight squat exercise primarily targeting the quadriceps, with secondary activation of the hamstrings and glutes. This movement is fundamental for lower body strength and can be performed without equipment.','upper legs','hamstrings, glutes','https://v2.exercisedb.io/image/8zKCJz5hrorNud');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1277,'dumbbell incline y-raise','The dumbbell incline Y-raise is an upper back exercise performed on an incline bench, targeting the upper back, shoulders, and rear deltoids. It involves raising the arms in a Y shape while lying face down on an incline bench, emphasizing scapular stability and shoulder health.','back','shoulders, rear deltoids','https://v2.exercisedb.io/image/mfWFEyCHZMZzdu');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1278,'dumbbell incline t-raise','The dumbbell incline T-raise is an isolation exercise targeting the deltoids, performed on an incline bench to emphasize shoulder and upper back muscles. It requires good form and control to avoid swinging and to properly engage the target muscles.','shoulders','traps, rhomboids','https://v2.exercisedb.io/image/pms8N4MVz-1Jxw');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1279,'bodyweight drop jump squat','The bodyweight drop jump squat is a plyometric exercise targeting the glutes, with secondary emphasis on the quadriceps, hamstrings, and calves. It involves explosive jumping and rapid foot movement, challenging coordination, power, and lower body strength.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/bzcDtI0UJQZJT5');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1280,'bodyweight incline side plank','The bodyweight incline side plank is a core stability exercise that targets the abs, with secondary emphasis on the obliques and shoulders. It involves holding a plank position on your side with your body supported by your forearm and feet, focusing on maintaining a straight line and engaging the core.','waist','obliques, shoulders','https://v2.exercisedb.io/image/Bu4-Ivk7ehlN6i');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1281,'dumbbell incline alternate press','The dumbbell incline alternate press is a chest exercise performed on an incline bench, pressing dumbbells alternately to target the upper chest, shoulders, and triceps.','chest','shoulders, triceps','https://v2.exercisedb.io/image/puX8m7TSZU1kz8');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1282,'dumbbell seated alternate shoulder','The dumbbell seated alternate shoulder press is a strength exercise targeting the deltoids, performed while seated and alternating arms for each press. It also engages the triceps and upper back as secondary muscles.','shoulders','triceps, upper back','https://v2.exercisedb.io/image/mn2gLZg6tS53Kf');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1283,'dumbbell seated biceps curl to shoulder press','The dumbbell seated biceps curl to shoulder press is a compound exercise that targets the biceps and shoulders. It combines a biceps curl with a shoulder press, making it effective for building upper arm and shoulder strength.','upper arms','shoulders','https://v2.exercisedb.io/image/vPCfNNWGjxBJqe');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1284,'dumbbell single arm overhead carry','The dumbbell single arm overhead carry is a functional exercise that targets the deltoids while also engaging the traps and core. It challenges shoulder stability, core strength, and coordination as you walk while holding a dumbbell overhead.','shoulders','traps, core','https://v2.exercisedb.io/image/2rjCE6YNpszspC');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1285,'quick feet v. 2','Quick feet v. 2 is a bodyweight exercise that involves rapidly moving your feet up and down in place, focusing on speed and agility. It targets the quadriceps while also engaging the calves and hamstrings.','upper legs','calves, hamstrings','https://v2.exercisedb.io/image/lwqzVog4pFDA5t');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1286,'dumbbell standing alternate hammer curl and press','The dumbbell standing alternate hammer curl and press is a compound exercise that targets the biceps, forearms, and shoulders. It involves curling a dumbbell with a neutral grip and then pressing it overhead, alternating arms each repetition.','upper arms','forearms, shoulders','https://v2.exercisedb.io/image/GnQvN-3QuoSJ5H');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1287,'glute bridge march','The glute bridge march is a bodyweight exercise that targets the glutes while also engaging the hamstrings and quadriceps. It involves holding a glute bridge position and alternately lifting each knee towards the chest in a marching motion, challenging hip stability and core strength.','upper legs','hamstrings, quadriceps','https://v2.exercisedb.io/image/d7tS9-7-A29Vsf');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1288,'barbell glute bridge two legs on bench (male)','The barbell glute bridge with two legs on a bench is a compound lower body exercise that primarily targets the glutes, while also engaging the hamstrings and core. It is performed by resting your upper back on a bench, placing a barbell across your hips, and driving your hips upward to create a straight line from your knees to your shoulders.','upper legs','hamstrings, core','https://v2.exercisedb.io/image/2YRNaEfgkczShF');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1289,'cable one arm pulldown','The cable one arm pulldown is a unilateral exercise that targets the latissimus dorsi using a cable machine. It also engages the biceps and forearms as secondary muscles. The movement requires good form and control to isolate the lats and avoid compensatory movements.','back','biceps, forearms','https://v2.exercisedb.io/image/473bPqeAzZfRF3');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1290,'lunge with jump','The lunge with jump is a dynamic lower body exercise that combines a traditional lunge with a plyometric jump, targeting the glutes and also engaging the quadriceps, hamstrings, and calves. It requires balance, coordination, and explosive strength.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/ZOsSTMwdTOHwer');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1291,'dumbbell contralateral forward lunge','The dumbbell contralateral forward lunge is a lower body exercise that targets the glutes, with secondary emphasis on the quadriceps, hamstrings, and calves. It involves stepping forward with one leg while holding a dumbbell in the opposite hand, challenging strength, balance, and coordination.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/AU9IrqbJAXw1L7');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1292,'high knee against wall','High knee against wall is a bodyweight cardio exercise that involves running in place while bringing your knees up high, using a wall for balance and support. It targets the cardiovascular system and also works the quadriceps, hamstrings, glutes, and calves.','cardio','quadriceps, hamstrings, glutes, calves','https://v2.exercisedb.io/image/Pl0XdMDMLG0wAn');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1293,'wheel run','The wheel run is a dynamic exercise that targets the cardiovascular system while also engaging the core, quadriceps, hamstrings, and calves. It involves rolling a wheel forward and backward from a plank position, requiring both strength and coordination.','cardio','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/BO0p75o9QGqHAR');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1294,'push to run','The \'push to run\' exercise combines a push-up with a running-in-place motion, alternating knees towards the chest in a plank position. This movement elevates the heart rate and challenges both upper body strength and cardiovascular endurance.','cardio','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/URywIJPlB1v0Bv');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1295,'bent knee lying twist (male)','The bent knee lying twist (male) is a bodyweight exercise that targets the glutes and also engages the obliques and hip flexors. It involves lying on your back with bent knees and twisting them side to side, which helps improve flexibility and mobility in the lower back and hips.','upper legs','obliques, hip flexors','https://v2.exercisedb.io/image/6RkrZ3E1hNMjJM');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1296,'knee touch crunch','The knee touch crunch is a bodyweight abdominal exercise that targets the abs and also engages the hip flexors. It involves alternating reaching across the body to touch the opposite knee while performing a crunch motion.','waist','hip flexors','https://v2.exercisedb.io/image/Ng0dTWhzkU4AGX');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1297,'weighted kneeling step with swing','The weighted kneeling step with swing is a dynamic exercise that targets the deltoids while also engaging the triceps and core. It involves swinging weights overhead from a kneeling position, requiring coordination, balance, and strength.','shoulders','triceps, core','https://v2.exercisedb.io/image/Ipy-raG7XxSZMT');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1298,'weighted stretch lunge','The weighted stretch lunge is a lower body exercise that targets the glutes while also engaging the quadriceps, hamstrings, and calves. It involves stepping forward into a lunge position while holding weights, then returning to the starting position and alternating legs.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/9xWI629wbcIMKz');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1299,'weighted cossack squats (male)','Weighted cossack squats are a lower body exercise targeting the glutes, quadriceps, hamstrings, and calves. This movement requires significant balance, mobility, and strength, as you shift your weight laterally and squat deeply on one leg while holding a weight.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/1D-SWhYJZ-8oSZ');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1300,'weighted lunge with swing','The weighted lunge with swing is a dynamic lower body exercise that combines a traditional lunge with an upper body swinging motion using weights. This movement targets the glutes primarily, while also engaging the quadriceps, hamstrings, and calves. The swinging motion adds a coordination and balance challenge.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/fuUopI7QgndQUj');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1301,'single leg bridge with outstretched leg','The single leg bridge with outstretched leg is a bodyweight exercise targeting the glutes, with secondary emphasis on the hamstrings and quadriceps. It challenges stability and unilateral strength by requiring you to lift your hips while keeping one leg extended.','upper legs','hamstrings, quadriceps','https://v2.exercisedb.io/image/5dAJ1Gn2-EEyul');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1302,'walking high knees lunge','The walking high knees lunge is a dynamic exercise that combines high knee raises with forward lunges, targeting the cardiovascular system while also engaging the quadriceps, hamstrings, glutes, and calves. It is performed using only body weight and is effective for improving cardiovascular endurance, coordination, and lower body strength.','cardio','quadriceps, hamstrings, glutes, calves','https://v2.exercisedb.io/image/39CSzQ0v9zzyaN');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1303,'short stride run','Short stride run is a cardiovascular exercise performed by running with quick, short steps, either in place or moving forward. It primarily targets the cardiovascular system and also engages the quadriceps, hamstrings, and calves.','cardio','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/UF-ryo8EJOopxW');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1304,'pike-to-cobra push-up','The pike-to-cobra push-up is a dynamic bodyweight exercise that combines elements of a push-up, pike, and cobra pose. It targets the glutes primarily, while also engaging the core, shoulders, and triceps. The movement requires transitioning between an inverted V (pike) position and a cobra pose, demanding strength, flexibility, and coordination.','upper legs','core, shoulders, triceps','https://v2.exercisedb.io/image/bCqGj6rYtHOSfT');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1305,'reverse plank with leg lift','The reverse plank with leg lift is a challenging core exercise that targets the abs while also engaging the glutes, hamstrings, and shoulders. It requires maintaining a strong reverse plank position while alternately lifting each leg, demanding significant core strength, balance, and coordination.','waist','glutes, hamstrings, shoulders','https://v2.exercisedb.io/image/6TtEDdmcnIKc7R');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1306,'dumbbell side plank with rear fly','The dumbbell side plank with rear fly is a compound exercise that combines core stability with upper back and shoulder strength. It requires holding a side plank position while performing a rear fly with a dumbbell, challenging balance, coordination, and strength.','back','shoulders, core','https://v2.exercisedb.io/image/F8lkwQ3OHk2bI9');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1307,'power point plank','The power point plank is a dynamic core exercise that involves transitioning between a high plank and a forearm plank position, challenging core stability, shoulder strength, and coordination.','waist','shoulders, triceps, glutes','https://v2.exercisedb.io/image/aJufwPkyQv9mFN');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1308,'walking on incline treadmill','Walking on an incline treadmill is a cardiovascular exercise performed on a treadmill with the incline set to increase intensity. It primarily targets the cardiovascular system while also engaging the quadriceps, hamstrings, and calves.','cardio','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/nDJhOcTfQRBcNg');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1309,'side lying hip adduction (male)','The side lying hip adduction (male) is a bodyweight exercise targeting the adductors, performed while lying on your side and lifting the top leg upward.','upper legs','glutes, hamstrings','https://v2.exercisedb.io/image/m9OjYItFMekYUD');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1310,'standing archer','The standing archer is a bodyweight exercise that targets the upper back and involves rotational movement of the torso, mimicking the motion of drawing a bowstring. It also engages the shoulders, biceps, and forearms.','back','shoulders, biceps, forearms','https://v2.exercisedb.io/image/Jcr3wzFuykNGMD');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1311,'weighted decline sit-up','The weighted decline sit-up is an abdominal exercise performed on a decline bench with added resistance. It primarily targets the abs while also engaging the hip flexors and lower back. This variation increases the intensity compared to standard sit-ups, requiring greater core strength and control.','waist','hip flexors, lower back','https://v2.exercisedb.io/image/FgPNgUIxW4JDyr');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1312,'ski step','The ski step is a dynamic, bodyweight exercise that mimics the motion of skiing. It involves lateral jumps from side to side, engaging the cardiovascular system while also working the lower body muscles.','cardio','quadriceps, hamstrings, glutes, calves','https://v2.exercisedb.io/image/EjTehq8QDpe88n');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1313,'back and forth step','A dynamic bodyweight exercise that alternates stepping forward and backward, targeting the cardiovascular system and lower body muscles.','cardio','quadriceps, hamstrings, glutes, calves','https://v2.exercisedb.io/image/nOvl0HWP34OLZu');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1314,'sit-up with arms on chest','The sit-up with arms on chest is a classic abdominal exercise that targets the abs and also engages the hip flexors. It is performed by lying on your back, crossing your arms over your chest, and lifting your upper body towards your knees.','waist','hip flexors','https://v2.exercisedb.io/image/latDrwBbBFDtWm');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1315,'cable kneeling rear delt row (with rope) (male)','The cable kneeling rear delt row (with rope) targets the rear deltoids and upper back muscles, requiring the user to kneel and pull a rope attachment toward their body while maintaining a strong core and stable posture.','shoulders','trapezius, rhomboids, biceps','https://v2.exercisedb.io/image/EI7aAOjBbZ4FJH');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1316,'inchworm v. 2','The inchworm v. 2 is a bodyweight exercise that targets the abs while also engaging the shoulders and hamstrings. It involves moving from a standing position to a plank and back, promoting core strength, flexibility, and coordination.','waist','shoulders, hamstrings','https://v2.exercisedb.io/image/vho2vj91b2xKdA');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1317,'shoulder tap','Shoulder taps are a bodyweight exercise performed in a high plank position, targeting the abs while also engaging the shoulders and triceps. The movement requires you to alternate tapping your shoulders with the opposite hand, challenging core stability and coordination.','waist','shoulders, triceps','https://v2.exercisedb.io/image/eMrePj0hJLbW8t');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1318,'lever standing chest press','The lever standing chest press is a machine-based exercise that targets the pectoral muscles, with secondary emphasis on the shoulders and triceps. It is performed standing, using a leverage machine, and involves pressing handles forward from chest level to full extension.','chest','shoulders, triceps','https://v2.exercisedb.io/image/VeV6-1RKhRFBE-');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1319,'lever seated good morning','The lever seated good morning is a machine-based exercise targeting the glutes, with secondary emphasis on the hamstrings and lower back. It involves hinging at the hips while seated, using a leverage machine to provide resistance.','upper legs','hamstrings, lower back','https://v2.exercisedb.io/image/bu6CJn03tPK8ci');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1320,'lever seated crunch v. 2','The lever seated crunch v. 2 is an abdominal exercise performed on a leverage machine. It targets the abs, with secondary emphasis on the obliques and hip flexors. The movement involves crunching forward against resistance, making it a controlled and effective core strengthening exercise.','waist','obliques, hip flexors','https://v2.exercisedb.io/image/9kL4OxoeuKQ1Cd');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1321,'curtsey squat','The curtsey squat is a lower body exercise that targets the glutes and also works the quadriceps, hamstrings, and calves. It involves stepping one leg diagonally behind and across the body, bending both knees to lower into a squat, and then returning to the starting position. This movement challenges balance and coordination in addition to strength.','upper legs','quadriceps, hamstrings, calves','https://v2.exercisedb.io/image/NIwNcPKnWZydx5');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1322,'incline push-up (on box)','The incline push-up (on box) is a bodyweight exercise that targets the pectoral muscles, with secondary emphasis on the triceps and shoulders. It is performed by placing the hands on an elevated surface, such as a box, and executing a push-up motion.','chest','triceps, shoulders','https://v2.exercisedb.io/image/PnZuwHXPiR2-Yp');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1323,'dumbbell one arm snatch','The dumbbell one arm snatch is a dynamic, full-body movement that targets the glutes, hamstrings, quadriceps, and core. It requires explosive power, coordination, and balance as you lift a dumbbell from the ground to overhead in one fluid motion.','upper legs','hamstrings, quadriceps, core','https://v2.exercisedb.io/image/ZolWfh2jvSutFH');
INSERT INTO exercise (id,name,description,muscle,secondary_muscle,gif_url) VALUES (1324,'dumbbell waiter biceps curl','The dumbbell waiter biceps curl is an isolation exercise targeting the biceps, performed with dumbbells. It also engages the forearms and shoulders as secondary muscles. The movement requires basic strength and coordination, making it suitable for most fitness levels.','upper arms','forearms, shoulders','https://v2.exercisedb.io/image/iKeD4LI22WHVIU');
